REPLACE INTO series (id, description, is_series, language, name, picture, rating, watched) VALUES ('SH013027100000','Coverage of the day\'s activities in Parliament.',NULL,'GBR','Westminster Hall','https://s3.amazonaws.com/schedulesdirect/assets/p528649_b_h3_aa.jpg',4,NULL),('SH031459900000','Comedy game show hosted by Josh Widdicombe and James Acaster, in which leading comedians are posed increasingly absurd hypothetical situations.',NULL,'GBR','Hypothetical','https://s3.amazonaws.com/schedulesdirect/assets/p16485312_b_h3_aa.jpg',4,NULL),('SH025302610000','A weekly look at the world of Formula E, with driver interviews and pre/post race analysis.',NULL,'GBR','Formula E: Street Racers','https://s3.amazonaws.com/schedulesdirect/assets/p13372468_b_h3_aa.jpg',4,NULL),('SH019863440000','In Mathe verstehst du nur Bahnhof? Sebastian Wohlrab und seine Schüler helfen dir weiter.',NULL,'DEU','GRIPS: Mathe','https://s3.amazonaws.com/schedulesdirect/assets/p11026617_b_h3_aa.jpg',4,NULL),('SH012943500000','\"Nazi Hunters\" tells of how an unrelenting band of secret agents and avengers hunted down some of the most evil men in history and finally brought them to justice. Included are tales of the pursuit of Adolf Eichmann, Erich Priebke, \"Butcher of Lyon\" Klaus Barbie, and \"Angel of Death\" Josef Mengele.',NULL,'GBR','Nazi Hunters','https://s3.amazonaws.com/schedulesdirect/assets/p8173535_i_h3_aa.jpg',4,NULL),('SH013634930000','The life of the officers and men of the King\'s Fusiliers infantry regiment, at home and at battle.',NULL,'GBR','Soldier, Soldier','https://s3.amazonaws.com/schedulesdirect/assets/p490454_b_h3_aa.jpg',4,NULL),('SH019656370000','Die Dokumentationsreihe berichtet über Geschichten von exotischen Schauplätzen, außergewöhnlichen Menschen, wenig erforschten Tierarten sowie erstaunlichen Naturphänomenen, und zeigt interessante Forschungsberichte über die Tiefsee.',NULL,'DEU','mare TV kompakt','https://s3.amazonaws.com/schedulesdirect/assets/p10944077_b_h3_aa.jpg',4,NULL),('SH019560060000','Die Sendung berichtet über Themen aus den Bereichen Wissenschaft, Technik und Mensch. Auf unterschiedliche Fragen wird versucht, Antworten zu finden und diese auf unkomplizierte und leicht verständliche Weise zu vermitteln.',NULL,'DEU','Abenteuer Leben täglich','https://s3.amazonaws.com/schedulesdirect/assets/p10903651_st_h3_ab.jpg',4,NULL),('SH013022490000','Chef Gordon Ramsay hits the road in search of restaurants in crisis, where he steps in and addresses some of the most stressful aspects of running a successful food business. Ramsay and his team redecorate each eatery to give it a fresh look in the hope of attracting a larger crowd. Ramsay\'s ultimate goal is to make the restaurants he visits profitable for their struggling owners.',NULL,'GBR','Ramsay\'s Kitchen Nightmares USA','https://s3.amazonaws.com/schedulesdirect/assets/p185566_i_h3_ab.jpg',4,NULL),('SH012595550000','Sick, twisted and politically incorrect, the animated series features the adventures of the Griffin family. Endearingly ignorant Peter and stay-at-home wife Lois reside in Quahog, R.I., and have three kids. Meg, the eldest child, is a social outcast, and teenage Chris is awkward and clueless when it comes to the opposite sex. The youngest, Stewie, is a genius baby bent on killing his mother and destroying the world. The talking dog, Brian, keeps Stewie in check while sipping martinis and sorting through his own life issues.',NULL,'GBR','Family Guy','https://s3.amazonaws.com/schedulesdirect/assets/p184483_i_h3_ab.jpg',4,NULL),('SH023535090000','Swords may not be the weapon of choice for many people nowadays, but that doesn\'t stop some from continuing to work as bladesmiths. \"Forged in Fire\' tests some of the best in the field as they attempt to re-create some of history\'s most iconic edged weapons. Former Army Ranger Wil Willis hosts the competition series that sees four master bladesmiths challenged in each episode to forge the swords, which are then tested by a panel of judges consisting of J. Neilson, who has been making knives for more than 20 years, hand-to-hand combat specialist Doug Marcaida, and David Baker, an authority on replicating period-accurate weaponry. The contestant who survives the elimination rounds and wins the episode\"s contest earns $10,000 and the title of Forged in Fire champion.',NULL,'GBR','Forged in Fire','https://s3.amazonaws.com/schedulesdirect/assets/p11771815_i_h3_ab.jpg',4,NULL),('SH013005830000','Waverly council lifeguards patrol the shores of Australia\'s famous Bondi Beach, where they face a multitude of challenges, and participate in daring rescues to ensure that the guests experience a safe environment at the beach.',NULL,'GBR','Bondi Rescue','https://s3.amazonaws.com/schedulesdirect/assets/p343242_b_h3_ac.jpg',4,NULL),('SH015402070000','Ratgebermagazin rund um die Gesundheit.',NULL,'DEU','Hauptsache gesund','https://s3.amazonaws.com/schedulesdirect/assets/p9125757_b_h3_aa.jpg',4,NULL),('SH025551370000','Auf dem Gelände des ehemaligen Stahlwerks ist in den vergangenen Jahren ein Naherholungsgebiet entstanden. Dieser Strukturwandel lässt zwei soziale Milieus aufeinandertreffen, die normalerweise nicht miteinander in Berührung kämen: die Alteingesessenen in der Arbeitersiedlung Hörde und die, die in die neuen Villen am Ufer des Phoenixsees zugezogen sind.',NULL,'DEU','Phoenixsee','https://json.schedulesdirect.org/20141201/image/assets/p13500120_i_h3_aa.jpg',4,NULL),('SH032268380000','Die Strohhüte landen auf der Insel Dressrosa. Nachdem sie von Doflamingos Eroberung des Königreichs erfahren haben, schließen sich die Strohhüte mit den Revolutionären und Prinzessin Viola zusammen, um Doflamingo zu stürzen und die Insel zu retten.',NULL,'DEU','One Piece','https://s3.amazonaws.com/schedulesdirect/assets/p12201877_st_h3_aa.jpg',4,NULL),('SH025069650000','Canadian-born Dave and Kortney Wilson met in Nashville, Tennessee, and a few years later they were making a family and music together, dropping their solo careers to perform as the Wilsons. Ever creative, Dave and Kortney have since packed the microphones and left the studio to take advantage of the Music City\'s burgeoning housing market. \"Masters of Flip\' tells of the couple\"s adventures through the messes and stresses of renovations and the anticipation of enormous profits. Tireless contractor Dave and award-winning realtor Kortney have built their real estate business through flips, buy and hold properties, and vacation rentals.',NULL,'GBR','Masters of Flip','https://s3.amazonaws.com/schedulesdirect/assets/p11680488_b_h3_ad.jpg',4,NULL),('SH022488570000','A comprehensive round-up of all the weekend\'s action in Spain\'s LaLiga.',NULL,'GBR','LaLiga World','https://s3.amazonaws.com/schedulesdirect/assets/p12043305_b_h3_aa.jpg',4,NULL),('SH014069440000','Coverage of a fixture from the top division of the Spanish football league system.',NULL,'GBR','LaLiga Football','https://s3.amazonaws.com/schedulesdirect/assets/p8626808_b_h3_ab.jpg',4,NULL),('SH016571710000','An insight into this rarely seen world of high stakes, colourful characters and extreme conditions.',NULL,'GBR','Outback Truckers','https://s3.amazonaws.com/schedulesdirect/assets/p9629919_i_h3_ab.jpg',4,NULL),('SH022786090000','This series goes on a journey through history to discover the world\'s ultimate spies. Several countries have been known to incorporate espionage to keep an eye on enemy plans. Working for the state, crown or government, these spies operated sophisticated-but-hidden communication networks in times when modern technology was nonexistent. The episodes explore the secrets of Tudor and Elizabethan England, 17th-century France and the American Civil War. Drama reconstructions depict historical profiles of operatives carrying out their dangerous missions.',NULL,'GBR','History\'s Ultimate Spies','https://json.schedulesdirect.org/20141201/image/assets/p12182428_i_h3_aa.jpg',4,NULL),('SH019672380000','Geschichten aus Gesellschaft, Wissenschaft und Kultur: Ereignisse, die bewegten und bewegen.',NULL,'DEU','Der Osten: Entdecke wo du lebst','https://s3.amazonaws.com/schedulesdirect/assets/p10950638_b_h3_ab.jpg',4,NULL),('SH013286270000','A short broadcast made by a political party.',NULL,'GBR','Party Political Broadcast','https://s3.amazonaws.com/schedulesdirect/assets/p849531_b_h3_aa.jpg',4,NULL),('SH028224030000','Gordon Ramsay reist zu den beliebten Touristenzielen in Europa. Dort hilft er Briten, die sich ihren Traum vom eigenen Restaurant erfüllt haben. Jedoch droht deren Traum zum Albtraum zu werden, denn die Restaurants stecken in der Krise.',NULL,'DEU','In Teufels Küche mit Gordon Ramsay - Weltweit','https://s3.amazonaws.com/schedulesdirect/assets/p11067716_i_h3_ab.jpg',4,NULL),('SH034253870000','In der Rateshow müssen Kandidatenpaar den Wert verschiedener Gegenstände richtig schätzen. Es geht ganz schön zur Sache, und wem es gelingt, am Ende den wertvollsten Gegenstand ausgewählt zu haben, räumt den Gegenwert in Cash ab.',NULL,'DEU','Kitsch oder Kasse','https://s3.amazonaws.com/schedulesdirect/assets/p17860386_st_h3_aa.jpg',4,NULL),('SH019834270000','Ein Team von forensischen Spezialisten der Polizei in Las Vegas untersucht Tatorte und arbeitet daran, grausame Verbrechen in der Stadt der Sünden aufzulösen.',NULL,'DEU','CSI: Den Tätern auf der Spur','https://s3.amazonaws.com/schedulesdirect/assets/p184657_b_h3_at.jpg',4,NULL),('SH034314030000','Deutschlands bekanntester Make-up-Künstler Boris Entrup hat bereits Berühmtheiten wie Topmodel Naomi Campbell und Angelina Jolie für Auftritte geschminkt. In dieser Sendung sucht er frische Talente, die unterschiedliche Looks kreieren können.',NULL,'DEU','Let\'s Glow - Die Make-Up-Challenge','https://s3.amazonaws.com/schedulesdirect/assets/p17898512_st_h3_aa.jpg',4,NULL),('SH020143070000','ZIB 2 - das ist das tägliche Nachrichten-Magazin des ORF-Fernsehens. Die Sendung setzt Schwerpunkte und liefert Hintergründe.',NULL,'DEU','ZIB 2','https://s3.amazonaws.com/schedulesdirect/assets/p11119175_i_h3_aa.jpg',4,NULL),('SH027888400000','Die Sendung stellt die Genies hinter den Errungenschaften der US-amerikanischen Raumfahrt vor.',NULL,'DEU','Griff nach den Sternen','https://s3.amazonaws.com/schedulesdirect/assets/p14070943_i_h3_ac.jpg',4,NULL),('SH034364840000','Auf einer Reise rund um den Planeten geht Dirk Steffens der Frage nach, warum Wissenschaftler ein neues Erdzeitalter benennen wollen: das Anthropozän, das Zeitalter des Menschen.In der Folge Erde steht die Landwirtschaft im Vordergrund.',NULL,'DEU','Anthropozän - Das Zeitalter des Menschen','https://s3.amazonaws.com/schedulesdirect/assets/p17933876_st_h3_aa.jpg',4,NULL),('SH020284720000','Bekannte Persönlichkeiten des kirchlichen Lebens in Bayern nehmen die Zeichen der Zeit in den Blick und deuten das Evangelium hin auf die momentanen gesellschaftlichen Befindlichkeiten. Mit ihren Gedanken zu christlichen Festen wollen sie die Zuschauer sensibilisieren für das, was hinter den Dingen und unter der Oberfläche des menschlichen Lebens liegt, und die göttliche Wirklichkeit im Alltag aufdecken.',NULL,'DEU','Zeit und Ewigkeit','https://s3.amazonaws.com/schedulesdirect/assets/p11168144_b_h3_aa.jpg',4,NULL),('SH015829260000','The daytime game show, presented by Ben Shephard, features contestants getting a chance to play a large coin-drop machine, provided they answer questions correctly. Wrong answers and the players could be eliminated. The last contestant standing has an opportunity to win the machine\'s £10,000 jackpot.',NULL,'GBR','Tipping Point','https://s3.amazonaws.com/schedulesdirect/assets/p9322562_i_h3_aa.jpg',4,NULL),('SH021649870000','In the 1980s, geeky 11-year-old Adam uses a video camera to document his family\'s crazy life. His mother, Beverly, is overprotective and lacks boundaries, while his dad has a hot temper and finds it difficult to parent without screaming. Rounding out the clan are Adam\'s terrifying sister, Erica, 17; his older brother, Barry, who has middle-child syndrome; and the family\'s beloved grandfather, Al \"Pops\" Solomon. Pops is responsible for wild antics, including offering drinks to Barry and teaching Adam about the ways of love - which create more chaos in an already high-strung family.',NULL,'GBR','The Goldbergs','https://s3.amazonaws.com/schedulesdirect/assets/p9977319_l_h3_ab.jpg',4,NULL),('SH017028920000','Eine Geburt ist ein Wunder - für die Eltern jedoch meist auch eine emotionale Achterbahnfahrt. Die Doku-Serie gibt einen Einblick in den Alltag im Klinikum Südstadt Rostock, in dem jedes Jahr ca. 3000 Entbindungen stattfinden.',NULL,'DEU','Babys! Kleines Wunder - großes Glück','https://s3.amazonaws.com/schedulesdirect/assets/p9804879_st_h3_aa.jpg',4,NULL),('SH018446000000','Lisa Vanderpump first gained fame as a cast member on \"The Real Housewives of Beverly Hills\', but her full-time job is as co-owner and boss at West Hollywood, California, restaurant SUR, which stands for Sexy Unique Restaurant. Vanderpump balances her motherly instinct with her shrewd business sense to maintain control over the restaurant\'s wild group of employees who are working at the eatery while pursuing their dreams. SUR\"s employees include server Stassi, who wants to be the next big thing in fashion, and her sometimes boyfriend, bartender Jax, who is a model.',NULL,'GBR','Vanderpump Rules','https://s3.amazonaws.com/schedulesdirect/assets/p9656862_l_h3_aa.jpg',4,NULL),('SH012846970000','Chiropractor and single father Alan Harper lives in a beachfront house with his underachieving son, Jake, and divorced Internet billionaire Walden Schmidt. Schmidt moves in with the Harpers and offers to buy the house following the untimely death of Alan\'s brother, Charlie, who owned the house and had lived there with Alan and Jake when the father and son moved in following Alan\'s divorce. Alan\'s ex-wife and Jake\'s mother, Judith, remains a part of their lives. Also featured in the series are Alan\'s mother, Evelyn, and sharp-tongued housekeeper Berta.',NULL,'GBR','Two and a Half Men','https://s3.amazonaws.com/schedulesdirect/assets/p8218909_b_h3_aa.jpg',4,NULL),('SH033118560000','Following the lives of a small community of garden dwellers, who try to solve the problems of everyday life with a positive attitude.',NULL,'GBR','Tall Tales','https://s3.amazonaws.com/schedulesdirect/assets/p17364893_b_h3_aa.jpg',4,NULL),('SH018042140000','With more than one million reports of animal cruelty and mistreatment every year, the RSPCA is under increased pressure to keep Britain\'s pets safe from abusive owners and unscrupulous breeders. \"The Dog Rescuers\' follows the organisation\'s inspectors as they track down some of the UK\"s abused and mistreated animals in an attempt to rescue them. Among the crimes against dogs that they investigate are poor living conditions, illegal mass breeding, malnutrition and organised fights. When successful in rescuing the dogs, the animals are rehabilitated and eventually given new homes.',NULL,'GBR','The Dog Rescuers','https://s3.amazonaws.com/schedulesdirect/assets/p10243572_i_h3_aa.jpg',4,NULL),('SH006655400000','Series following New Zealand cops as they confront the best and the worst behaviour on the nation\'s busiest motorway.',NULL,'GBR','Motorway Patrol','https://s3.amazonaws.com/schedulesdirect/assets/p265855_i_h3_aa.jpg',4,NULL),('SH028880440000','Talented young cooks take over the kitchen and celebrate their heritage by cooking some very special recipes. They discover where these dishes and ingredients come from along the way.',NULL,'GBR','My World Kitchen','https://s3.amazonaws.com/schedulesdirect/assets/p15105079_st_h3_aa.jpg',4,NULL),('SH019654750000','Aktuelle Tests und Testergebnisse von Produkten und Dienstleistungen werden präsentiert, angefangen von Säften über Elektronikgeräte, Mobilfunkshops, Fluganbieter, der Riester-Rente, Autozubehör und Stromversorger bis hin zu teuren Restaurants.',NULL,'DEU','Ratgeber - Test','https://s3.amazonaws.com/schedulesdirect/assets/p10943714_st_h3_ab.jpg',4,NULL),('SH020868640000','Drei Mediziner wollen allein mit gezielten Ernährungsstrategien Symptome deutlich verbessern und Krankheiten sogar heilen. Die Reihe zeigt, wie mit speziellem Essen schon innerhalb weniger Monate oft mehr erreicht werden kann als mit Tabletten.',NULL,'DEU','Die Ernährungs-Docs','https://s3.amazonaws.com/schedulesdirect/assets/p11358042_b_h3_aa.jpg',4,NULL),('SH026290490000','Dana Newman präsentiert verschiedene Themen, um vorhandene Englischkenntnisse aufzufrischen. In kleinen Häppchen werden Grammatikregeln wiederholt oder Unterhaltungsthemen wie englischsprachige Musik präsentiert, um den Wortschatz zu erweitern.',NULL,'DEU','English bite-size','https://s3.amazonaws.com/schedulesdirect/assets/p13854651_st_h3_aa.jpg',4,NULL),('SH019560930000','Die siebenköpfige, hochspezialisierte FBI-Eliteeinheit aus erfahrenen Psychologen und Special Agents erstellt Serientäterprofile, um damit Gewaltverbrechern zuvorzukommen. Jeder der Ermittler trägt mit seinem Spezialwissen zur Analyse und Aufklärung der Verbrechen bei und gemeinsam riskieren sie Kopf und Kragen, denn Criminal Minds ist wie ein Spiel gegen einen unberechenbaren Gegner: Jeder Zug ist ungewiss und kann ein schnelles Schachmatt bedeuten.',NULL,'DEU','Criminal Minds','https://s3.amazonaws.com/schedulesdirect/assets/p185123_l_h3_aa.jpg',4,NULL),('SH029665690000','Goldsucher Dakota und sein Sohn wollen mithilfe von erfahrenen Tauchern und Bergsteigern das Gold aus dem Boden holen, das sich am Grund des McKinley Creek befindet. Die beiden gehen auf volles Risiko und versuchen, was noch keiner geschafft hat.',NULL,'DEU','Goldrausch: White Water Alaska','https://json.schedulesdirect.org/20141201/image/assets/p14928011_i_h3_aa.jpg',4,NULL),('SH028472930000','Following the success of Impossible Engineering, the history series displays the world\'s most extraordinary railway engineering achievements, and serves as the ultimate guide to the world\'s rail networks. \"Impossible Railways\" explores how railways have been at the forefront of modern engineering and transport since their meteoric rise in the 19th century. The series captures design breakthroughs and the genius of pioneers who embraced nature and the challenges of physics in order to create a global railway network.',NULL,'GBR','Impossible Railways','https://s3.amazonaws.com/schedulesdirect/assets/p14957254_st_h3_ab.jpg',4,NULL),('SH018580010000','Chris und Martin Kratt sind Brüder. Der Biologe und der Zoologe widmen ihre Zeit und ihr Leben dem Tierschutz und sind immer zur Stelle, wenn Tiere in Not geraten. Und so reisen sie um die ganze Welt, erleben ein spannendes Abenteuer nach dem anderen und lernen die exotischsten Tiere kennen.',NULL,'DEU','Go Wild! - Mission Wildnis','https://s3.amazonaws.com/schedulesdirect/assets/p8369911_i_h3_aa.jpg',4,NULL),('SH012970810000','Magazine style sketch show that comically scrutinises the latest news, views and issues of the day.',NULL,'GBR','Newsjack','https://s3.amazonaws.com/schedulesdirect/assets/p8182115_st_h3_aa.jpg',4,NULL),('SH034073570000','After Whitney loses her job, she moves her two kids to Toronto to start a gymnastics club with her father.',NULL,'GBR','My Perfect Landing','https://s3.amazonaws.com/schedulesdirect/assets/p17780012_st_h3_aa.jpg',4,NULL),('SH023711990000','Two brothers help homeowners buy and sell homes.',NULL,'GBR','Buying and Selling','https://s3.amazonaws.com/schedulesdirect/assets/p9180009_i_h3_aa.jpg',4,NULL),('SH003165340000','Das Magazin befasst sich vor allem mit den Themen Wirtschaft, Politik, Finanzen und Verbraucherschutz, erklärt neue Gesetze und aktuelle Wirtschaftsereignisse und deckt auf, wann und wo der Normalbürger ausgetrickst oder betrogen wurde.',NULL,'DEU','WISO','https://s3.amazonaws.com/schedulesdirect/assets/p526802_b_h3_ab.jpg',4,NULL),('SH021319170000','Be Beautiful brings you the best make-up artists and beauty vloggers for a series of individual make-up tutorials.',NULL,'GBR','Be Beautiful','https://s3.amazonaws.com/schedulesdirect/assets/p11531827_b_h3_aa.jpg',4,NULL),('SH020683970000','Duggee is a big, friendly dog who runs The Squirrel Club, an after-school activity club where children can learn and take part in all kinds of activities, have fun adventures, and earn badges for their achievements.',NULL,'GBR','Hey Duggee','https://s3.amazonaws.com/schedulesdirect/assets/p11305731_b_h3_aa.jpg',4,NULL),('SH034254140000','Der Moderator lädt drei Hobbyköche zum Improvisations-Kochduell ein. In 25 Minuten müssen sie ein vorgegebenes Gericht zubereiten, wobei Steffen Henssler einige Gemeinheiten in der Hinterhand hat, um den Kandidaten das Leben schwer zu machen.',NULL,'DEU','Hensslers Countdown - Kochen am Limit','https://s3.amazonaws.com/schedulesdirect/assets/p17860617_st_h3_aa.jpg',4,NULL),('SH032896120000','Das Magazin bietet einen kompakten Überblick zu allen bekannten Titeln und Wettbewerben.',NULL,'DEU','bwin Inside eSports','https://s3.amazonaws.com/schedulesdirect/assets/p16448204_st_h3_ae.jpg',4,NULL),('SH029547070000','Die Sendung zeigt die aktuellsten Neuigkeiten aus dem Alltag aus allen Regionen Deutschlands mit spannenden Geschichten. Meteorologen vertiefen sachkundig die Wetterlage und Windbewegungen bis hin zum Bio- und Pflanzwetter.',NULL,'DEU','Live nach Neun','https://s3.amazonaws.com/schedulesdirect/assets/p15445469_st_h3_aa.jpg',4,NULL),('SH019560690000','Anwälte befassen sich in authentisch nachgestellten Rechtsfällen mit Streitigkeiten aller Art und klären verschiedene Fälle auf. Die Juristen sind spezialisiert in Fällen wie unter anderem Baupfusch, Mobbing oder Scheidung.',NULL,'DEU','Anwälte im Einsatz','https://s3.amazonaws.com/schedulesdirect/assets/p10904313_b_h3_aa.jpg',4,NULL),('SH034353290000','Europäische Hauptstädte haben Namensvettern in den verschiedensten Ecken der Welt. Diese Dokumentationsreihe lädt auf eine Entdeckungsreise ein, bei der diese Zwillingsstädte a