r zum Erlernen der französischen Sprache ermuntern und Grundkenntnisse vermitteln oder auffrischen soll. Er wurde als ein Beitrag zum Kulturabkommen entwickelt.',NULL,'DEU','Les Gammas','https://s3.amazonaws.com/schedulesdirect/assets/p11727496_b_h3_aa.jpg',4,NULL),('SH031661660000','In Knowsley, Liverpool, three out of every five families has a single parent. But the impressive single mums who live there have each other. In the first of the series, our single mums find a way to provide for their kids, come what may.',NULL,'GBR','Single Mum & Proud','https://json.schedulesdirect.org/20141201/image/assets/p16602792_i_h3_aa.jpg',4,NULL),('SH019370140000','Dr. Leonard Leakey Hofstadter und Dr. Sheldon Cooper sind geniale Physiker, arbeiten im selben Institut und teilen sich eine Wohnung. Im Umgang mit der sozialen Umwelt hingegen hat vor allem Sheldon seine Schwierigkeiten. Zu ihrem Freundeskreis gehören Dr. Rajesh Ramayan Koothrappali und der Ingenieur Howard Wolowitz. Als die hübsche Penny in die Wohnung nebenan einzieht, kann sie zunächst nicht viel mit den merkwürdigen Wissenschaftlern, die ihre Freizeit am liebsten im Comicbuchladen und Halo oder World of Warcraft spielend verbringen, anfangen. Nach einer Weile wächst ihr die Gruppe aber ans Herz.',NULL,'DEU','The Big Bang Theory','https://s3.amazonaws.com/schedulesdirect/assets/p185554_l_h3_aa.jpg',4,NULL),('SH012600970000','This series uses re-enactments and interviews to retell the circumstances of, well, mysteries that are unsolved. Covering crimes, tales of lost love, unexplained history and paranormal events, viewers are encouraged to provide information that might solve the mystery.',NULL,'GBR','Unsolved Mysteries','https://s3.amazonaws.com/schedulesdirect/assets/p184516_i_h3_aa.jpg',4,NULL),('SH013042310000','Inside the secure corridors of Criminal Intelligence 5, a high-level British anti-crime unit, George Cowley hands out tough assignments to his two top agents: thuggish William Andrew Philip Bodie, who favors a \"hit first, ask questions later\" style, and the more cerebral Raymond Doyle, a former Docklands police constable.',NULL,'GBR','The Professionals','https://s3.amazonaws.com/schedulesdirect/assets/p184229_i_h3_aa.jpg',4,NULL),('SH016889010000','Die Sendung `ZDFzeit\' zeigt Dokumentationen mit einem breiten Spektrum an zeitgeschichtlichen sowie historischen, wirtschaftlichen und politischen Themen.',NULL,'DEU','ZDFzeit','https://s3.amazonaws.com/schedulesdirect/assets/p9745829_b_h3_aa.jpg',4,NULL),('SH016113240000','An inside look at the lives of emergency services personnel in the United Kingdom, following the specially trained police, fire and ambulance teams on the front line as they answer millions of emergency calls every year, and discovering how they cope with making life or death decisions under stress on a daily basis. The cameras follow the work of first responders around the clock, providing an insight into a world full of drug- and alcohol-induced injuries, domestic violence, car accidents and fires.',NULL,'GBR','999: What\'s Your Emergency?','https://s3.amazonaws.com/schedulesdirect/assets/p9448418_i_h3_ab.jpg',4,NULL),('SH032600570000','Two part dramas concerning the various drifters who rent rooms in a lodging house.',NULL,'GBR','Rooms','https://s3.amazonaws.com/schedulesdirect/assets/p17089032_st_h3_aa.jpg',4,NULL),('SH020265790000','Eccentric genius Walter O\'Brien leads a group of brilliant misfits who constitute Homeland Security\'s new think tank, helping defend against the high-tech threats of the computer age. The team - dubbed Scorpion - includes behaviourist Toby Curtis, mechanical prodigy Happy Quinn, and statistics guru Sylvester Dodd. While comfortable with one another, the team members struggle with understanding life outside their circle, so when they need help translating societal cues, they rely on the skills of Paige Dineen, a woman with a gifted young son.',NULL,'GBR','Scorpion','https://s3.amazonaws.com/schedulesdirect/asse