ichen gesellschaftlichen Themen.',NULL,'DEU','STATIONEN','https://s3.amazonaws.com/schedulesdirect/assets/p10976501_i_h3_aa.jpg',4,NULL),('SH033100900000','ONE lässt die Herzen von echten Serien-Nerds höher schlagen und lädt zu einem ernsthaften Talk über Serien ein.',NULL,'DEU','Seriös - Das Serienquartett','https://s3.amazonaws.com/schedulesdirect/assets/p17355309_b_h3_aa.jpg',4,NULL),('SH027485190000','Die Dokumentarreihe begleitet die Grenzschützer Spaniens bei ihrer täglichen Verbrechensbekämpfung. Rund um die Uhr sind die Männer und Frauen im Einsatz, um Drogenhändlern, Schlepperbanden und Schmugglern zuvorzukommen.',NULL,'DEU','Border Control - Spaniens Grenzschützer','https://s3.amazonaws.com/schedulesdirect/assets/p13272827_i_h3_aa.jpg',4,NULL),('SH020657010000','Frank Reagan ist Chef der Polizei von New York. Der Witwer folgt damit seinem Vater, der diese Behörde früher ebenfalls leitete und mit seinem Wissen und seinen Kontakten immer wieder hilfreich zur Seite steht. Der Kampf gegen das Verbrechen ist für die Reagans also kein bloßer Job sondern eine regelrechte Familienangelegenheit. Denn auch Franks Tochter Erin und seine Söhne Daniel und Jamison sind schon Träger der typischen blauen Polizeiuniformen.',NULL,'DEU','Blue Bloods - Crime Scene New York','https://s3.amazonaws.com/schedulesdirect/assets/p8130493_i_h3_ab.jpg',4,NULL),('SH029383020000','Experten geben Tipps für die Gartenpraxis sowie die Gestaltung von Gärten und Balkonen. Einen Schwerpunkt bilden Berichte über Pflanzen und Filme über die schönsten Gärten der Welt. Hinzu kommen viele Anregungen und Gestaltungs-Inspirationen.',NULL,'DEU','Schnittgut. Alles aus dem Garten','https://s3.amazonaws.com/schedulesdirect/assets/p15372135_st_h3_aa.jpg',4,NULL),('SH027712470000','Following an hour in the life of the West Midlands paramedics as they deal with a wide range of cases where life is on the line.',NULL,'GBR','999: On the Frontline','https://s3.amazonaws.com/schedulesdirect/assets/p14513130_st_h3_aa.jpg',4,NULL),('SH034302800000','Die 13-jährige furchtlose Anne Boonchuy landet aus Versehen in der magischen Welt `Amphibia\', die von sprechenden Fröschen, Kröten und Insekten bevölkert wird. Dort freundet sie sich mit einem Frosch namens Sprig an und lernt seine Familie kennen.',NULL,'DEU','Amphibia','https://s3.amazonaws.com/schedulesdirect/assets/p16947359_b_h3_ab.jpg',4,NULL),('SH015401980000','Bei Tele-Gym werden verschiedene Gymnastikübungen vor der Kamera präsentiert. Die Athleten fordern die Zuschauer vor dem Bildschirm auf die Übungen mitzumachen. Es gibt Sendungen mit verschiedenen Schwerpunkten, wie beispielsweise Rückentraining.',NULL,'DEU','Tele-Gym','https://s3.amazonaws.com/schedulesdirect/assets/p9125740_b_h3_aa.jpg',4,NULL),('SH027196650000','Die Sendung verbindet wissenschaftliche Untersuchungen mit CGI-Animationen, um ungeklärte und unentdeckte Geheimnisse bedeutender Monumente zu lüften. Der Mix aus Ingenieurswesen, Geologie und Archäologie enthüllt die Strukturen hinter den Bauten.',NULL,'DEU','Giganten der Geschichte','https://s3.amazonaws.com/schedulesdirect/assets/p13174682_i_h3_aa.jpg',4,NULL),('SH029044220000','Behind-the-scenes look inside one of the United Kingdom\'s biggest police car workshops. Documenting the day-to-day tasks carried out by the Cheshire Police, this series focuses primarily on the team in charge of keeping the force\'s large fleet of vehicles in tip-top shape. From repairing damaged riot vans to building new armed response cars, all of the vehicles that are worked on need to be delivered in a condition that enables officers to perform their demanding roles successfully in the line of duty.',NULL,'GBR','Cop Car Workshop','https://s3.amazonaws.com/schedulesdirect/assets/p15183597_b_h3_aa.jpg',4,NULL),('SH024268150000','In der medizinischen Ratgebersendung behandelt Dr. Johannes Wimmer vom Universitätskrankenhaus Hamburg alltagsrelevante Themen rund um Medikamente und Gesundheit. Er gibt Tipps, wie sich die Zuschau