irect/assets/p14212806_st_h3_aa.jpg',4,NULL),('SH013088890000','Classic children\'s puppet comedy.',NULL,'GBR','Sooty','https://s3.amazonaws.com/schedulesdirect/assets/p910544_i_h3_aa.jpg',4,NULL),('SH013063840000','Lynne Ferguson\'s bittersweet sitcom set on a small island off the West Coast of Scotland.',NULL,'GBR','Millport','https://s3.amazonaws.com/schedulesdirect/assets/p264197_st_h3_aa.jpg',4,NULL),('SH034428120000','A talented young physicist discovers a potion that makes him invisible. But the drug has deadly side effects. Read by Stephen Murray.',NULL,'GBR','HG Wells: The Invisible Man','https://s3.amazonaws.com/schedulesdirect/assets/p17974470_st_h3_aa.jpg',4,NULL),('SH034164950000','Der Moderator stellt neue, teilweise noch unbekannte Erfindungen vor und spricht mit den klugen Köpfen hinter den Innovationen. Manche der Erfindungen sind kurios, andere zukunftsweisend und bahnbrechend; innovative Geschichten haben sie alle.',NULL,'DEU','Big Brains - Geniale Erfindungen','https://s3.amazonaws.com/schedulesdirect/assets/p17819629_st_h3_aa.jpg',4,NULL),('SH029099400000','Die Kandidaten der Spielshow nehmen an einer großen WG-Party in Prag teil und müssen dort gegeneinander antreten. Aufgeteilt in drei Teams müssen sie verrückte und aufregende Aufgaben lösen, um hohe Preisgelder zu gewinnen.',NULL,'DEU','The Challenge','https://json.schedulesdirect.org/20141201/image/assets/p13755455_i_h3_aa.jpg',4,NULL),('SH019734590000','Patrick Jane ist ein TV-Star und vermeintlicher Zauberer. Er gibt vor, mit Geistern kommunizieren zu können. Doch nachdem der Verbrecher Red John seine Frau und seine Tochter ermordert, hängt er die Karriere als Mentalist an den Nagel. Nach einigen Jahren in der geschlossenen Anstalt beschließt Jane, den Mörder seiner Familie zur Strecke zu bringen. Dafür arbeitet er als Berater des California Bureau of Investigation. Mit seiner bemerkenswerten Menschenkenntnis und Auffassungsgabe schafft er es, knifflige Fälle spielerisch zu lösen. Dabei helfen ihm Teresa Lisbon, Kimball Cho, Wayne Rigsby und Grace Van Pelt. Sein wahres Ziel, Red John zu finden, verliert er nie aus den Augen.',NULL,'DEU','The Mentalist','https://s3.amazonaws.com/schedulesdirect/assets/p186597_l_h3_aa.jpg',4,NULL),('SH013046860000','Recorded coverage of the First Ministers questions in the Scottish Parliament.',NULL,'GBR','Scottish First Minister\'s Questions','https://s3.amazonaws.com/schedulesdirect/assets/p284854_b_h3_ab.jpg',4,NULL),('SH019374330000','Unterhaltsam und informativ geht das Magazin aktuellen, skurrilen und alltäglichen Phänomenen auf den Grund. Menschen mit besonderen Fähigkeiten, Orte mit besonderen beziehungsweise mysteriösen Bedeutungen werden vorgestellt. Die Sendung erklärt außerdem in kurzen Filmbeiträgen nützliche Erfindungen, interessante Redewendungen, stellt neue Trends aus dem Internet vor und prüft den Wahrheitsgehalt allgemein bekannter Tatsachen. Weitere Elemente sind unter anderem waghalsigen Elemente, das `Wort der Woche\', die `Zahl des Tages\' sowie viele praktische Tipps und Anleitungen zum Nachmachen, Nacherleben und Nachbauen.',NULL,'DEU','Galileo','https://s3.amazonaws.com/schedulesdirect/assets/p10838152_b_h3_aa.jpg',4,NULL),('SH020570670000','Series aimed at helping children appreciate what it really means to have a pet, highlighting the responsibility of caring for its needs whilst also showing what fun you can have.',NULL,'GBR','My Pet and Me','https://s3.amazonaws.com/schedulesdirect/assets/p11268798_b_h3_aa.jpg',4,NULL),('SH012588500000','The misadventures of a less-than-honest businessman and his bodyguard, former boxer Terry McCann.',NULL,'GBR','Minder','https://s3.amazonaws.com/schedulesdirect/assets/p442563_b_h3_aa.jpg',4,NULL),('SH015933460000','Die Kommissare, ein alteingesessener oberbayerischer Ermittler und sein Kollege aus der Großstadt, könnten unterschiedlicher nicht sein. Dennoch ergänzen sie sich, wenn es darum geht, besonders knifflige Fälle in der Umgebung von Rosenheim zu lösen.',NULL,'DEU','Die Rosenheim-Cops','https://s3.amazonaws.com/schedulesdirect/assets/p9370385_b_h3_aa.jpg',4,NULL),('SH022554840000','Das Küstenmotorschiff `Henriette\' ist der zweite Wohnsitz der Familie Petermann, die die damit Fracht transportiert. Zur Besatzung gehören Kapitän Hinrich Petermann, seine Frau Margot, Oma, Opa sowie Schiffsjunge Harald.',NULL,'DEU','Kümo Henriette','https://s3.amazonaws.com/schedulesdirect/assets/p12076393_b_h3_aa.jpg',4,NULL),('SH012587610000','Members of the local constabulary patrol the town of Ashfordly and the nearby village of Aidensfield in the North Riding of Yorkshire, keeping the peace whilst also dealing with local loveable rogues and their own love lives. The programme is based upon the \"Constable\" books by Nicholas Rhea.',NULL,'GBR','Heartbeat','https://s3.amazonaws.com/schedulesdirect/assets/p243248_i_h3_ab.jpg',4,NULL),('SH029307670000','Energetic chef Shane and his young daughter Izzy run a restaurant in the town of Munchington. Every day is a recipe for adventure, whether they are trying to break world records or finding wild herbs in the woods.',NULL,'GBR','Shane the Chef','https://s3.amazonaws.com/schedulesdirect/assets/p15317893_b_h3_aa.jpg',4,NULL),('SH023584390000','A three part documentary series examining the rise of Hitler from obscurity to stand on the brink of complete power over Germany.',NULL,'GBR','The Life Of Adolf Hitler','https://s3.amazonaws.com/schedulesdirect/assets/p12560835_st_h3_aa.jpg',4,NULL),('SH034457130000','Following the heroes of Britain\'s Noise Enforcement Teams bringing peace back to British homes driven mad by noise.',NULL,'GBR','At War With The Noise Next Door','https://s3.amazonaws.com/schedulesdirect/assets/p17989061_st_h3_aa.jpg',4,NULL),('SH012698980000','Take a look behind the scenes of the Federal Bureau of Investigation\'s crime laboratory.',NULL,'GBR','The FBI Files','https://s3.amazonaws.com/schedulesdirect/assets/p505353_b_h3_ac.jpg',4,NULL),('SH013031380000','From the feverish and fertile imagination of \"Family Guy\" creator Seth MacFarlane comes this offbeat animated sitcom about Cleveland Brown, a nice guy who leaves Quahog, R.I., for Stoolbend, Va., to rekindle his previously unrequited love for high-school crush Donna. Cleveland\'s new life includes a disconcertingly flirtatious stepdaughter, a 5-year-old stepson who loves the ladies, some loudmouthed redneck neighbours, a British family that seems stuck in the Victorian era, plus a clan of bears living down at the end of the block. In other words, just another Sunday in MacFarlaneLand.',NULL,'GBR','The Cleveland Show','https://s3.amazonaws.com/schedulesdirect/assets/p186605_i_h3_ab.jpg',4,NULL),('SH034078630000','In dieser Sendung geht es um Haarpflege- und Stylingprodukte aus `Margot Schmitt Frisiersalon\'.',NULL,'DEU','MARGOT SCHMITT Frisiersalon','https://s3.amazonaws.com/schedulesdirect/assets/p17783670_st_h3_aa.jpg',4,NULL),('SH033574100000','Die Moderatorin lädt jede Woche eine Reihe von Gästen aus Politik, Wirtschaft und Journalismus ein. Gemeinsam mit ihnen diskutiert sie die aktuellesten und gesellschaftlich relevantesten Themen; von Schönheitswahn bis Rassismus.',NULL,'DEU','maischberger. die woche','https://s3.amazonaws.com/schedulesdirect/assets/p17584006_st_h3_aa.jpg',4,NULL),('SH028704500000','Der Meteorologe Sven Plöger reist zu den Orten, die das Wettergeschehen bestimmen. Zunächst besucht Plöger die Geburtsstätten der wetterbestimmenden Hoch- und Tiefdrucklagen. Teil seiner Entdeckungsreise ist eine Exkursion in die Meteorologie.',NULL,'DEU','Unser Wetter','https://json.schedulesdirect.org/20141201/image/assets/p12317022_i_h3_aa.jpg',4,NULL),('SH030990790000','From fly-tippers to unlicensed minicabs, unhygienic restaurants to unscrupulous stores selling dangerous counterfeit goods, Britons are under threat from crooks and conmen who profit while endangering health, safety, and the environment. Fortunately, there is a tireless team of unsung heroes who are hard at work every day protecting the public. Follow the daily lives of these enforcement officers as they go above and beyond the call of duty to investigate and bring justice, stamping out illegal activities.',NULL,'GBR','Defenders UK','https://s3.amazonaws.com/schedulesdirect/assets/p16255408_i_h3_aa.jpg',4,NULL),('SH012975650000','Geoffrey Wheeler visits variety theatres across the country.',NULL,'GBR','The Palace of Laughter','https://s3.amazonaws.com/schedulesdirect/assets/p301866_st_h3_aa.jpg',4,NULL),('SH022441490000','Varg Veum ist ein Privatdetektiv, der in der norwegischen Hafenstadt Bergen Kriminalfälle ermittelt. Von der Schlechtigkeit der Welt überzeugt, überschreitet er bei der Lösung der oft gewalttätigen Fälle mitunter die Grenzen der Legalität.',NULL,'DEU','Der Wolf','https://json.schedulesdirect.org/20141201/image/assets/p10432401_i_h3_aa.jpg',4,NULL),('SH034269800000','Universal Credit is the biggest change to the benefits system in a generation. By 2023 nearly 7 million people will be claiming it. But it\'s been controversial, with critics arguing the new system of advances and monthly payments is causing hardship and pushing people into poverty.',NULL,'GBR','Universal Credit: Inside the Welfare State','https://s3.amazonaws.com/schedulesdirect/assets/p17869407_st_h3_aa.jpg',4,NULL),('SH019585320000','Regionales Infotainmentmagazin mit den aktuellsten Neuigkeiten aus Nordrhein-Westfalen, Deutschland und der Welt. Die Aktuelle Stunde bringt Themen und Geschichten, die die Menschen zwischen Rhein und Weser interessieren, bewegen und berühren.',NULL,'DEU','Aktuelle Stunde','https://s3.amazonaws.com/schedulesdirect/assets/p10914188_b_h3_aa.jpg',4,NULL),('SH019962300000','Ob es sich um ein U-Boot handelt, um einen Helikopter oder einen Geländewagen - Michael Manousakis und die Jungs von `Morlock Motors\' können bei allem aushelfen und alles beschaffen. Die Experten werden bei ihrer Arbeit begleitet.',NULL,'DEU','Steel Buddies - Stahlharte Geschäfte','https://s3.amazonaws.com/schedulesdirect/assets/p11063739_b_h3_aa.jpg',4,NULL),('SH034392320000','Former football manager welcomes celebrity friends to his house in the luxury south coast town.',NULL,'GBR','Harry Redknapp\'s Sandbanks Summer','https://s3.amazonaws.com/schedulesdirect/assets/p17949885_st_h3_aa.jpg',4,NULL),('SH023062940000','Die Puppenshow dreht sich um eine Familie inkompetenter Monster, die ein beinahe Weltklasse-Hotel besitzen und betreiben. Zu den Muppets gehören Funella Furchester, die Besitzerin, ihr Gatte Furgus Fuzz, sowie deren Tochter Phoebe Furchester-Fuzz.',NULL,'DEU','Das Furchester Hotel','https://s3.amazonaws.com/schedulesdirect/assets/p11077440_i_h3_aa.jpg',4,NULL),('SH019679880000','Die Dokumentation zeigt skurrile Verhaltensweisen und Fähigkeiten von wilden Tieren in der afrikanischen Savanne, zum Beispiel wie ein Elefant zur Welt kommt. Kommentiert werden die Szenen vom Direktor des Kölner Zoos, Theo Pagel.',NULL,'DEU','Safari-Paparazzi','https://s3.amazonaws.com/schedulesdirect/assets/p217899_i_h3_aa.jpg',4,NULL),('SH020903360000','\"Red Rock\" is an Irish crime-drama series with an all-star cast including Richard Flood, Andrea Irvine, Cathy Belton, Denise McCormack, Liam Carney, Paul Roe and Jane McGrath. Based in the fictional seaside town of Red Rock is a busy Dublin Garda station just outside of the city. Two prominent families in the neighbourhood are the Hennessys and the Kielys, who have an ongoing feud with each other. Working to keep the peace between the locals are the police, however when a dead body is found lying on a pier the two families reignite their war.',NULL,'GBR','Red Rock','https://s3.amazonaws.com/schedulesdirect/assets/p11366229_b_h3_aa.jpg',4,NULL),('SH022736230000','Magazin mit Schlagzeilen aus der Region, interessanten Gästen im Studio und Verbrauchertipps. Die Moderatoren berichten über alles, was in Sachsen, Sachsen-Anhalt und Thüringen für Schlagzeilen sorgt und informieren über Aktuelles.',NULL,'DEU','MDR um 4: Neues von hier & Leichter leben','https://s3.amazonaws.com/schedulesdirect/assets/p12155955_b_h3_aa.jpg',4,NULL),('SH019855890000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus dem Bergischen Land.',NULL,'DEU','Lokalzeit Bergisches Land','https://s3.amazonaws.com/schedulesdirect/assets/p11024448_b_h3_aa.jpg',4,NULL),('SH018795040000','Der besondere Yak, Sherlock Yack, ist ein Zoomanager und Detektiv. Mit messerscharfem Verstand und unterstützt von seiner eifrigen und ihn bewundernden Assistentin Hermione, löst er im Zoo die kompliziertesten Fälle.',NULL,'DEU','Sherlock Yack - Der Zoodetektiv','https://s3.amazonaws.com/schedulesdirect/assets/p9152136_i_h3_aa.jpg',4,NULL),('SH030257660000','Growing up with a famous parent isn\'t easy, as the children often have to work hard to emerge from their parents\' shadows and gain independence - especially if they want entertainment careers of their own. \"Growing Up Hip Hop\' documents the lives of a tight-knit group of friends, most of whom have at least one parent who is famous. Angela Simmons, the daughter of Run-D.M.C.\'s Rev Run, is a model and fashion designer; Romeo Miller has followed in the footsteps of his father, Master P, in becoming a musician; entrepreneur Damon `Boogie\" Dash is the son of former record executive Damon Dash; singer Kristinia DeBarge, the daughter of James DeBarge, struggles to choose between family and fame; TJ Mizell, a DJ whose father was Run-D.M.C. member Jam Master Jay, views Angela as family since both of their dads were in Run-D.M.C.; and aspiring singer Egypt Criss gets her talent from both mom and dad - Pepa from Salt-N-Pepa and Treach from Naughty by Nature.',NULL,'GBR','Growing Up Hip Hop','https://s3.amazonaws.com/schedulesdirect/assets/p12281824_l_h3_aa.jpg',4,NULL),('SH020041940000','Die Enten SwaySway und Buhdeuce leben auf dem größtenteils mit Wasser bedeckten Planeten Teichea und liefern Brot an ihre treuen Kunden aus. Dabei geraten s