14762_i_h3_aa.jpg',4,NULL),('SH022417610000','London Real is the talk show that introduces you to the most fascinating people on the planet, including Hollywood actors, sports personalities and members of Parliament.',NULL,'GBR','London Real','https://s3.amazonaws.com/schedulesdirect/assets/p12010279_st_h3_aa.jpg',4,NULL),('SH014251220000','Essential business news as it breaks and a look ahead to the news that will shape the business day.',NULL,'GBR','Asia Business Report','https://s3.amazonaws.com/schedulesdirect/assets/p576711_b_h3_aa.jpg',4,NULL),('SH022416050000','Sammy und Ray sind zwei Wasserschildkröten, die glücklich mit ihren Freunden und Verwandten unter Wasser leben. Um stets vor Feinden geschützt zu sein, bewohnen sie ein Korallenriff. Als Leittier und Mentor der Gemeinschaft gibt Sammy sein Wissen an seine Enkelin Ella weiter. Ella ist aber viel zu abenteuerlustig, um auf den Rat ihres Opas zu hören und sich nur im sicheren Riff aufzuhalten. Gemeinsam mit ihrem besten Freund Ricky, dem quirligen Krakenmädchen Annabel, dem stets miesgelaunten Pipo und dem redseligen Teufelsfisch Harald erkunden die jungen Meeresbewohner den Ozean und erleben dabei jede Menge Abenteuer.',NULL,'DEU','Sammy: Kleine Flossen, große Abenteuer','https://s3.amazonaws.com/schedulesdirect/assets/p11005558_b_h3_ad.jpg',4,NULL),('SH028827860000','Maybe it\'s the jealous ex, the co-worker seeking revenge, or perhaps a predator with an appetite for blood? Whatever the motives, crimes are most often solved by relentless investigators searching for the truth and following clues wherever they may lead. This series explores the emotional stories of those attempting to find closure in homicide investigations, from the victims\' families to the dedicated police officers. Hour-long episodes present compelling versions of what may have happened and stylized re-enactments of events from different perspectives as new evidence emerges.',NULL,'GBR','Cold Blood','https://s3.amazonaws.com/schedulesdirect/assets/p10242479_i_h3_aa.jpg',4,NULL),('SH015403810000','Das Magazin beobachtet, hinterfragt, erklärt und bewertet die aktuelle Medienberichterstattung.',NULL,'DEU','Zapp','https://s3.amazonaws.com/schedulesdirect/assets/p9126507_i_h3_aa.jpg',4,NULL),('SH033425940000','Prominente Rategäste treten gegen die drei besten deutschen `Quizduell\'-Spieler an.',NULL,'DEU','Quizduell - Olymp','https://s3.amazonaws.com/schedulesdirect/assets/p13014615_i_h3_aa.jpg',4,NULL),('SH022362340000','Bettany Hughes investigates three giants of ancient philosophy - Buddha, Socrates and Confucius.',NULL,'GBR','Genius of the Ancient World','https://s3.amazonaws.com/schedulesdirect/assets/p11984611_i_h3_aa.jpg',4,NULL),('SH013066540000','Former food store owner, business woman, cookbook writer and TV food presenter Ina Garten.',NULL,'GBR','Barefoot Contessa','https://s3.amazonaws.com/schedulesdirect/assets/p186296_i_h3_aa.jpg',4,NULL),('SH032951670000','Typische Mädchendinge wie Regenbögen und insbesondere Einhörner haben Alice noch nie interessiert. Doch dann wird ein echtes Einhorn zu ihrem allerbesten Freund. Dieses stellt sicher, dass Alice ein bisschen Spaß in ihrem Leben hat.',NULL,'DEU','Immer dieses Einhorn','https://s3.amazonaws.com/schedulesdirect/assets/p15842701_i_h3_ab.jpg',4,NULL),('SH019799660000','Das Tiermagazin des MDR stellt jede Woche ein Tierheim mit einigen seiner Bewohner vor, die eine neue Bleibe suchen.',NULL,'DEU','Tierisch tierisch','https://s3.amazonaws.com/schedulesdirect/assets/p11002087_i_h3_aa.jpg',4,NULL),('SH012737260000','Best-selling author Nigella Lawson is the host of this show that is described as \"part guide and part food confessional\". She teaches viewers how to prepare for the simple-but-appetizing food that she cooks for herself, her family and her friends. For Nigella, cooking is all about entertaining and being with friends, instead of being alone in the kitchen, and how the taste of the food is more important than worrying about the presentation of the meal. With that philosophy and other hassle-free principles, she hopes to make cooking an enjoyable part of people\'s lives.',NULL,'GBR','Nigella Bites','https://s3.amazonaws.com/schedulesdirect/assets/p452354_i_h3_ab.jpg',4,NULL),('SH030752620000','Bringing all the juicy behind-the-scenes celebrity gossip, fashion fails, and health fads.',NULL,'GBR','Totally Unbelievable','https://s3.amazonaws.com/schedulesdirect/assets/p16128454_b_h3_aq.jpg',4,NULL),('SH018486920000','Detective Jake Peralta, a talented and carefree cop with the best arrest record, has never had to follow the rules too closely or work very hard. That changes when Ray Holt, a man with a lot to prove, becomes the new commanding officer of Brooklyn\'s 99th precinct. As Holt reminds Peralta to respect the badge, an extremely competitive colleague - Detective Amy Santiago - starts to close in on the hotshot cop\'s arrest record. Other members of the precinct include Sgt Terry Jeffords, a devoted family man, Detective Charles Boyle, a hard worker who idolizes Jake, and Rosa Diaz, a sexy-yet-intimidating detective. Civilian office manager Gina Linetti is tasked with cleaning up everyone\'s mess, while somehow getting involved in everyone\'s business.',NULL,'GBR','Brooklyn Nine-Nine','https://s3.amazonaws.com/schedulesdirect/assets/p9974290_l_h3_ab.jpg',4,NULL),('SH012812400000','The aristocratic Inspector Thomas Lynley and the down-to-earth Detective Sergeant Barbara Havers join forces to investigate a series of murders. Their working relationship is challenged by their respective lots in life - Lynley is an earl, while Havers comes from a working-class background. The characters and some of the storylines are based on the novels by Elizabeth George.',NULL,'GBR','The Inspector Lynley Mysteries','https://json.schedulesdirect.org/20141201/image/assets/p408510_i_h3_aa.jpg',4,NULL),('SH013026900000','Some people buy antiques to collect them, while others purchase old items that they think will make them a profit when selling them on. The antique experts in this series fall into the latter category as they head out on a trip across Britain in search of hidden treasures at bargain prices. They then head to auctions, where they put the collectibles up for bid and hope to make a tidy profit. The antiques featured range from typical items like household goods to one-of-a-kind finds that include historical artefacts.',NULL,'GBR','Antiques Road Trip','https://s3.amazonaws.com/schedulesdirect/assets/p8198320_i_h3_ab.jpg',4,NULL),('SH013827270000','Five young, ambitious cops try to succeed in their high-stakes careers in which the smallest mistake can have life-or-death consequences. At the core of the close-knit group is perfectionist Andy McNally, whose father was a cop. The series follows Andy and her four colleagues as they experience the trials, triumphs and tribulations of police work.',NULL,'GBR','Rookie Blue','https://s3.amazonaws.com/schedulesdirect/assets/p8085120_l_h3_aa.jpg',4,NULL),('SH012840010000','Before complaining about the market price of Alaska king crab, check out this gripping documentary series, revealing the mortal perils and intense discomfort that fishing crews face to catch the delicacy; those perils include 40-foot waves, 700-pound crab pots that can easily crush a careless crewman, and freezing temperatures around the clock.',NULL,'GBR','Deadliest Catch','https://s3.amazonaws.com/schedulesdirect/assets/p185354_l_h3_aa.jpg',4,NULL),('SH016282040000','Coverage of the Kontinental Hockey League, featuring 25 professional clubs from Belarus, China, Finland, Kazakhstan, Latvia, Russia, and Slovakia.',NULL,'GBR','Kontinental Hockey League','https://s3.amazonaws.com/schedulesdirect/assets/p9515979_b_h3_aa.jpg',4,NULL),('SH030986500000','A group of young men re-live the experiences of the Lancaster Bomber \"Lucky H\" aircrew.',NULL,'GBR','Bomber Boys: The Fighting Lancaster','https://s3.amazonaws.com/schedulesdirect/assets/p343179_b_h3_aa.jpg',4,NULL),('SH020140110000','Zusammenfassungen, Highlights und Rückblicke aus der Welt des Darts.',NULL,'DEU','Darts','https://json.schedulesdirect.org/20141201/image/assets/p3509440_i_h3_aa.jpg',4,NULL),('SH023618620000','Masha retells fairy tales her way.',NULL,'GBR','Masha\'s Tales','https://s3.amazonaws.com/schedulesdirect/assets/p12575882_b_h3_aa.jpg',4,NULL),('SH012975000000','Melvyn Bragg and guests discuss the history of ideas.',NULL,'GBR','In Our Time','https://s3.amazonaws.com/schedulesdirect/assets/p8183258_b_h3_aa.jpg',4,NULL),('SH019961850000','Ein mysteriöser Außerirdischer in menschlicher Gestalt namens `Doktor\' reist in seinem Raumschiff durch Zeit und Raum. Dabei erforscht er unterschiedliche Lebensformen, kann Ereignisse in der Vergangenheit beeinflussen und trifft auf kuriose Gestalten. Damit er sich im Universum nicht zu einsam fühlt, lädt er regelmäßig verschiedene Begleiter auf sein Raumschiff ein, die mit ihm weiterreisen. Doch er hat auch Feinde, die gelegentlich seinen Weg kreuzen, ihm jedoch nichts anhaben können. Denn der `Doktor\' besitzt die Fähigkeit, sich komplett zu regenerieren.',NULL,'DEU','Doctor Who','https://s3.amazonaws.com/schedulesdirect/assets/p185271_b_h3_ai.jpg',4,NULL),('SH015402960000','Zoogeschichten aus München: Alltag, Sorgen und Erfolge der Zoobewohner und ihrer Pfleger. Die Zuschauer bekommen einen Einblick in den Alltag der Tierpfleger, ihre Beziehung zu ihren Schützlingen und erfahren mehr über die verschiedenen Tierarten.',NULL,'DEU','Nashorn, Zebra & Co.','https://s3.amazonaws.com/schedulesdirect/assets/p9126166_b_h3_aa.jpg',4,NULL),('SH019646300000','Die Doku-Serie zeigt authentische Bilder von verheerenden Unglücken und Naturkatastrophen, meist von Augenzeugen zufällig aufgenommen. Ex-Football-Profi Ron Pitts dokumentiert die Zerstörungen und die dramatischen Folgen für die Betroffenen.',NULL,'DEU','Zerstört in Sekunden','https://json.schedulesdirect.org/20141201/image/assets/p195575_i_h3_aa.jpg',4,NULL),('SH032083890000','Experts analyse footage from paranormal videos, specialists provide insights, while eyewitnesses give firsthand accounts of strange phenomena.',NULL,'GBR','Paranormal Caught on Camera','https://s3.amazonaws.com/schedulesdirect/assets/p16350735_b_h3_ac.jpg',4,NULL),('SH029497560000','Mai 1981: Frankreich steht kurz vor der Präsidentschaftswahl. Der 17-jährige Victor trifft auf der Baustelle seines Vaters Charles den jungen Sélim. Die beiden fühlen sich auf Anhieb zueinander hingezogen. Charles entdeckt die sexuelle Beziehung der beiden. Obwohl sich Charles offen zur politischen Linken, die sich für Toleranz einsetzt, bekennt, kann er die Homosexualität seines Sohnes nicht akzeptieren.',NULL,'DEU','Mut zur Liebe','https://s3.amazonaws.com/schedulesdirect/assets/p15407180_st_h3_aa.jpg',4,NULL),('SH030038130000','Mit Odysso kann die Wissenschaftsredaktion des SWR aktueller auf das Zeitgeschehen eingehen. Das Wissensmagazin gibt die Antworten, zu denen die Zuschauer Fragen haben.',NULL,'DEU','Odysso','https://s3.amazonaws.com/schedulesdirect/assets/p9987880_i_h3_aa.jpg',4,NULL),('SH034417720000','Tim träumt davon, zu den Sternen zu fliegen. Also hat er sich eine Rakete gebastelt.',NULL,'DEU','Timmis Raketenflieger Lieder','https://s3.amazonaws.com/schedulesdirect/assets/p11423125_st_h3_ab.jpg',4,NULL),('SH021796150000','In Gefahrensituationen kann jede Aktion über Leben und Tod entscheiden. Die Dokumentation präsentiert gefährliche Naturkatastrophen und Begegnungen mit wilden Tieren. Wie verhält man sich in so einer bedrohlichen Situation richtig?',NULL,'DEU','Überleben!','https://json.schedulesdirect.org/20141201/image/assets/p10929268_i_h3_aa.jpg',4,NULL),('SH030968590000','Cookie Monster and Gonger work in their own food truck fielding orders from live children via video message. To complete their recipe, the monsters drive the truck to a specific location and learn about where certain foods originally come from.',NULL,'GBR','Cookie Monster\'s Foodie Truck','https://s3.amazonaws.com/schedulesdirect/assets/p16235765_b_h3_aa.jpg',4,NULL),('SH032878430000','The adventures of a family run crew of heavy-haulage specialists as they race to transport the heaviest, longest and most precious locomotives around the world by road, rail and sea. Plus, footage reveals the history behind the featured locomotives.',NULL,'GBR','Train Truckers','https://s3.amazonaws.com/schedulesdirect/assets/p17226540_b_h3_ab.jpg',4,NULL),('SH019704300000','Das Magazin berichtet über aktuelle Ereignisse in der Stadt Berlin und im Land Brandenburg. Außerdem stellt es informative Themen vor, präsentiert Trends, Tipps und lädt Prominente ein.',NULL,'DEU','zibb','https://s3.amazonaws.com/schedulesdirect/assets/p10962621_b_h3_ab.jpg',4,NULL),('SH016236130000','Helping people find property in the summer sun.',NULL,'GBR','A Place in the Sun: Summer Sun','https://json.schedulesdirect.org/20141201/image/assets/p9498352_i_h3_aa.jpg',4,NULL),('SH022376780000','Oft können Verbrechen nur durch Untersuchung der Tatorte und mit Hilfe von hochmodernen Technologien aufgeklärt werden. Die Serie zeigt spektakuläre und bizarre Fälle, bei denen die forensische Untersuchung den entscheidenden Durchbruch ermöglichte.',NULL,'DEU','Die Forensiker: Profis am Tatort','https://s3.amazonaws.com/schedulesdirect/assets/p233203_i_h3_aa.jpg',4,NULL),('SH013016790000','Investigators circle the globe in search of evidence in their quest to determine whether life on Earth began in outer space and if aliens influenced mankind in ancient times. Did extraterrestrial beings visit Earth and share information about technology and influence human religions? And more importantly, if aliens visited the planet before, will they return? Alien theorists believe that the answer to both questions is a resounding yes.',NULL,'GBR','Ancient Aliens','https://s3.amazonaws.com/schedulesdirect/assets/p8039273_i_h3_aa.jpg',4,NULL),('SH013075980000','Sabrina Spellman is a teenager with magical powers who comes from a long line of witches. Until going away to college, she lived with her wacky aunts, who would teach her to use her witchcraft wisely, and Salem, the talking black cat, who always has a scheme up his paw. As a high-school student, Sabrina is less judicious about using her powers than when she enters adulthood. The series is based on a 1960s comic-book series of the same name and an animated TV series that originally aired in the 1970s.',NULL,'GBR','Sabrina, the Teenage Witch','https://s3.amazonaws.com/schedulesdirect/assets/p184218_l_h3_aa.jpg',4,NULL),('SH034366440000','Der Rettungsdienst in Deutschland stößt an seine Grenzen. Die Notrufnummer 112 wird immer häufiger gewählt. Die Sendung begleitet in jeder Folge vier Rettungsteams, die meist in Zwölf-Stunden-Schichten ihrem unvorhersehbaren Job nachgehen.',NULL,'DEU','112 - Retter im Einsatz','https://json.schedulesdirect.org/20141201/image/assets/p17934623_st_h3_aa.jpg',4,NULL),('SH009541760000','Anne Will diskutiert mit ihren Gästen über politische Prozesse, wirtschaftliche Zusammenhänge und gesellschaftliche Trends. Sie bietet ihnen und den Zuschauern die Plattform für eine gesellschaftspolitische Meinungsbildung.',NULL,'DEU','Anne Will','https://s3.amazonaws.com/schedulesdirect/assets/p571700_b_h3_aa.jpg',4,NULL),('SH027255020000','Exploring what it\'s like to live and work in England\'s biggest expanse of protected countryside - in the national parks of the Lake District and Yorkshire Dales.',NULL,'GBR','The Yorkshire Dales and the Lakes','https://s3.amazonaws.com/schedulesdirect/assets/p14289698_st_h3_aa.jpg',4,NULL),('SH015443450000','Das Kulturmagazin im Ersten, im wöchentlichen Wechsel von sechs Redaktionen der ARD Funkanstalten.',NULL,'DEU','ttt - titel thesen temperamente','https://s3.amazonaws.com/schedulesdirect/assets/p9145375_b_h3_aa.jpg',4,NULL),('SH030624760000','Filmed in a gig-environment and hosted by Jordan Stephens, two teams made up of comedians, Hip Hop legends and celebrity Hip 