,'The detectives that are part of the NYPD\'s Special Victims Unit investigate crimes of sexual nature. While the focus of the other shows in the \"Law & Order\' franchise largely deal with murder cases, the SVU detectives frequently deal with crimes, such as rapes, in which the victim survives and assists authorities in the investigation. The series features a cast of veteran actors, including Mariska Hargitay, Richard Belzer, Dann Florek and, after the first season, rapper Ice-T. Occasional crossover episodes feature detectives from other series in the `Law & Order\" franchise.',NULL,'GBR','Law & Order: Special Victims Unit','https://s3.amazonaws.com/schedulesdirect/assets/p184536_l_h3_aa.jpg',4,NULL),('SH019559640000','Die Schwestern Prue, Piper und Phoebe entfesseln, ohne es zu ahnen, Zauberkräfte, die sie zu den mächtigsten Hexen aller Zeiten machen. Mit den neuerrungenen Kräften bekämpfen sie das Böse und beschützen Unschuldige.',NULL,'DEU','Charmed - Zauberhafte Hexen','https://s3.amazonaws.com/schedulesdirect/assets/p184399_i_h3_aa.jpg',4,NULL),('SH017808340000','Discovery Channel takes the ubiquitous survival show theme to the next level by stripping it to its bare essentials. In \"Naked and Afraid\', two complete strangers - a man and a woman - meet in a very unique way: They\'re stranded in a dangerous, desolate location, without food and water, and they\"re completely naked. Each episode follows the two as they attempt to survive on their own, with nothing but one personal item each and the knowledge that the only prize is their pride and sense of accomplishment. Because there is no other choice, the couple quickly get to know each other - and their surroundings - and hope that their instincts, survival skills and intestinal fortitude serve them well.',NULL,'GBR','Naked and Afraid','https://s3.amazonaws.com/schedulesdirect/assets/p9974211_l_h3_aa.jpg',4,NULL),('SH019577940000','Hallo Niedersachsen ist das Regionalmagazin des Norddeutschen Rundfunks für d