ds, where the fight against crime is fast and furious.',NULL,'GBR','Traffic Cops','https://s3.amazonaws.com/schedulesdirect/assets/p13460115_b_h3_aa.jpg',4,NULL),('SH020569270000','Inseln sind Schauplätze der Evolution. Seit Jahrtausenden isoliert, haben sich Lebewesen auf diesem begrenzten Raum an Nischen angepasst und neue Arten gebildet. Die Reihe ist eine Liebeserklärung an die spektakulärsten Inseln der Erde.',NULL,'DEU','Wilde Inseln','https://json.schedulesdirect.org/20141201/image/assets/p9524586_i_h3_aa.jpg',4,NULL),('SH012600990000','In this game show, two contestants compete against each other and the clock in a battle of wits that tests both their lexical dexterity and numerical knowledge. In the letters round, the contestants must find as many words as they can from nine letter tiles on the board, with longer words being worth more points. In the numbers round, contestants must use addition, subtraction, multiplication and division to come as close to a randomly generated, unknown target as possible using any of six numbered tiles. It\'s back to letters for the final round, the conundrum, during which the contestants must figure out what nine-letter word is represented by a nine-letter anagram shown on the board. The contestant who has the most points at the end of the conundrum round is declared the winner.',NULL,'GBR','Countdown','https://s3.amazonaws.com/schedulesdirect/assets/p359700_i_h3_aa.jpg',4,NULL),('SH032915190000','Oscar, a little boy, and Hoo, his friend cloud, together go and discover the world. Accompanied by their neighbour Ella, they explore and go on fun adventures.',NULL,'GBR','Ella, Oscar & Hoo','https://s3.amazonaws.com/schedulesdirect/assets/p15277443_b_h3_aa.jpg',4,NULL),('SH034010480000','Depicting the processes law enforcement use to apprehend the suspects.',NULL,'GBR','Murder Wall','https://s3.amazonaws.com/schedulesdirect/assets/p17743866_st_h3_aa.jpg',4,NULL),('SH027710960000','Taking a look at the behind-the-scenes action at