, Short decided to make his passion for classic cars his life\'s work, and FantomWorks was born. Today the Norfolk, Va, company is the largest auto restoration shop in the US, and this reality series shows how Short and his team meticulously refurbish some of America\'s favourite rides. Drama ensues in the form of personality clashes, cost overruns, irate customers and other issues, which are compounded by Short\'s reputation as a straight shooter who won\'t accept substandard results.',NULL,'GBR','FantomWorks','https://s3.amazonaws.com/schedulesdirect/assets/p9944361_l_h3_aa.jpg',4,NULL),('SH032348020000','Some of the original \"Total Drama\" characters enter into an alternate universe where they are aged down from teenagers to toddlers.',NULL,'GBR','Total DramaRama','https://s3.amazonaws.com/schedulesdirect/assets/p15787042_b_h3_aa.jpg',4,NULL),('SH018818710000','Helen Dorn, Kommissarin des Landeskriminalamts, ermittelt in Kriminalfällen, die auf die eine oder andere Art von besonderer Wichtigkeit sind. Auf der Suche nach den Tätern agiert sie geradlinig, hartnäckig und intuitiv.',NULL,'DEU','Helen Dorn','https://s3.amazonaws.com/schedulesdirect/assets/p10573728_b_h3_aa.jpg',4,NULL),('SH021336340000','Action from the Swedish Hockey League, the highest division in the Swedish ice hockey system.',NULL,'GBR','Swedish Hockey League','https://s3.amazonaws.com/schedulesdirect/assets/p11538792_b_h3_aa.jpg',4,NULL),('SH014190010000','\"The working man\'s bank\' is always willing to make a deal. That\'s why for the people of Detroit, the go-to pawn shop for more than four decades has been American Jewelry and Loan. This series follows its day-to-day operations, focusing on third-generation pawnbroker and company patriarch Les Gold, a street-smart old-schooler known for driving a hard bargain but having a soft heart. The family business also includes Seth, Les\' only son and business partner; daughter Ashley, the shop\'s general manager; and Les\' wife, Lili. But there\'s no question who the boss is, and he\'s often heard reminding his team of more than 45 employees, `The customer always lies\".',NULL,'GBR','Hardcore Pawn','https://s3.amazonaws.com/schedulesdirect/assets/p7959226_i_h3_aa.jpg',4,NULL),('SH022546860000','Bad Cannstatt, bevölkerungsreichster Stadtteil Stuttgarts, Industriestandort und Heimat des Privatdetektives Huck. Der ehemalige Polizist hat eindeutig ein Problem mit Autorität. Zusammen mit seinem Kumpel Cem löst er Kriminalfälle in der Provinz.',NULL,'DEU','Huck','https://json.schedulesdirect.org/20141201/image/assets/p12071855_i_h3_aa.jpg',4,NULL),('SH012981780000','Legal magazine programme.',NULL,'GBR','Law in Action','https://s3.amazonaws.com/schedulesdirect/assets/p256231_st_h3_aa.jpg',4,NULL),('SH012675810000','Set in the fictional Australian town of Summer Bay, a small coastal hamlet just north of Sydney, is this long-running soap - it debuted in 1988 - that depicts the sun-drenched residents of a beach-side resort. The programme has served as an acting apprenticeship of sorts for a number of notable former cast members, including Heath Ledger, Isla Fisher, Julian McMahon, Dannii Minogue, Simon Baker, Guy Pearce and Naomi Watts.',NULL,'GBR','Home and Away','https://s3.amazonaws.com/schedulesdirect/assets/p245120_i_h3_ae.jpg',4,NULL),('SH025245330000','Die Dokumentarreihe begleitet Flussschifffahrten mit der Kamera. Geschichten rund um die Passagiere und deren Erlebnisse auf dem Schiff werden erzählt und Einblicke in die Arbeit der Crew gegeben.',NULL,'DEU','Verrückt nach Fluss','https://s3.amazonaws.com/schedulesdirect/assets/p13348059_b_h3_aa.jpg',4,NULL),('SH019668290000','Mit Samson, Finchen und ihren Freunden lässt sich spielerisch die Welt erkunden. Mit viel Witz statt erhobenem Zeigefinger vermitteln die Bewohner der Sesamstraße, worauf es im Leben ankommt: Freundschaft, Spaß und friedliches Zusammenleben.',NULL,'DEU','Sesamstraße','https://s3.amazonaws.com/schedulesdirect/assets/p10949089_b_h3_aa.jpg',4,