onaws.com/schedulesdirect/assets/p10904035_st_h3_aa.jpg',4,NULL),('SH013027580000','Coverage of House of Lords proceedings and business.',NULL,'GBR','House of Lords','https://s3.amazonaws.com/schedulesdirect/assets/p404034_b_h3_aa.jpg',4,NULL),('SH019851360000','Die Hecks, bestehend aus Mutter Frankie, Vater Mike und ihren drei Kindern, sind eine typische amerikanische Durchschnittsfamilie. Ihr oft chaotischer Alltag wird größtenteils von den Sorgen und Nöten der Kinder Axl, Sue und Brick bestimmt.',NULL,'DEU','The Middle','https://s3.amazonaws.com/schedulesdirect/assets/p3560344_l_h3_aa.jpg',4,NULL),('SH028431630000','Two-part documentary that tells the story of Simon Wiesenthal - a survivor of the Nazi death camps - and his relentless pursuit of his torturers who had been in hiding since World War II.',NULL,'GBR','Hunting Down the Nazis','https://s3.amazonaws.com/schedulesdirect/assets/p14937802_st_h3_aa.jpg',4,NULL),('SH015795760000','CEOs from some of Canada\'s largest corporations disguise themselves as average people and join their own workforces in order to better understand how their companies work at the most basic levels. Each episode of \"Undercover Boss Canada\" features one CEO as he or she tries to perform jobs that are often dirty and demanding, working alongside real employees who do these jobs every day. As they progress in their missions, the executives learn firsthand how their own decisions directly impact the lives of their employees, and later the CEOs use their new knowledge and experience to make improvements to their companies.',NULL,'GBR','Undercover Boss Canada','https://s3.amazonaws.com/schedulesdirect/assets/p9042057_l_h3_aa.jpg',4,NULL),('SH015248490000','Live radio commentary from the top-level professional rugby league club competition in Europe.',NULL,'GBR','Live: Super League Rugby','https://s3.amazonaws.com/schedulesdirect/assets/p9051718_i_h3_aa.jpg',4,NULL),('SH019576370000','Doktor Mark Sloan hilft seinem Sohn Detective Steve Sl