ening traumas to embarrassing mishaps. The series provides an intimate, powerful, and at times comic look at life and death on the front line of the A&E department.',NULL,'GBR','24 Hours in A&E','https://s3.amazonaws.com/schedulesdirect/assets/p8651529_i_h3_ad.jpg',4,NULL),('SH014220620000','After a series of grisly livestock killings in the mid-90s, reports arose of a mysterious fanged dog-like creature. Could it be the chupacabra?',NULL,'GBR','Paranatural','https://s3.amazonaws.com/schedulesdirect/assets/p7979724_i_h3_aa.jpg',4,NULL),('SH022222000000','Chip and Joanna Gaines own and operate Magnolia Homes, a remodelling and design business in Waco, Texas, and \"Fixer Upper\" shows the process by which the couple turn dilapidated but potential-rich houses into showplaces.',NULL,'GBR','Fixer Upper','https://s3.amazonaws.com/schedulesdirect/assets/p9928145_l_h3_aa.jpg',4,NULL),('SH032537830000','Die Dokumentation erzählt die Geschichte dieser majestätischen Schiffe, berichtet vom Wettlauf um Prestige und Geschwindigkeit, von den reichen Leuten in der ersten Klasse und den armen Schluckern im Zwischendeck, von Rekorden und K.',NULL,'DEU','Ozeanriesen','https://s3.amazonaws.com/schedulesdirect/assets/p17058322_st_h3_aa.jpg',4,NULL),('SH013033150000','One of the U.K.\'s longest-running series, \"Taggart\" is a gritty detective show based in Glasgow, Scotland. The show follows detectives in the Maryhill CID of Strathclyde Police as they investigate crimes, often murders. The personal relationships of the officers and their families is also explored in the series.',NULL,'GBR','Taggart','https://s3.amazonaws.com/schedulesdirect/assets/p498680_b_h3_ab.jpg',4,NULL),('SH012949680000','Cartographer George Bradshaw produced the first comprehensive timetable and travel guide of Great Britain\'s railway system in 1840. But a lot has changed in the world since then. Which is why presenter Michael Portillo, a British journalist, travels the railways throughout England using Bradshaw\'s maps to compare 1840s-era Britain to modern-day Britain.',NULL,'GBR','Great British Railway Journeys','https://s3.amazonaws.com/schedulesdirect/assets/p8175671_b_h3_ab.jpg',4,NULL),('SH020045500000','\"Million Dollar Listing\' has showcased some of the most luxurious homes in Los Angeles. The franchise now heads east with `Million Dollar Listing New York\', featuring relentless real estate agents in Manhattan and their intertwining lives as each agent fights for his share of the market. The agents must deal with demanding clients as they earn a living selling some of New York\"s hottest real estate. The featured agents, some of the best in the city, include \"listings machine\" Fredrik Eklund and Ryan Serhant, who was an actor and hand model before pursuing his real estate passion.',NULL,'GBR','Million Dollar Listing New York','https://s3.amazonaws.com/schedulesdirect/assets/p9035676_l_h3_aa.jpg',4,NULL),('SH016391760000','Kriminalhauptkommissar und SOKO-Leiter Jan Reuter, die beiden Kriminaloberkommissare Nils und Katrin sowie Polizeihauptmeister Lars werden bei ihrer Ganovenjagd unterstützt von Leena Virtanen, Konstabler der finnischen Staatspolizei.',NULL,'DEU','SOKO Wismar','https://s3.amazonaws.com/schedulesdirect/assets/p9561690_b_h3_ac.jpg',4,NULL),('SH024862180000','Entertainment programme.',NULL,'GBR','Glimpses','https://s3.amazonaws.com/schedulesdirect/assets/p13154096_st_h3_ab.jpg',4,NULL),('SH032572390000','Two young cats, Ollie and Moon, travel the world in search of new friendships and adventures.',NULL,'GBR','The Ollie & Moon Show','https://s3.amazonaws.com/schedulesdirect/assets/p14152728_l_h3_aa.jpg',4,NULL),('SH016157680000','The guardians of NZ\'s highways, they patrol our country\'s busiest roads. From honeymooners to hooligans, either way the Highway Cops will set them straight.',NULL,'GBR','Highway Cops','https://s3.amazonaws.com/schedulesdirect/assets/p9468037_i_h3_aa.jpg',4,NULL),('SH012699850000','Coverage of debates and questions in the House of Commons.',NULL,'GBR','House of Commons','https://s3.amazonaws.com/schedulesdirect/assets/p404024_b_h3_aa.jpg',4,NULL),('SH015406260000','Matt Edmondson writes and narrates entertaining Guinness World Records and characters who set them.',NULL,'GBR','Totally Bonkers Guinness World Records','https://s3.amazonaws.com/schedulesdirect/assets/p9127517_b_h3_aa.jpg',4,NULL),('SH016460840000','Die Dokumentationsreihe zeigt ein breites Spektrum an Themen, dazu zählen unter anderem Geschichtsdokumentationen, Natur- und Tier-Dokumentationen, Archäologie-Dokumentationen, Wissenschaftsdokumentationen und auch fiktionale Dokumentationen.',NULL,'DEU','Terra X','https://s3.amazonaws.com/schedulesdirect/assets/p9587122_b_h3_ad.jpg',4,NULL),('SH017073230000','Eine Gruppe von jungen Teenagern entdeckt die Wildnis. Doch vorher kommen sie in ein Vorbereitungscamp in der hessischen Wildnis, wo sie für ihr Abenteuer fit gemacht werden sollen. Anschließend geht es in die raue Wildnis.',NULL,'DEU','Durch die Wildnis','https://s3.amazonaws.com/schedulesdirect/assets/p9825204_b_h3_aa.jpg',4,NULL),('SH024752950000','\"Inside the Factory\' follows presenters Gregg Wallace and Cherry Healey as they explore the secrets behind large-scale food production. With exclusive access to some of Britain\"s biggest food factories, the pair investigate the journey of everyday items, how they are created, packaged and transported to the supermarket shelves. In the first series Wallace travels to a British bakery that produces one and a half million loaves of bread per week, while Healey visits a flour mill to uncover the science behind preserving bread for longer.',NULL,'GBR','Inside the Factory','https://s3.amazonaws.com/schedulesdirect/assets/p11719910_i_h3_ab.jpg',4,NULL),('SH032423110000','Wer in dieser Show als Sieger hervorgehen will, muss auf ganzer Linie im großen Duell überzeugen.',NULL,'DEU','Schlag den Besten','https://s3.amazonaws.com/schedulesdirect/assets/p17005229_st_h3_aa.jpg',4,NUL