y and leading to the apprehension of those responsible. The programme also explores the devious tactics of pickpockets, shoplifters and con artists, and looks at how camera technology has replaced some traditional policing methods.',NULL,'GBR','Criminals: Caught on Camera','https://s3.amazonaws.com/schedulesdirect/assets/p10260107_i_h3_aa.jpg',4,NULL),('SH012593140000','A team of ex-special forces soldiers on the lam from the military police (even though they didn\'t really commit the crime for which they\'d been imprisoned) leaves a trail of explosions in its wake. But Hannibal, Faceman, B.A. and Murdock always stop to help the little guy against some corrupt local bigwig before escaping the MPs once again.',NULL,'GBR','The A-Team','https://s3.amazonaws.com/schedulesdirect/assets/p183930_l_h3_aa.jpg',4,NULL),('SH012598220000','Presenters cast their expert eyes over a number of properties before they go to auction, giving their opinion on the respective buildings and their potential. Once the properties are sold, the show\'s hosts check in with the buyers to find out their plans for any renovations or structural improvements. After a couple of months, each project is re-visited to see how far things have progressed, and to see if everything went to plan financially. Estate agents are also invited along to study the work done and to provide a valuation.',NULL,'GBR','Homes Under the Hammer','https://s3.amazonaws.com/schedulesdirect/assets/p402752_i_h3_aa.jpg',4,NULL),('SH021219770000','Dr Janina Ramirez discovers how monasteries shaped every aspect of medieval Britain and created a dazzling array of art, architecture and literature. It is an extraordinary story of faith and sacrifice, as well as violence and corruption.',NULL,'GBR','Saints and Sinners: Britain\'s Millennium of Monasteries','https://s3.amazonaws.com/schedulesdirect/assets/p11482099_b_h3_aa.jpg',4,NULL),('SH016397840000','Markus Lanz lädt prominente Gäste und Experten aus allen Bereichen des öffentlichen Lebens zu seiner bunten Talkrunde ein. In der Regel sind es vier Gäste, die einzeln vorgestellt werden und ihre persönlichen Erfahrungen zu den Themen einbringen.',NULL,'DEU','Markus Lanz','https://s3.amazonaws.com/schedulesdirect/assets/p793628_b_h3_aa.jpg',4,NULL),('SH022444510000','`Crime Town USA\' zeigt schockierende Verbrechen, die jemals in US-amerikanischen Kleinstädten von Kriminellen begangen wurden. Die zuständigen Gesetzeshüter geben einen Einblick in das Vorgehen der Polizeiarbeit.',NULL,'DEU','Crime Town USA - Verbrechen im Hinterland','https://s3.amazonaws.com/schedulesdirect/assets/p7980386_st_h3_aa.jpg',4,NULL),('SH027778050000','Potluck takes on a whole different meaning at dinner parties organized by celebrated marijuana aficionado Snoop Dogg. And when his co-host is none other than trusted lifestyle expert Martha Stewart, these gatherings might have to be seen to be believed. That\'s what VH1 hopes is the case for this weekly series, which features polar opposites Snoop and Martha at the head of the table, each putting personal spins on dishes for themed meals. The half-baked evenings of cocktails, cooking, conversation, and fun include Seth Rogen, Wiz Khalifa, Rick Ross, Naya Rivera, Ashley Graham, Jason Derulo, 50 Cent, Fat Joe, Kathy Griffin and Robin Thicke among the invitees. Musical guests join the fun, too. Pass the pot... uh, I mean, pepper.',NULL,'GBR','Martha & Snoop\'s Potluck Dinner Party','https://s3.amazonaws.com/schedulesdirect/assets/p13385594_i_h3_aa.jpg',4,NULL),('SH022744040000','Die Beamten werden zu verschiedenen Verbrechensorten gerufen.',NULL,'DEU','Der Blaulicht Report','https://s3.amazonaws.com/schedulesdirect/assets/p12159916_b_h3_aa.jpg',4,NULL),('SH032039540000','Die vier kleinen Kätzchen Lampo, Milday, Pilou und Poppetta leben in der Garage der fürsorglichen Nonna Pina. Als `The Buffycats\' machen sie Musik und begeben sich auf verschiedene aufregende Abenteuer. Dabei stoßen sie auch auf weitere Artgenossen.',NULL,'