n Doro Becker nimmt allerlei kuriose Fälle an, bei denen sie Menschen selbst die kleinsten Geheimnisse entlockt. Begleitet wird sie von Paradiesvogel Adnan und vom attraktiven Kommissar Chris, derihr schon länger schöne Augen macht.',NULL,'DEU','Dunkelstadt','https://s3.amazonaws.com/schedulesdirect/assets/p17929996_st_h3_aa.jpg',4,NULL),('SH020217450000','Highlights und Zusammenfassungen der UEFA Europa League.',NULL,'DEU','UEFA Europa League','https://s3.amazonaws.com/schedulesdirect/assets/p8413210_b_h3_ac.jpg',4,NULL),('SH013122120000','Tales of a smart princess and her six scaly friends.',NULL,'GBR','Florrie\'s Dragons','https://s3.amazonaws.com/schedulesdirect/assets/p8233951_b_h3_aa.jpg',4,NULL),('SH022074980000','Young government agents Olive and Otto use math to investigate strange occurrences in their town.',NULL,'GBR','Odd Squad','https://s3.amazonaws.com/schedulesdirect/assets/p11086138_l_h3_aa.jpg',4,NULL),('SH022086540000','Die vier Elemente der Natur bestimmen das Leben auf der Erde und richten zugleich unfassbare Zerstörungen an. Die Dokumentation zeigt, in welcher Weise die Kräfte der Umwelt wirken können und welche Konsequenzen für die Menschheit dadurch entstehen.',NULL,'DEU','Naturgewalten','https://s3.amazonaws.com/schedulesdirect/assets/p9222856_b_h3_ah.jpg',4,NULL),('SH034460040000','Cherry Healey enlists the help of leading experts to use clever tricks and cutting-edge treatments to turn back the clock to try to take 10 years off in 10 days. The public decides whether the treatments have worked.',NULL,'GBR','10 Years Younger In 10 Days','https://json.schedulesdirect.org/20141201/image/assets/p17991037_i_h3_aa.jpg',4,NULL),('SH012972550000','A lively mix of chat, arts news and live performance.',NULL,'GBR','In Tune','https://s3.amazonaws.com/schedulesdirect/assets/p247767_i_h3_aa.jpg',4,NULL),('SH030059230000','Todd Hoffmann und seine sechs Mann starke Crew wollen in der Wildnis Alaskas, nahe der kanadischen Grenze, nach Gold schürfen. Sie hof