o walk away with the cash prize.',NULL,'GBR','Tenable','https://s3.amazonaws.com/schedulesdirect/assets/p13470994_b_h3_aa.jpg',4,NULL),('SH034267490000','From the Ancient Greeks to the taboo-busting painters and sculptors of today, Mary gives a deeply personal take on naked bodies in art. She explores why artists are so interested in nudity, and what art can reveal about people\'s attitudes to their bodies.',NULL,'GBR','Mary Beard\'s Shock of the Nude','https://json.schedulesdirect.org/20141201/image/assets/p17868296_i_h3_aa.jpg',4,NULL),('SH019647040000','Diese Top-Piloten sind mit verschiedensten Flugzeugtypen vertraut. Ihr Job ist es, Flugzeuge sicherzustellen, wenn ein Käufer nicht bezahlt. In Detektivarbeit machen sie die Flugzeuge ausfindig und bringen sie ihrem Eigentümer zurück.',NULL,'DEU','Airplane Repo - Die Inkasso-Piloten','https://s3.amazonaws.com/schedulesdirect/assets/p8399068_i_h3_ah.jpg',4,NULL),('SH034276860000','Weekly political chat and analysis with the Brexitcast team.',NULL,'GBR','Newscast','https://s3.amazonaws.com/schedulesdirect/assets/p17872906_st_h3_aa.jpg',4,NULL),('SH030689530000','Barbie embarks on adventures with friends and family, including next-door neighbour Ken, in this animated vlog of adventures filmed inside her family\'s new dream house.',NULL,'GBR','Barbie Dreamhouse Adventures','https://s3.amazonaws.com/schedulesdirect/assets/p15426624_b_h3_aa.jpg',4,NULL),('SH029229240000','Flying officer Hugh Fleming is shot down and badly burned during the battle of Britain in September 1940.',NULL,'GBR','A Perfect Hero',NULL,4,NULL),('SH012861820000','Doug Heffernan puts in a long day\'s work delivering parcels and comes home each night to his loving wife, Carrie; unfortunately, he also comes home to his wacko father-in-law, Arthur. Doug\'s only refuges are the little time he spends alone with Carrie and the company of his buddy Spence, co-worker Deacon and cousin Danny, whom he turns to for advice that just might make his life better,