ts throughout the UK to the highest bidders. He searches the country in hopes of landing hidden treasures in storage units that people have stopped paying for. As with its US counterpart, the show focuses not only on Kelly but also the regular bidders who show up at his auctions with the goal of buying something for a low price that they can turn around and sell for a profit - after all, that\'s what storage hunters do (or, at least, try to do). Of course, they have to bid without knowing what\"s inside the crates and units. Like in any competition, strategy, intimidation and trash-talking are all par for the course among the bidders.',NULL,'GBR','Storage Hunters UK','https://s3.amazonaws.com/schedulesdirect/assets/p11163585_i_h3_ab.jpg',4,NULL),('SH034077640000','Gezeigt werden die aktuellen Wettkämpfe der International Biathlon Union (IBU).',NULL,'DEU','Biathlon','https://s3.amazonaws.com/schedulesdirect/assets/p17775811_i_h3_aa.jpg',4,NULL),('SH029358700000','Following some of Britain\'s busiest and best air ambulance teams as they carry out lifesaving services and hospital-level treatment wherever and whenever required, this inspiring and moving series offers a rare, behind-the-scenes insight into some of the situations the UK\'s air emergency workers must face daily. With the cameras shadowing the skilled paramedics responsible for servicing a range of incidents in the field across Oxfordshire, Berkshire and Buckinghamshire, each episode presents a unique opportunity for viewers at home to see what a day for these heroes can really be like.',NULL,'GBR','Emergency Helicopter Medics','https://s3.amazonaws.com/schedulesdirect/assets/p15351389_b_h3_aa.jpg',4,NULL),('SH012610100000','Unencumbered by wives, jobs or any other responsibilities, three senior citizens who\'ve never really grown up explore their world in the Yorkshire Dales. They spend their days speculating about their fellow townsfolk and thinking up adventures not usually favoured by the elderly.',NULL,'GBR','Last of the Summer Wine','https://s3.amazonaws.com/schedulesdirect/assets/p424501_b_h3_aa.jpg',4,NULL),('SH022804880000','Yann und seine Schwester Marina leben auf einer Insel im pazifischen Ozean. Sie wohnen bei ihrem Onkel Patrick, einem Ozeanforscher. Yanns bester Freund ist Zoom, ein weißer Delfin. Die beiden sind immer auf der Suche nach Abenteuern.',NULL,'DEU','Zoom: Der weiße Delfin','https://s3.amazonaws.com/schedulesdirect/assets/p11011690_i_h3_aa.jpg',4,NULL),('SH020868050000','`Jetzt mal ehrlich\' - in seinem wohl persönlichsten Bühnenprogramm deckt Helmut Schleich so manche Ungerechtigkeit auf und begegnet satirisch den Machenschaften unserer Zeit.',NULL,'DEU','Helmut Schleich live auf der Bühne!','https://json.schedulesdirect.org/20141201/image/assets/p11357898_b_h3_aa.jpg',4,NULL),('SH022965700000','This adrenaline-fuelled series follows former athletes Tim Warwood and Adam Gendle taking on some unique challenges. The broadcasting duo are given one week to create extraordinary stunts using the props given to them, a £1,000 budget and inspiration from their location. As they are dropped off somewhere around the UK, the pair must get familiar with their new surroundings to come up with a creative and epic feat. Using their imaginations and their previous athletic knowledge, they build and test a stunt, in preparation for a daring world-class athlete to take it on.',NULL,'GBR','The Indestructibles','https://s3.amazonaws.com/schedulesdirect/assets/p12276135_i_h3_aa.jpg',4,NULL),('SH032450610000','Zwei Jahre nach dem God Blader\'s Cup macht sich das wilde Kind Aiga Akaba, das in der Natur aufgewachsen ist, auf den Weg, um Gegner zu bekämpfen, um stärker zu werden und Valt Aoi zu besiegen.',NULL,'DEU','Beyblade: Burst Turbo','https://s3.amazonaws.com/schedulesdirect/assets/p15992095_b_h3_aa.jpg',4,NULL),('SH022063600000','This observational documentary follows the people who have been affected by the UK\'s housing crisis. As house prices spiral upwards, more and more people have to rent, adding onto the already 8 million tally of tenants. On the other hand there are 2 million private landlords who buy-to-let, and this number is growing where there is the opportunity to make profit. The relationship between tenants and landlords has always been known to sometimes conflict, but with the divide becoming wider, there have been even more dramatic issues coming to the surface. The show follows eviction specialists as they attempt to remove nightmare tenants from buildings and the elite council teams as they seek out rogue landlords who are providing unsuitable living environments.',NULL,'GBR','Nightmare Tenants, Slum Landlords','https://s3.amazonaws.com/schedulesdirect/assets/p11864460_b_h3_aa.jpg',4,NULL),('SH018547050000','Das in Mainz ansässige politische Informationsmagazin widmet sich nationalen Themen aus Deutschland. Gezeigt werden unter anderem allgemeine Diskussionen über aktuelle Krisen sowie Themen aus Politik, Wirtschaft und Gesellschaft.',NULL,'DEU','Report Mainz','https://s3.amazonaws.com/schedulesdirect/assets/p10454876_b_h3_aa.jpg',4,NULL),('SH019578260000','Die Thundermans scheinen auf den ersten Blick eine normale Familie zu sein. Doch der Schein trügt, denn jeder der Thundermans hat eine oder mehrere Superkräfte. Phoebe besitzt die selben Superkräfte wie Max. Sie wird zum Superheld, er zum Bösewicht.',NULL,'DEU','Die Thundermans','https://s3.amazonaws.com/schedulesdirect/assets/p10259786_i_h3_aa.jpg',4,NULL),('SH029284430000','Rae ist 16 Jahre alt, wiegt 105 Kilo und interessiert sich für Musik, Rumhängen und Jungs. Das wäre nichts Außergewöhnliches, hätte sie nicht gerade einen Selbstmordversuch und vier Monate Therapie in einer psychiatrischen Klinik hinter sich.',NULL,'DEU','My Mad Fat Diary','https://json.schedulesdirect.org/20141201/image/assets/p9666347_i_h3_aa.jpg',4,NULL),('SH030587780000','Ninjago war ein friedliches Land - bis Lord Garmadon beabsichtigt dort Herrscher zu werden. Zusammen mit seiner Skelett-Armee überfällt er das Land, raubt, mordet und brandschatzt, was sich ihm in den Weg stellt. Nur Garmadons weiser Bruder Sensei Wu kann Ninjago nun noch retten. Der allerdings hat nur vier Ninja-Lehrlinge an seiner Seite.',NULL,'DEU','Ninjago - Im Land der Drachen','https://s3.amazonaws.com/schedulesdirect/assets/p15794004_i_h3_aa.jpg',4,NULL),('SH024540650000','Two friends, Gluko and Lennon, are in for a wonderfully strange adventure: they must get a little bubble back home to Bubble Land, but they must also make it back in time to prevent some naughty, cute kittens from messing up Grandma\'s house.',NULL,'GBR','Little Big Awesome','https://json.schedulesdirect.org/20141201/image/assets/p12936418_i_h3_aa.jpg',4,NULL),('SH030382920000','The adventures of Rosie, Krashy, ChiChi, Pandy and Wally, toys who come to life in a children\'s bedroom. They explore and discover their world, making friends and learning new things along the way.',NULL,'GBR','Baby Riki','https://s3.amazonaws.com/schedulesdirect/assets/p15871098_b_h3_aa.jpg',4,NULL),('SH012615250000','This police drama series follows the activities in and around Sun Hill, a police station located in the fictional East London borough of Canley. The focus is not just the gritty reality of police work, however; the lives and loves of the officers who staff the precinct get equal play.',NULL,'GBR','The Bill','https://s3.amazonaws.com/schedulesdirect/assets/p184126_i_h3_aa.jpg',4,NULL),('SH031547100000','Proud homeowners open their doors to five property-obsessed nosy neighbours, in the hope of being judged to have the best house in town.',NULL,'GBR','Best House in Town','https://s3.amazonaws.com/schedulesdirect/assets/p16533242_b_h3_aa.jpg',4,NULL),('SH012822630000','Celebrities reveal unusual facts and tell embarrassing stories (some of which are true) on this comedy panel game. What could be better in the current celebrity-obsessed culture? Two teams of four celebrities compete against each other in each episode. The teammates reveal unusual facts and embarrassing stories about themselves, some true, some not. The opposing team must determine what is true and what is made up. A team gains a point for correctly guessing the validity of the opposing team\'s story. If a team guesses incorrectly, the team that told the story gets the point.',NULL,'GBR','Would I Lie to You?','https://s3.amazonaws.com/schedulesdirect/assets/p532422_i_h3_aa.jpg',4,NULL),('SH018438190000','Das Boulevardmagazin berichtet über die Highlights der aktuelle Nachrichten und Promi Ereignisse. Kamila Senjo oder Mareile Höppner moderieren die wichtigsten Themen von Heute.',NULL,'DEU','Brisant','https://s3.amazonaws.com/schedulesdirect/assets/p10415610_b_h3_aa.jpg',4,NULL),('SH013668910000','Ash, Dawn and Brock prepare for the last challenges of the Sinnoh region, relying on their newly evolved and newly captured monsters to help them in their battles.',NULL,'GBR','Pokémon the Series: DP Sinnoh League Victors','https://s3.amazonaws.com/schedulesdirect/assets/p8111344_l_h3_aa.jpg',4,NULL),('SH012600720000','House Doctor Ann Maurice divulges some of her sprucing secrets.',NULL,'GBR','House Doctor','https://s3.amazonaws.com/schedulesdirect/assets/p728446_b_h3_aa.jpg',4,NULL),('SH017729740000','Offering rare looks at some of the United States\' best-loved landmarks from high in the sky. Cameras capture the history and pageantry of America as they zoom over busy cityscapes and quiet, rural lands, focusing on many of the nation\'s states.',NULL,'GBR','Aerial America','https://s3.amazonaws.com/schedulesdirect/assets/p8811095_b_h3_ae.jpg',4,NULL),('SH026062290000','Starting the school year, Archie Andrews wants to pursue a future in the music business, but is without a mentor. Amidst all the small-town banality lurks a mystery: the recent tragic death of Jason Blossom.',NULL,'GBR','Riverdale','https://s3.amazonaws.com/schedulesdirect/assets/p12914589_i_h3_ab.jpg',4,NULL),('SH019568620000','In informativen Beiträgen werden in diesem Wissensmagazin Antworten auf Fragen geboten, die sich jeder schon einmal gestellt hat. Die Themen rangieren von Nützlichem und Spektakulärem bis hin zu Amüsantem und Alltäglichem.',NULL,'DEU','n-tv Wissen','https://s3.amazonaws.com/schedulesdirect/assets/p10907375_b_h3_aa.jpg',4,NULL),('SH023105260000','Susan Calman hosts a show exploring the world of lists.',NULL,'GBR','Listomania','https://s3.amazonaws.com/schedulesdirect/assets/p12347066_st_h3_aa.jpg',4,NULL),('SH030833490000','Die sechs heldenhaften Hunde Chase, Marshall, Rocky, Zuma, Rubble und Skye führen mit Hilfe ihres Trainers Ryder verschiedene Missionen in ihrem Wohnort durch. Von Katzen auf Bäumen bis zu Zügen, die feststecken, ist alles dabei.',NULL,'DEU','Paw Patrol - Helfer auf vier Pfoten','https://s3.amazonaws.com/schedulesdirect/assets/p12113918_i_h3_aa.jpg',4,NULL),('SH018297470000','Melody is a partially-sighted girl with an incredible imagination who visualises stories and characters conjured up by classical music.',NULL,'GBR','Melody','https://s3.amazonaws.com/schedulesdirect/assets/p10358990_i_h3_aa.jpg',4,NULL),('SH025012910000','Dick Powell serves as host to this hugely popular 60s series with a glittering cast of guest stars.',NULL,'GBR','Dick Powell Theatre','https://s3.amazonaws.com/schedulesdirect/assets/p367398_st_h3_aa.jpg',4,NULL),('SH026888200000','Der Traum vom Haus mit Blick auf einen See bleibt für viele leider aus finanziellen Gründen unerfüllt. Die Sendung begleitet Familien auf der Suche nach ihrem Traumhaus am Wasser und zeigt, dass man auch mit einem kleinen Budget fündig werden kann.',NULL,'DEU','Lakefront - Haus am See gesucht','https://s3.amazonaws.com/schedulesdirect/assets/p10975488_i_h3_ab.jpg',4,NULL),('SH015403480000','Das Wissensmagazin beschäftigt sich mit den aktuellen Nachrichten der Woche und erläutert die jeweiligen Hintergründe. Daneben gibt es in jeder Sendung auch Reisen ins Unbekannte und werden Mythen des Alltags aufgeklärt.',NULL,'DEU','W wie Wissen','https://s3.amazonaws.com/schedulesdirect/assets/p9126340_b_h3_aa.jpg',4,NULL),('SH023174020000','A defence attorney solves murder mysteries in the courtroom.',NULL,'GBR','Perry Mason','https://s3.amazonaws.com/schedulesdirect/assets/p184141_i_h3_aa.jpg',4,NULL),('SH014051470000','Inside Kleinfeld Bridal, the Manhattan-based bridal salon that is arguably the world\'s finest, more than 250 professionals, most of them veterans from the shop\'s early days in Brooklyn, bend over backward to make each bride\'s experience unforgettable. Part bridal story, part fashion makeover and part family therapy session, each episode looks at the personalities and craftsmanship that come into play as the Kleinfeld staff go to sometimes extreme lengths to realize each bride\'s dreams.',NULL,'GBR','Say Yes to the Dress','https://s3.amazonaws.com/schedulesdirect/assets/p185733_l_h3_ab.jpg',4,NULL),('SH027786700000','Rechtsanwältin Karen E. Laine und ihre Tochter, die Immobilienexpertin Mina Starsiak sind ein unschlagbares Team. In ihrer Heimatstadt Indianapolis verwandeln sie heruntergekommene Häuser mit kleinem Budget in Traumhäuser.',NULL,'DEU','Good Bones - Mutter, Tochter, Home-Makeover','https://s3.amazonaws.com/schedulesdirect/assets/p12588321_i_h3_ac.jpg',4,NULL),('SH019808820000','Christy Plunkett bekam ihre Tochter Violet mit 16 Jahren und hat einen Sohn namens Roscoe gemeinsam mit ihrem Ex-Mann. Seit einem Jahr ist Christy nun trocken und hat immer noch schwer mit ihrer Sucht zu kämpfen. Sie arbeitet als Kellnerin in einem Restaurant und hat eine Affäre mit ihrem verheirateten Chef. Eines Tages fasst sie den Entschluss, ihr Leben umzukrempeln und besucht sogar Treffen der Anonymen Alkoholiker. Hilfe bekommt sie ausgerechnet von ihrer Mutter Bonnie. Sie war selbst alkoholsüchtig und drogenabhängig und konnte sich daher nur wenig um Tochter Christy kümmern, als die ein Kind war. Nun will sie das wiedergutmachen und versucht, das Vertrauen ihrer Tochter