nderwater explorers, the Nektons, as they explore the mysterious depths of the ocean.',NULL,'GBR','The Deep','https://s3.amazonaws.com/schedulesdirect/assets/p12413800_i_h3_ab.jpg',4,NULL),('SH014205450000','Rachel Bailey and Janet Scott are two detective constables working for DCI Gill Murray on the Manchester Metropolitan Police\'s Major Incident Team, tasked with tracking down killers. Bailey is intuitive, funny and passionate about her job. But her impulsiveness occasionally leads Murray to consider her to be a liability. Scott is reliable and a thinker. The mother of two is a very private person who is in a marriage that has become little more than a convenient arrangement for her and her husband, Adrian. As a result of her marital problems, Scott has become sexually involved with her immediate boss, DS Andy Roper. Bailey and Scott draw on each other\'s strengths to deal with extreme and horrific crimes. One of the show\'s co-creators, Diane Taylor, is a retired detective inspector from the Major Incident Team of the Greater Manchester Police Force.',NULL,'GBR','Scott & Bailey','https://s3.amazonaws.com/schedulesdirect/assets/p8683464_b_h3_ae.jpg',4,NULL),('SH018107080000','A family discovers that its new home is haunted.',NULL,'GBR','The Haunted Hathaways','https://s3.amazonaws.com/schedulesdirect/assets/p10067642_i_h3_aa.jpg',4,NULL),('SH022690770000','Die viereinhalb Freunde: Das sind Kalle, Fred, Steffi, Radieschen und der eigenwillige Hund Dandy. Zusammen bilden sie das Detektivbüro `Kalle & Co\'. Und weil Kalle die Detektei gegründet hat, ist er auch der Chef. Er will immer wieder Fälle lösen.',NULL,'DEU','4 1/2 Freunde','https://s3.amazonaws.com/schedulesdirect/assets/p12135082_b_h3_aa.jpg',4,NULL),('SH012735490000','The syndicated ensemble action drama chronicles the adventures of a group of human mutants - led by the mysterious Adam Kane - possessing extraordinary powers as a result of genetic experimentation gone awry.',NULL,'GBR','Mutant X','https://s3.amazonaws.com/schedulesdirect/assets/p184771_b_h3_ab.jpg',4,NULL),('SH026348160000','Sir Tony Robinson explores northern England\'s iconic Coast to Coast route, stepping off the beaten track to reveal the fascinating religious and industrial heritage that underscores this near-200-mile stretch of lush and diverse countryside.',NULL,'GBR','Tony Robinson\'s: Coast To Coast','https://s3.amazonaws.com/schedulesdirect/assets/p13885643_b_h3_aa.jpg',4,NULL),('SH019774950000','Servicemagazin des NDR, mit Tipps und Tricks zu alltäglichen Themen.',NULL,'DEU','Mein Nachmittag','https://s3.amazonaws.com/schedulesdirect/assets/p10990972_i_h3_ab.jpg',4,NULL),('SH031547630000','Although Britain is in the midst of a housing crisis, there are also over 200,000 empty properties. Matt Allwright goes on a mission to seek out the UK\'s empty homes and help pair them with people who desperately need somewhere to live.',NULL,'GBR','The Empty Housing Scandal','https://s3.amazonaws.com/schedulesdirect/assets/p16533510_b_h3_aa.jpg',4,NULL),('SH013373850000','Taking inspiration from real life situations this part reality show, part soap opera showcases the lives of a glamorous group of young people, putting the home county of Essex on the map. The show\'s main cast, who have jobs in various lines of work, enjoy the local nightlife and bars as well as travelling abroad to summer destination favourites like Tenerife, Marbella and Barcelona to soak up the sun. The trials and tribulations of the lives, loves and scandals of this real-life group of Essex guys and gals are captured as the drama unfolds.',NULL,'GBR','The Only Way Is Essex','https://s3.amazonaws.com/schedulesdirect/assets/p8338096_i_h3_ag.jpg',4,NULL),('SH013110090000','Biographical discussions.',NULL,'GBR','Great Lives','https://s3.amazonaws.com/schedulesdirect/assets/p241403_b_h3_aa.jpg',4,NULL),('SH030180330000','Die Dokusoap porträtiert sechs Kioske in verschiedenen Städten Deutschlands, wie zum Beispiel in Köln und Kaiserslautern. Die Kamera fängt den Alltag von Kioskbesitzern und Stammkunden ein, zu dem Probleme, aber auch glückliche Momente gehören.',NULL,'DEU','Unser Kiosk - Trost und Prost im Viertel','https://s3.amazonaws.com/schedulesdirect/assets/p15772079_st_h3_aa.jpg',4,NULL),('SH034111460000','WWE\'s top male and female competitors from the UK battle to make an impact on their rise to fame.',NULL,'GBR','WWE NXT UK','https://s3.amazonaws.com/schedulesdirect/assets/p16108793_b_h3_ab.jpg',4,NULL),('SH034409410000','Stanley Tucci imagines the story of modern California as a movie screenplay, tracing the dramatic history of the state from Hollywood to Silicon Valley.',NULL,'GBR','The Californian Century','https://s3.amazonaws.com/schedulesdirect/assets/p17964263_st_h3_aa.jpg',4,NULL),('SH014721010000','Listen to the music from concerts around the world.',NULL,'GBR','Radio 3 in Concert','https://s3.amazonaws.com/schedulesdirect/assets/p8830314_st_h3_aa.jpg',4,NULL),('SH034424150000','Live ball-by-ball commentary of the ICC Women\'s T20 World Cup.',NULL,'GBR','Live: ICC Women\'s T20 World Cup Cricket','https://s3.amazonaws.com/schedulesdirect/assets/p17971966_st_h3_aa.jpg',4,NULL),('SH034331450000','The history of royal state visits, offering a glimpse into the lives of the British royal family, starting with the overseas tours of the 1940s and 50s.',NULL,'GBR','The Windsors: Secrets of the Royal Tours',NULL,4,NULL),('SH020904420000','`Conny\' Niedrig und `Bernie\' Kuhnt sind zwei Kriminalkommissare von der Kriminalpolizei Recklinghausen. Bei den authentisch nachgespielten Ermittlungen arbeiten die beiden im Team, um die Verbrechen rund um Duisburg zu bekämpfen.',NULL,'DEU','Niedrig und Kuhnt - Kommissare ermitteln','https://s3.amazonaws.com/schedulesdirect/assets/p452307_st_h3_aa.jpg',4,NULL),('SH025075440000','Taking up the mantle of the upcycling trend, presenters Henry Cole and Simon O\'Brien scour the country for old junk to refurbish into bespoke products. Old farm buildings and sheds can be chock-full of abandoned treasures that are worthy of reworking into sellable goods, usually without the owners even knowing. With a bit of elbow grease and some DIY magic, odd bits and bobs like a church pew, a petrol tank, an egg incubator or a clay pigeon trap can be touched up and sold for a tidy profit.',NULL,'GBR','Find It, Fix It, Flog It','https://s3.amazonaws.com/schedulesdirect/assets/p13263930_i_h3_aa.jpg',4,NULL),('SH019170130000','Located on the outskirts of Las Vegas, Steve Darnell and his band of oddballs and misfits create one-of-a-kind, Mad Max-style rat rods. With the demands of their quirky customers, the team at Welder Up strips and rebuilds vehicles from hidden treasure. In each episode, the automotive fabricators use their imaginations and creativity to create a unique vehicle for each unique owner. With details ranging from a shotgun gearshift to horseshoe gas pedals, the crew transforms discarded treasure and performance parts into bizarre, eccentric and truly one-of-a-kind rolling works of art.',NULL,'GBR','Sin City Motors','https://s3.amazonaws.com/schedulesdirect/assets/p10611121_st_h3_aa.jpg',4,NULL),('SH028309320000','Tick, Trick und Track werden von ihrem Onkel Donald bei ihrem Onkel Dagobert abgegeben, damit dieser zu einem Vorstellungsgespräch gehen kann. Die drei erleben mit ihrem Onkel Dagobert viele verschiedene und spannende Abenteuer.',NULL,'DEU','DuckTales','https://s3.amazonaws.com/schedulesdirect/assets/p14263798_b_h3_aa.jpg',4,NULL),('SH033080150000','For Owen Grady it was an easy job, deliver the dinosaurs and get paid. Nothing could possibly go wrong or that is what they thought.',NULL,'GBR','Jurassic World: The Secret Exhibit','https://s3.amazonaws.com/schedulesdirect/assets/p16123638_i_h3_aa.jpg',4,NULL),('SH019374110000','Die Moderatoren berichten über aktuelle Nachrichten und interessante Ereignisse.',NULL,'DEU','Newstime','https://s3.amazonaws.com/schedulesdirect/assets/p10838099_i_h3_ab.jpg',4,NULL),('SH012597200000','Dr Frasier Crane, a successful Boston therapist, moves to Seattle to get a new start on life; he has a radio talk show, which he uses to relay his wit and wisdom to others, but at times he struggles with his own problems with his salt-of-the-earth father, his pretentious brother and his friends and co-workers.',NULL,'GBR','Frasier','https://s3.amazonaws.com/schedulesdirect/assets/p183920_l_h3_aa.jpg',4,NULL),('SH019576250000','Der rothaarige Bombenexperte und ehemalige NYPD Agent Horatio Caine ist der Leiter der CSI-Abteilung in Miami. Dort ist er gemeinsam mit seinem Team für die Sicherheit der Stadt verantwortlich. Mittels Forensik, Gentechnik und Gerichtsmedizin lösen die Beamten des CSI knifflige Fälle. Horatio ist für sein fotografisches Gedächtnis und seinen trockenen Charme bekannt. An seiner Seite ermitteln die Ballistikerin Calleigh Duquesne, der belesene Tim Speedle, DNA-Spezialistin Alexx Woods und Eric Delko, Spezialist für die Auswertung von Fingerabdrücken sowie Experte im Drogenmillieu.',NULL,'DEU','CSI: Miami','https://s3.amazonaws.com/schedulesdirect/assets/p184820_i_h3_aa.jpg',4,NULL),('SH012606190000','Eagle-eyed technical experts prove there is no such thing as a perfect crime as they assemble the pieces every criminal leaves behind. Dramatic crime re-creations and, sometimes, part of the investigations are a staple of the series. Some of the re-creations include alternate versions of the crimes, which are disproved by science. The show\'s episodes follow each case from the initial investigation until it reaches its legal resolution.',NULL,'GBR','Medical Detectives','https://s3.amazonaws.com/schedulesdirect/assets/p439881_b_h3_ai.jpg',4,NULL),('SH034398560000','Quiz show with Jon Snow. Britain\'s best quiz teams face TV\'s toughest questions, on any topic, from science to sport. Intelli-Gents take on Assassins\' Guild.',NULL,'GBR','Jon Snow\'s Very Hard Questions','https://s3.amazonaws.com/schedulesdirect/assets/p17955814_st_h3_aa.jpg',4,NULL),('SH017036890000','Game show in which three contestants attempt to solve word puzzles to win prizes.',NULL,'GBR','Wheel of Fortune','https://s3.amazonaws.com/schedulesdirect/assets/p9809013_i_h3_aa.jpg',4,NULL),('SH027080810000','A billboard is zapped, bringing life to ToonMart Marty.',NULL,'GBR','ToonMarty','https://s3.amazonaws.com/schedulesdirect/assets/p14034935_b_h3_aa.jpg',4,NULL),('SH019979900000','Jimmie DeRamus betreibt mit seiner Familie seit über 25 Jahren das Pfandleihhaus `Silver Dollar Pawn & Jewelry Center\' in Louisiana. Sie finden ständig neue Kostbarkeiten und seltene Gegenstände. Es werden sogar Bustouren mit Führung angeboten.',NULL,'DEU','Cajun Pawn Stars','https://s3.amazonaws.com/schedulesdirect/assets/p8984592_i_h3_aa.jpg',4,NULL),('SH017703990000','Rachael Ray shares recipes that take a half hour or less.',NULL,'GBR','30-Minute Meals','https://s3.amazonaws.com/schedulesdirect/assets/p16656736_b_h3_ab.jpg',4,NULL),('SH024960890000','This observational documentary follows a police force in Essex, as they work towards protecting the people who live in the area. The episodes capture the footage as team members are called out to address criminal activity, which can include thefts, getaway drivers, domestic abuse cases and drug dealing. The officers are followed throughout the day, documenting every part of their role and revealing all aspects of modern policing.',NULL,'GBR','The Force: Essex','https://s3.amazonaws.com/schedulesdirect/assets/p13206256_b_h3_aa.jpg',4,NULL),('SH032912880000','Unterschiedliche Jahreszeiten prägen das Leben auf unserem Planeten. Ihr immerwährender Zyklus bestimmt das Leben von Pflanzen und Tieren, bringt neue Chancen und Gefahren.Der Frühling ist die Zeit des Neubeginns, des Werdens und Wachsens.',NULL,'DEU','Magie der Jahreszeiten','https://s3.amazonaws.com/schedulesdirect/assets/p17244064_st_h3_aa.jpg',4,NULL),('SH013319050000','Mike Biggs is a good-hearted Chicago police officer looking to lose weight. Molly Flynn is an instantly likeable fourth-grade teacher with a sense of humour about her size. The two meet one day when Mike speaks at an Overeaters Anonymous meeting and they fall in love, thanks in part to their mutual love of pie and the desire to resist it. Both face challenges in their quest to lose weight - Molly from her slender sister and mother and Mike at the diner where he frequently eats. But having found each other, they will try to help each other drop the pounds.',NULL,'GBR','Mike & Molly','https://s3.amazonaws.com/schedulesdirect/assets/p8130329_l_h3_aa.jpg',4,NULL),('SH012682880000','In a magical picture-book place, colourful characters have adventures and are read bedtime stories. Igglepiggle, Upsy Daisy and Makka Pakka care for each other unconditionally and do their best to keep everyone relaxed.',NULL,'GBR','In the Night Garden','https://s3.amazonaws.com/schedulesdirect/assets/p736166_i_h3_aa.jpg',4,NULL),('SH019769290000','Übertragungen von aktuellen Wettbewerben aus der Welt des Radsports.',NULL,'DEU','Radsport','https://s3.amazonaws.com/schedulesdirect/assets/p361948_i_h3_aa.jpg',4,NULL),('SH017976420000','Charlie and his family have recently moved from London to run a Bed and Breakfast by the sea.',NULL,'GBR','All At Sea','https://json.schedulesdirect.org/20141201/image/assets/p10216428_i_h3_aa.jpg',4,NULL),('SH029820540000','Gezeigt werden Dokumentationen zu verschiedenen Themen.',NULL,'DEU','phoenix plus','https://s3.amazonaws.com/schedulesdirect/assets/p15586965_st_h3_aa.jpg',4,NULL),('SH029035350000','TV-Koch Roland Trettl heißt Singles aus ganz Deutschland in seinem Restaurant willkommen. Die Kandidaten werden je nach Vorlieben und Abneigungen gepaart und lernen sich zum ersten Mal bei einem Dinner im Restaurant kennen.',NULL,'DEU','First Dates - Ein Tisch für zwei','https://s3.amazonaws.com/schedulesdirect/assets/p15179177_st_h3_aa.jpg',4,NULL),('SH029097970000','The leaders of the Nazis began as ordinary, charming, intelligent men. They were not insane. An exploration of the incredible transformation of ordinary men into Nazi criminals to discover what turned these men into monsters.',NULL,'GBR','True Evil: Making of a Nazi','https://s3.amazonaws.com/schedulesdirect/assets/p15212148_b_h3_aa.jpg',4,NULL),('SH016344000000','The ups and downs of a second-class writer.',NULL,'GBR','Such Rotten Luck','https://s3.amazonaws.com/schedulesdirect/assets/p9542517_st_h3_aa.jpg',4,NULL),('SH019855850000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus Ostwestfalen-Lippe.',NULL,'DEU','Lokalzeit OWL','https://s3.amazonaws.com/schedulesdirect/assets/p11024436_b_h3_ab.jpg',4,NULL),('SH018977950000','The world\'s most famous cat and mouse duo carries out more non-stop slapstick battling.',NULL,'GBR','The Tom and Jerry Show','https://s3.amazonaws.com/schedulesdirect/assets/p10478306_i_h3_aa.jpg',4,NULL),('SH020848860000','Tradition collides with transformation in McCarthy, Alaska. The isolated town - once considered to be the state\'s version of \"Sin City\' flourished during the Gold Rush but is now home to roughly 40 people, a mix of mavericks, risk takers and rabble rousers willing to brave extreme conditions to live free. While some believe in continuing the town\'s frontier way of life, others feel the future of McCarthy depends on dragging it into the modern age. Long-standing resident Jeremy Keller fights to protect its roots, while Neil Darish has purchased multiple properties in town and plans to restore its vibrancy. `Edge of Alaska\" tells the story of a hinterland at a crossroads.',NULL,'GBR','Edge of Alaska','https://s3.amazonaws.com/schedulesdirect/assets/p10783330_l_h3_aa.jpg',4,NULL),('SH031944320000','Following the adventures and mishaps of the kindly but accident-prone Mr Magoo.',NULL,'GBR','Mr. Magoo','https://s3.amazonaws.com/schedulesdirect/assets/p16671396_i_h3_aa.jpg',4,NULL),('SH019468800000','Das Magazin informiert die Zuschauer etwa in Sachen Politik, Kultur und Alltagsleben.',NULL,'DEU','MDR Thüringen Journal','https://s3.amazonaws.com/schedulesdirect/assets/p10871952_b_h3_ab.jpg',4,NULL),('SH031948590000','Die Sendung zeigt Videos von lustigen Momenten aus dem Alltag verschiedener Familien.',NULL,'DEU','Einfach süß!','https://s3.amazonaws.com/schedulesdirect/assets/p16754959_st_h3_aa.jpg',4,NULL),('SH016566710000','The triumphs and tragedies of the Horton, Brady and DiMera families.',NULL,'GBR','Days of our Lives','https://s3.amazonaws.com/schedulesdirect/assets/p183909_l_h3_aa.jpg',4,NULL),('SH020082860000','In dieser Talkshow beantworten der Moderator und unterschiedlichen Experten die Fragen der Anrufer.',NULL,'DEU','Tagesgespräch','https://s3.amazonaws.com/schedulesdirect/assets/p11097051_b_h3_aa.jpg',4,NULL),('SH019783710000','Das perfekt eingespielte Team der Forensiker und Spurensucher um Mac Taylor aus New York deckt ungewöhnliche Mordfälle auf. Dabei entgeht den geschulten Augen der Ermittler nichts, und sie entlarven stets geschickt die wahren Täter.',NULL,'DEU','CSI: New York','https://s3.amazonaws.com/schedulesdirect/assets/p185030_i_h3_aa.jpg',4,NULL),('SH030640750000','Children\'s comedy series.',NULL,'GBR','Diddy Bits','https://s3.amazonaws.com/schedulesdirect/assets/p16064072_i_h3_aa.jpg',4,NULL),('SH012791830000','Stan Smith is a CIA agent painfully dedicated to homeland security. His home life includes doting wife Francine, a ditzy housewife, liberal daughter Hayley and socially awkward teenaged son Steve. Also living in the family\'s Langley Falls, Va., home are Klaus, a goldfish with the brain of an East German Olympic ski jumper, and Roger, an escaped alien from Area 51, who Stan houses in defiance of his employer due to owing Roger a \"life debt\". Sounds just like the typical American family, right? Maybe not.',NULL,'GBR','American Dad!','https://s3.amazonaws.com/schedulesdirect/assets/p185040_i_h3_ab.jpg',4,NULL),('SH012612570000','Featuring TV\'s worst DIY expert, a troupe of acrobats, and a weather presenter.',NULL,'GBR','Gigglebiz','https://s3.amazonaws.com/schedulesdirect/assets/p8104582_i_h3_aa.jpg',4,NULL),('SH020303920000','In den kältesten Regionen Nordamerikas gibt es eine der ungewöhnlichsten Transportbranchen der Welt. In diesen Gegenden können einige Orte und Firmen nur innerhalb weniger Monate mit Fahrzeugen erreicht werden - die Stunde der `Ice Road Truckers\'.',NULL,'DEU','Ice Road Truckers - Gefahr auf dem Eis','https://s3.amazonaws.com/schedulesdirect/assets/p185608_i_h3_ab.jpg',4,NULL),('SH018994710000','In the hope of winning a national title, the A-Troupe dancers are led by team captain Emily and head choreographer Chris. Day in and day out, the group trains for the regional competition at The Next Step Dance Studio. When a very talented girl, Michelle, joins the team, Emily feels threatened. With her arrival at the studio, secrets, emotions and cliques are exposed and challenged. The championships are just around the corner, so the team must come together and resolve its problems if the members are to have any chance of winning the national title.',NULL,'GBR','The Next Step','https://s3.amazonaws.com/schedulesdirect/assets/p9732253_b_h3_aa.jpg',4,NULL),('SH014480940000','Marshal Matt Dillon (then-newcomer James Arness) tries to prevent lawlessness from overtaking Dodge City, Kansas. Helping to keep him grounded are saloon proprietor Miss Kitty Russell and Doc Adams. The television series grew out of the long-running radio serial of the same name, although for a short time they were both on the airwaves.',NULL,'GBR','Gunsmoke','https://s3.amazonaws.com/schedulesdirect/assets/p184305_l_h3_aa.jpg',4,NULL),('SH019752360000','Die sechs heldenhaften Hunde Chase, Marshall, Rocky, Zuma, Rubble und Skye führen mit Hilfe ihres Trainers Ryder verschiedene Missionen in ihrem Wohnort durch. Von Katzen auf Bäumen bis zu Zügen, die feststecken, ist alles dabei.',NULL,'DEU','PAW Patrol','https://s3.amazonaws.com/schedulesdirect/assets/p10077400_b_h3_ab.jpg',4,NULL),('SH019568770000','In jeder Sendung sucht Jean Pierre Kraemer, der Auto-Profi, mit seinem Team einen passenden Gebrauchtwagen für einen Zuschauer. Sie geben wertvolle Tipps, verraten Tricks der Verkäufer und beweisen, dass man gute Gebrauchtwagen günstig kaufen kann.',NULL,'DEU','Die PS Profis - Mehr Power aus dem Pott','https://s3.amazonaws.com/schedulesdirect/assets/p10907391_st_h3_aa.jpg',4,NULL),('SH019022550000','Most pawn shops would never see a customer walk in to pawn a Lamborghini, but not this one. That is the type of item customers bring into Prestige Pawnbrokers, which specialises in high-end pawn transactions. Expensive and exclusive items are the norm for the staffers at the Surrey-based shop. Because they\'re dealing with high-priced items, the staff have to make sure the items they\'re buying are authentic rather than just cheap knock-offs. In addition to expensive cars, high-end jewellery, handbags and even a mini-submarine are items that are brought to Prestige.',NULL,'GBR','Posh Pawn','https://s3.amazonaws.com/schedulesdirect/assets/p10682829_b_h3_aa.jpg',4,NULL),('SH012667430000','Sam Malone, a former relief pitcher for the Boston Red Sox, owns and runs Cheers, a cosy bar in Boston. Somewhat snobby, beautiful and intelligent Diane Chambers - forced to become a waitress when her fiance jilts her - constantly bickers with Sam. Eventually, they fall in love. Several wacky characters make the bar their home-away-from-home, including sarcastic waitress Carla, beer-loving accountant Norm and know-it-all letter carrier Cliff. A few seasons later, after Diane leaves Boston, Sam sells the bar to buy a boat and sail around the world. But his boat sinks and he returns to bartending. Rebecca Howe, the new (more ambitious) manager, hires him back. They love to hate each other and eventually get together as well.',NULL,'GBR','Cheers','https://s3.amazonaws.com/schedulesdirect/assets/p183897_l_h3_aa.jpg',4,NULL),('SH014354640000','Rick Dale, first introduced as a restorer on \"Pawn Stars\', gets his own History show with `American Restoration\'. The owner of Rick\'s Restorations in Las Vegas, Dale and his team painstakingly restore pieces of America\"s past, from an old golf cart to a giant gas pump from the 1940s. Along the way, they learn bits and pieces of history about the objects they restore and come up with inventive ways to get the job done.',NULL,'GBR','American Restoration','https://s3.amazonaws.com/schedulesdirect/assets/p8300528_l_h3_aa.jpg',4,NULL),('SH023973730000','The Powerpuff Girls have to protect Townsville from villains who want to take over the metropolis. The sisters have to manage their homework with their superhero activities.',NULL,'GBR','The Powerpuff Girls','https://s3.amazonaws.com/schedulesdirect/assets/p12656123_b_h3_aa.jpg',4,NULL),('SH018661100000','Dr. Temperance `Bones\' Brennan ist eine grandiose forensische Anthropologin am staatlichen Jeffersonian Institute in Washington. Der Umgang mit ihren Mitmenschen fällt ihr allerdings recht schwer. Gemeinsam mit dem Ermittler und ehemaligen Scharfschützen Seeley Booth untersucht sie für das FBI Fälle, die einige Jahrzehnte oder noch weitaus länger zurückliegen. Aus diesem Grund sind die Beteiligten meist schon tot und Knochen sind oft die einzigen Zeugen.',NULL,'DEU','Bones - Die Knochenjägerin','https://s3.amazonaws.com/schedulesdirect/assets/p185129_i_h3_ae.jpg',4,NULL),('SH025063190000','Ärzte und Pflegepersonal eines Krankenhauses geben Einblick in ihren beruflichen Alltag. Doch neben den professionellen Höhen und Tiefen werden auch persönliche Schicksale dokumentiert. Gelegentlich muss die Polizei zur Unterstützung gerufen werden.',NULL,'DEU','Klinik am Südring','https://s3.amazonaws.com/schedulesdirect/assets/p13254823_st_h3_aa.jpg',4,NULL),('SH019694470000','Magazin für Vorschulkinder, das seine Zuschauer einlädt, zu den Themen einer Sendung zu malen und zu basteln. Für ausgewählte Einsendungen gibt es eine Online-Galerie, in der die Fans die Bilder von Kindern bestaunen können.',NULL,'DEU','ENE MENE BU - und dran bist du','https://s3.amazonaws.com/schedulesdirect/assets/p10958956_b_h3_aa.jpg',4,NULL),('SH012659190000','This popular British show follows the raucous adventures of the Larkin clan and the local tax collector. Ma and Pop Larkin have a large brood, living in 1950s rural England. They have six children -- eldest daughter Mariette is played by a young Catherine Zeta-Jones. Mariette entrances tax collector Cedric, and the Larkins introduce Cedric - whom they call Charlie - to their way of life, which he finds much more compelling than work at the office.',NULL,'GBR','The Darling Buds of May','https://s3.amazonaws.com/schedulesdirect/assets/p363484_i_h3_aa.jpg',4,NULL),('SH012691630000','Members of the 4077th Mobile Army Surgical Hospital care for the injured during the Korean War use humor to escape the horror and depression of the situation. Among the 4077\'s people are Capts Benjamin \"Hawkeye\' Pierce and `Trapper John` McIntire, Majs Margaret `Hot Lips\' Houlihan and Frank Burns, and Cpl Walter `Radar\' O\"Reilly.',NULL,'GBR','M*A*S*H','https://s3.amazonaws.com/schedulesdirect/assets/p183880_l_h3_aa.jpg',4,NULL),('SH019855800000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus Bonn.',NULL,'DEU','Lokalzeit aus Bonn','https://s3.amazonaws.com/schedulesdirect/assets/p11024418_b_h3_ab.jpg',4,NULL),('SH033047100000','Interviews, discussion and analysis from Westminster, including the latest on Brexit with Andrew and guests.',NULL,'GBR','The Andrew Neil Show','https://s3.amazonaws.com/schedulesdirect/assets/p17329488_i_h3_aa.jpg',4,NULL),('SH019559820000','Der erfolgreiche und angesehene Krimiautor und alleinerziehender Vater Richard Castle stellt schockiert fest, dass zwei Morde tatsächlich nach dem Vorbild seines Romans verübt wurden. Von da an will er nicht nur über erfundene Verbrechen schreiben, sondern der Polizei und insbesondere der Ermittlungsbeamtin Kate Beckett bei der Aufklärung verschiedener Fälle helfen. Die beiden bilden ein ausgesprochen effektives Ermittlerteam, auch wenn Castle eine Auge auf Kate geworfen hat, die gegen seinen Charme immun zu sein scheint.',NULL,'DEU','Castle','https://s3.amazonaws.com/schedulesdirect/assets/p188601_l_h3_aa.jpg',4,NULL),('SH019433120000','Die Doku-Soap begleitet Mädchen, die in jungen Jahren zu Müttern werden. Die jungen Frauen werden während der Schwangerschaft sowie nach der Geburt begleitet.',NULL,'DEU','Teenie-Mütter - Wenn Kinder Kinder kriegen','https://s3.amazonaws.com/schedulesdirect/assets/p10858728_st_h3_aa.jpg',4,NULL),('SH019360070000','Im Leben der Familie Simpson ist immer etwas los. Der liebenswerte, aber vom Pech verfolgte, schusselige und ziemlich faule Vater Homer Simpson arbeitet in einem Atomkraftwerk und versucht, seine Familie bestmöglich über Wasser zu halten. Seine Frau Marge ist als Mutter und Hausfrau die gute Seele im Hause Simpson und versucht stets, sowohl in der Familie als auch in der Gesellschaft die moralischen Grundwerte zu verbessern. Die Eltern haben alle Hände voll zu tun mit ihren drei Kindern. Bei dem zehnjährigen Bart weiß man nie, welchen Streich er als nächstes ausheckt. Die achtjährige hochintelligente und ehrgeizige Lisa ist eine Weltverbesserin, die in der Schule oft als Streber gehänselt wird. Vervollständigt werden die Simpsons von Baby Maggie. Das Leben der Familie und der anderen Bewohner der US-Kleinstadt Springfield ist geprägt vom alltäglichen Chaos und ganz normalen Wahnsinn der Gesellschaft.',NULL,'DEU','Die Simpsons','https://s3.amazonaws.com/schedulesdirect/assets/p183872_i_h3_ac.jpg',4,NULL),('SH032181420000','Clive Anderson and Mary-Ann Ochota\'s journey through Britain\'s strange and unusual past, exploring everything from the unsettling to the simply surprising, from zombies and mummification to witchcraft.',NULL,'GBR','Mystic Britain','https://s3.amazonaws.com/schedulesdirect/assets/p16866129_st_h3_aa.jpg',4,NULL),('SH027326810000','A woman in search of a new job winds up as the housekeeper for the son she gave up for adoption decades earlier.',NULL,'GBR','That\'s My Boy','https://s3.amazonaws.com/schedulesdirect/assets/p502309_b_h3_aa.jpg',4,NULL),('SH022752910000','In der Sketchcomedy sollen absurde und komische Geschichten hinter historischen Ereignissen gezeigt werden. Die Zuschauer werden auf eine Reise durch die Geschichte der Menschheit genommen, von den Urzeitmenschen bis zur Neuzeit.',NULL,'DEU','Sketch History','https://s3.amazonaws.com/schedulesdirect/assets/p12164715_b_h3_aa.jpg',4,NULL),('SH012692250000','Drama series following the adventures of a young man and his incredible talking car, KITT.',NULL,'GBR','Knight Rider','https://s3.amazonaws.com/schedulesdirect/assets/p183977_l_h3_aa.jpg',4,NULL),('SH021881570000','A tyrant is defined as a ruler who exercises absolute power oppressively or brutally. That definition fits Henry VIII, at least by the end of his reign as king of England. Henry\'s ascension to the throne was greeted with much rejoicing in 1509. The nation was filled with hope. But by the time he died nearly four decades after taking the throne, he had the reputation of being a tyrannical and ruthless monarch. In this documentary series, noted historian and leading Tudor authority Dr David Starkey examines the life of the monarch and how he went from providing hope to England to being considered a tyrant.',NULL,'GBR','Henry VIII: The Mind of a Tyrant','https://json.schedulesdirect.org/20141201/image/assets/p3633992_i_h3_aa.jpg',4,NULL),('SH012906520000','Three female police officers are recruited to work for Charles Townsend Agency as private investigators. Their boss, Charlie, who nicknames them \"Angels\", never meets them in person, but gives them their assignments via a speakerphone.',NULL,'GBR','Charlie\'s Angels','https://s3.amazonaws.com/schedulesdirect/assets/p184008_l_h3_aa.jpg',4,NULL),('SH019580070000','Tägliches Boulevard-Magazin im hr-Fernsehen.',NULL,'DEU','maintower','https://s3.amazonaws.com/schedulesdirect/assets/p10911548_b_h3_aa.jpg',4,NULL),('SH016397710000','Bissig, ironisch, respektlos und bisweilen albern nimmt die Satiresendung die Nachrichtenthemen der Woche aufs Korn. Im Stil eines Nachrichtensprechers kommentiert Moderator Oliver Welke die Neuigkeiten aus Politik und Gesellschaft.',NULL,'DEU','heute-show','https://s3.amazonaws.com/schedulesdirect/assets/p9563374_b_h3_aa.jpg',4,NULL),('SH013032490000','Simon and Dave get back on their bikes and visit a different county in each episode.',NULL,'GBR','The Hairy Bikers\' Food Tour of Britain','https://s3.amazonaws.com/schedulesdirect/assets/p8200524_i_h3_aa.jpg',4,NULL),('SH019855810000','Das Lokalzeit-Studio versorgt die Zuschauer mit Nachrichten und Berichten aus Südwestfalen.',NULL,'DEU','Lokalzeit Südwestfalen','https://s3.amazonaws.com/schedulesdirect/assets/p11024424_b_h3_aa.jpg',4,NULL),('SH028765600000','Polizisten und andere Ermittler werfen einen Blick zurück auf Ereignisse in ihrem Berufsleben. Unter anderem erzählen sie von spektakulären Verfolgungsjagden, sprechen über unvorhergesehene Geständnisse und dreiste Betrugsfälle.',NULL,'DEU','Achtung Kontrolle! Wir kümmern uns drum','https://s3.amazonaws.com/schedulesdirect/assets/p3592113_i_h3_ab.jpg',4,NULL),('SH016391700000','Viele Ereignisse des 20. Jahrhunderts sind nicht bis ins letzte geklärt. Noch immer gibt es spannende Fragen vergangener Jahrzehnte. Das Magazin im ZDF, enthüllt Geheimnisse der Geschichte.',NULL,'DEU','ZDF-History','https://s3.amazonaws.com/schedulesdirect/assets/p9561670_b_h3_af.jpg',4,NULL),('SH018574310000','Dr. Gregory House ist ein eigenwilliger Spezialist für Diagnostik am fiktiven Princeton-Plainsboro Teaching Hospital. Sein Umgang sowohl mit seinen Kollegen als auch mit Patienten ist schroff und schonungslos direkt, was häufig zu Konflikten führt. Als Mediziner jedoch gilt der brilliante Diagnostiker und Spezialist für Infektionskrankheiten als einer der besten seiner Zunft. Gemeinsam mit seinem Team junger Ärzte stellt er sich jeder, oft scheinbar unlösbaren, medizinischen Herausforderung. In detektivischer Kleinarbeit und oft mit unkonventionellen Methoden kommt er den seltsamsten Krankheiten auf die Spur und rettet damit Leben.',NULL,'DEU','Dr House','https://s3.amazonaws.com/schedulesdirect/assets/p185044_i_h3_ab.jpg',4,NULL),('SH033199040000','Rav Wilding meets with officers from around the UK as they relive some of their most intense cases. These cases had an impact of entire communities and defined many careers. Plus, witnesses, victims and relatives share their experiences.',NULL,'GBR','British Police: Our Toughest Cases','https://s3.amazonaws.com/schedulesdirect/assets/p17394324_b_h3_aa.jpg',4,NULL),('SH029939730000','This is home to the Monchhichi, fun-loving and big-hearted little creatures that have built their houses in harmony with the Tree. The Monchhichi spend their time having fun, working hard and looking after the Tree.',NULL,'GBR','Monchhichi','https://s3.amazonaws.com/schedulesdirect/assets/p15262196_i_h3_ab.jpg',4,NULL),('SH027759710000','Comedy clip show hosted by Iain Lee. Footage of big tools used by even bigger tools, the hard knock life, and the annual Olymbricks. As always what goes up must come down!',NULL,'GBR','Caught in the Act: Dumb Builders','https://s3.amazonaws.com/schedulesdirect/assets/p14538293_st_h3_aa.jpg',4,NULL),('SH012863380000','Join the team on their foray into sports news, tournaments and competitions across the globe.',NULL,'GBR','TransWorld Sport','https://s3.amazonaws.com/schedulesdirect/assets/p516949_b_h3_aa.jpg',4,NULL),('SH032269450000','Action from the American professional wrestling promotion founded in 2019.',NULL,'GBR','All Elite Wrestling: Dynamite','https://s3.amazonaws.com/schedulesdirect/assets/p16928738_st_h3_aa.jpg',4,NULL),('SH013556670000','Coverage from the top tier of the National League System of non-league football.',NULL,'GBR','National League Football','https://s3.amazonaws.com/schedulesdirect/assets/p8409966_b_h3_ac.jpg',4,NULL),('SH019764290000','Dramatische Liebesgeschichten vor den schönen Kulissen der norwegischen Fjorden.',NULL,'DEU','Liebe am Fjord','https://s3.amazonaws.com/schedulesdirect/assets/p9477774_i_h3_aa.jpg',4,NULL),('SH012972530000','Chamber concert recordings from all over the UK and beyond.',NULL,'GBR','Radio 3 Lunchtime Concert','https://s3.amazonaws.com/schedulesdirect/assets/p302314_i_h3_aa.jpg',4,NULL),('SH019462120000','Die MDR-Wetterfrösche werfen einen Blick auf das aktuelle Wetter und die Aussichten.',NULL,'DEU','Wetter für 3','https://s3.amazonaws.com/schedulesdirect/assets/p10869451_b_h3_ac.jpg',4,NULL),('SH027913340000','Shining a light on the incredible true stories of people who have long sought out lost family members without success, and finally with the help of experts have the chance to reunite with their estranged loved ones.',NULL,'GBR','Long Lost Family','https://s3.amazonaws.com/schedulesdirect/assets/p12863232_i_h3_aa.jpg',4,NULL),('SH017030430000','Das Leben in einer Berliner WG bringt viel Drama mit sich. Liebe, Eifersucht, und Partys stehen für die Bewohner an erster Stelle. Die Charaktere, die zusammentreffen, können unterschiedlicher nicht sein und dennoch leben sie unter einer Decke.',NULL,'DEU','Berlin - Tag & Nacht','https://s3.amazonaws.com/schedulesdirect/assets/p9805853_st_h3_aa.jpg',4,NULL),('SH012911720000','Drunk drivers and car thieves, among other miscreants, are no match for the high-speed police interception units profiled in this documentary series. Officers from a number of law enforcement units dotted around the United Kingdom are shown patrolling their jurisdictions and keeping the streets as safe as possible. Cameras capture intense motorway chases and interactions with suspects, and also lighter moments that give viewers a sense of the officers\' personalities away from their pressure-filled jobs.',NULL,'GBR','Police Interceptors','https://s3.amazonaws.com/schedulesdirect/assets/p8162912_i_h3_aa.jpg',4,NULL),('SH019763560000','`Kunscht!\' ist das wöchentliche Kulturmagazin des SWR Fernsehens: Kabarettist Lars Reichow präsentiert jeden Donnerstag Aktuelles aus dem vielfältigen Kulturgeschehen im Südwesten.',NULL,'DEU','Kunscht!','https://json.schedulesdirect.org/20141201/image/assets/p10986379_i_h3_aa.jpg',4,NULL),('SH012615270000','Simon Templar is the Saint. He robs from the criminally rich and gives to the poor and deserving -- while keeping a nice percentage for himself. His strict moral code makes him target those who got their wealth through nefarious means -- corrupt politicians, warmongers and the like. His criminal activities put him at odds with the law, but his wit, charm and intelligence tend to keep him one step ahead of the police.',NULL,'GBR','The Saint','https://s3.amazonaws.com/schedulesdirect/assets/p184122_i_h3_aa.jpg',4,NULL),('SH017844120000','Der Astrophysiker Harald Lesch widmet sich komplexen wissenschaftlichen Fragen, um die Antworten möglichst verständlich und humorvoll wiederzugeben. Dabei geht er auch auf Bemerkungen seines Kameramannes ein, der manchmal nachhaken muss.',NULL,'DEU','Frag den Lesch','https://json.schedulesdirect.org/20141201/image/assets/p10158783_i_h3_aa.jpg',4,NULL),('SH016398190000','Die wöchentliche Nachrichtensendung wirft einem Blick auf das aktuelle Geschehen in Europa mit Meldungen von Politik, Wirtschaft, Sport und Kultur.',NULL,'DEU','heute - in Europa','https://s3.amazonaws.com/schedulesdirect/assets/p9563644_i_h3_aa.jpg',4,NULL),('SH030044550000','\"Trace of Evil\' explores and reconstructs some of the most interesting and startling criminal cases from the UK, Ireland, the United States and Canada of the past twenty years. Detectives and law enforcers used to rely on a tool-kit consisting of a magnifying glass, a fingerprint dusting kit, and instinct developed from years of experience, in order to crack a case. In contemporary times, the twenty-first century investigator has an arsenal of modern techniques at their disposal. When crime happens, it always leaves a trace, and `Trace of Evil\" takes a closer look without having to resort to the use of a magnifying glass.',NULL,'GBR','Evidence of Evil','https://s3.amazonaws.com/schedulesdirect/assets/p15401610_i_h3_aa.jpg',4,NULL),('SH013133670000','Music and celebrity chat with special guests, music and a host of other features.',NULL,'GBR','Steve Wright in the Afternoon','https://json.schedulesdirect.org/20141201/image/assets/p8238492_i_h3_aa.jpg',4,NULL),('SH028984620000','Dr Dylan Reinhart is a former CIA operative who\'s created a quieter life for himself as a professor and author of a best-selling book on abnormal behaviour. When tenacious and resourceful NYPD detective Lizzie Needham approaches him to help her solve a serial killer case, he taps into his old skill set and reaches out to a CIA friend who has access to invaluable top-secret intelligence. As Dylan gets lured back into the adrenaline-filled world of law enforcement, he and Lizzie realize that, together, they make the perfect team.',NULL,'GBR','Instinct','https://s3.amazonaws.com/schedulesdirect/assets/p14159105_b_h3_aa.jpg',4,NULL),('SH012608630000','\"New Tricks\" dramatises the work of the Unsolved Crime and Open Case Squad, led by Detective Superintendent Sandra Pullman and three previously retired police officers: Gerry Standing, Jack Halford and Brian Lane, whom Pullman recruited to reinvestigate unsolved crimes.',NULL,'GBR','New Tricks','https://s3.amazonaws.com/schedulesdirect/assets/p451597_i_h3_ac.jpg',4,NULL),('SH032380950000','In dieser Dokumentation werden die engagierten Hunderetter der englischen Tierschutzorganisation RSPCA begleitet, die tagtäglich ihr aller Bestes geben, um Hunde aus dramatischen Notsituationen zu befreien.',NULL,'DEU','Die Hunderetter','https://s3.amazonaws.com/schedulesdirect/assets/p10243572_i_h3_ax.jpg',4,NULL),('SH019560590000