hool programme about the adventures of four inquisitive Twirlywoos.',NULL,'GBR','Twirlywoos','https://s3.amazonaws.com/schedulesdirect/assets/p11514407_b_h3_aa.jpg',4,NULL),('SH013900590000','Wayne Carini chases cars for a living. Not literally, but if a vehicle were an iconic Mercedes Gullwing or a luxurious Maserati Ghibli, for instance, and Carini saw it in motion, it\'s a sure bet he would get himself in gear and run after it. That\'s how much this man loves classic cars, a passion that Velocity has captured for this series since 2008. Known as a \"collector car archaeologist\", Carini leads viewers into the business of locating high-end automobiles stashed in homes, garages and barns in the U.S. and abroad. When he finds a gem, Carini negotiates to buy it, then resells at auction or privately. Along the way he talks shop with respected collectors, restorers and artisans.',NULL,'GBR','Chasing Classic Cars','https://s3.amazonaws.com/schedulesdirect/assets/p218841_i_h3_ab.jpg',4,NULL),('SH032213590000','The impact of advertising on American culture from the 1950\'s-1980\'s.',NULL,'GBR','The Real Mad Men of Advertising','https://s3.amazonaws.com/schedulesdirect/assets/p13579097_b_h3_ab.jpg',4,NULL),('SH014054720000','Garage sales are an old-school waste of time, at least in the eyes of the treasure hunters featured in this real-life series. Each half-hour episode follows a group of bidders looking to strike it rich by buying repossessed storage units. They\'re at once detectives and gamblers, as they get only a quick flashlight-aided peek inside the units before they decide if they want to make a bid, and for how much. It\'s a high-stakes game that can pay off big time - one featured collector bought a unit for $800 and sold its contents for a $40,000 profit - or leave one sifting through the equivalent of trash.',NULL,'GBR','Storage Wars','https://s3.amazonaws.com/schedulesdirect/assets/p8354064_i_h3_ab.jpg',4,NULL),('SH019668380000','Eine Reise durch die Zeit zu 