alle wollen Profis werden, manche als Tänzer, andere als Sänger, wieder andere als Schauspieler, Comedians oder Musiker. Doch auch sie sind normale Teenager, die die erste Liebe und Freundschaften erleben.',NULL,'DEU','Spotlight','https://s3.amazonaws.com/schedulesdirect/assets/p13260407_st_h3_aa.jpg',4,NULL),('SH020985130000','Dr. Niklas Ahrend lässt sein Leben in Leipzig hinter sich und wagt einen Neustart als Oberarzt in Erfurt - mit ungeahnten Herausforderungen, neuen Kollegen und alten Freunden, und jeder von ihnen hat seine ganz eigene Geschichte.',NULL,'DEU','In aller Freundschaft - Die jungen Ärzte','https://s3.amazonaws.com/schedulesdirect/assets/p11390058_i_h3_aa.jpg',4,NULL),('SH019370400000','Im Jahr 2030 entscheidet Ted Mosby sich, seinen Kindern Penny und Luke in allen Details zu erzählen, wie er ihre Mutter kennengelernt hat. Sein Rückblick beginnt im Jahr 2005, als er als 27-Jähriger gerade sein Architekturstudium abgeschlossen hat. Er lebt zusammen mit seinem besten Freund Marshall, der seit neun Jahren mit der Kindergärtnerin Lily liiert ist. Die Drei sind außerdem mit dem notorischen aber liebenswerten Frauenheld und Anzugträger Barney Stinson befreundet, der Ted dabei helfen soll, die Frau seines Lebens zu finden. Durch Barney lernen die Freunde Robin Scherbatsky kennenlernen, in die Ted sich sofort verliebt. Aber das Schicksal scheint es nicht gut mit ihm zu meinen, denn Robin will keine feste Beziehung.',NULL,'DEU','How I Met Your Mother','https://s3.amazonaws.com/schedulesdirect/assets/p185124_l_h3_aa.jpg',4,NULL),('SH024083840000','Elena Uhlig bereist die Regionen Deutschlands und sucht nach lokalen Küchenchefs, die sich ein Duell mit Johann Lafer oder Nelson Müller liefern. Dabei müssen die Promiköche Spezialitäten erschmecken und nachkochen.',NULL,'DEU','Stadt, Land, Lecker','https://s3.amazonaws.com/schedulesdirect/assets/p12794756_b_h3_aa.jpg',4,NULL),('SH019138540000','Der kleine Angelo ist gerne mit seinen Freunden unterwegs. Sie treffen sich und kreieren die besten Strategien, um gegen ihre Rivalen antreten zu können. Nicht immer klappt es, doch die Kids haben dennoch jede Menge Spaß.',NULL,'DEU','Angelo!','https://s3.amazonaws.com/schedulesdirect/assets/p8180581_i_h3_aa.jpg',4,NULL),('SH015933320000','Geschichten aus dem Arbeitsalltag des 21. Hamburger Polizeikommissariats unter der Leitung von Polizeioberrat Martin Berger und des mit diesem eng kooperierenden Elbkrankenhauses, in welchem Bergers Nichte Jasmin Jonas sich um die Patienten kümmert.',NULL,'DEU','Notruf Hafenkante','https://s3.amazonaws.com/schedulesdirect/assets/p9370356_i_h3_aa.jpg',4,NULL),('SH019383930000','Eric Miller erkrankt auf einmal und wird ins Krankenhaus eingeliefert, wo er kurz darauf stirbt. Die Ursache lautet Gift; Megan fährt nach einer Feier mit dem Auto nach Hause, als auf ihren Wagen geschossen wird. Seit dem fehlt von Megan jede Spur.',NULL,'DEU','Medical Detectives - Geheimnisse der Gerichtsmedizin','https://s3.amazonaws.com/schedulesdirect/assets/p439881_b_h3_ag.jpg',4,NULL),('SH016398180000','Nachrichten aus den Bundesländern mit Themen aus der Politik, Wirtschaft und Gesellschaft.',NULL,'DEU','heute - in deutschland','https://s3.amazonaws.com/schedulesdirect/assets/p9563640_b_h3_ab.jpg',4,NULL),('SH019646620000','Schatztaucher aus aller Welt begeben sich jedes Jahr auf Goldsuche in der Berginsee. Die Goldvorkommen wurden über Millionen Jahre vom Schmelzwasser der Gletscher angeschwemmt. Die Suche ist nur mit schwerem Gerät möglich, und nicht ungefährlich.',NULL,'DEU','Die Schatzsucher - Goldtaucher der Beringsee','https://json.schedulesdirect.org/20141201/image/assets/p8963906_i_h3_ab.jpg',4,NULL),('SH018310520000','An all-star cast of gardening experts present this programme in which they try to fight overdevelopment and return Britain back to a nation filled with people with green thumbs. Each episode features two presenters focusing on endangered aspects of gardening and offering advice on how viewers can improve the look of their gardens. With paved surfaces taking over greenspace, \"Great British Garden Revival\' wants to get people to re-engage with their gardens and Britain\"s strong horticultural heritage. The list of presenters includes Monty Don, Rachel de Thame, Charlie Dimmock, Christine Walkden and Matt James.',NULL,'GBR','Great British Garden Revival','https://s3.amazonaws.com/schedulesdirect/assets/p10364399_b_h3_aa.jpg',4,NULL),('SH019569760000','Jake und seine Freunde Izzy, Cubby und der Papagei Skully leben auf einer Insel nahe bei Nimmerland. Die Kinder sind dem berüchtigten Captain Hook ein Dorn im Auge und er versucht alles, um ihnen das Leben so schwer wie möglich zu machen, wie etwa ihre Sachen zu stehlen. Um ein Abenteuer abzuschließen, müssen Jake und seine Freunde stets drei Aufgaben lösen, nach deren Erfüllung sie Golddublonen bekommen, die sie am Ende in ihre Teamschatztruhe legen.',NULL,'DEU','Jake und die Nimmerland Piraten','https://s3.amazonaws.com/schedulesdirect/assets/p8492050_i_h3_ab.jpg',4,NULL),('SH017065120000','The men\'s strongman Champions League from Martinique.',NULL,'GBR','Champions League Strongest Man','https://s3.amazonaws.com/schedulesdirect/assets/p9821519_b_h3_aa.jpg',4,NULL),('SH030218130000','Die Therapeuten und Sozialarbeiter der Klinik am Südring unterstützen Patienten, die Verhaltensauffälligkeiten zeigen oder sonstige emotionale Herausforderungen zu bewältigen haben. Außerdem stehen sie den betroffenen Familien zur Seite.',NULL,'DEU','Klinik am Südring - Die Familienhelfer','https://s3.amazonaws.com/schedulesdirect/assets/p15791050_i_h3_ae.jpg',4,NULL),('SH016821990000','Kirstie Allsopp shows how easy it is to hand make things for the home and people in our lives.',NULL,'GBR','Kirstie\'s Vintage Gems','https://s3.amazonaws.com/schedulesdirect/assets/p9715686_b_h3_aa.jpg',4,NULL),('SH032099730000','Revisiting the British people who swapped the UK for new ventures in Spain and France.',NULL,'GBR','A New Life in the Sun: Where Are They Now?','https://s3.amazonaws.com/schedulesdirect/assets/p16829499_st_h3_aa.jpg',4,NULL),('SH034422980000','Der blinde ehemalige Chefinspektor Alexander Haller geht gemeinsam mit seinem Privatchauffeur und engstem Vertrauen Nikolai Falk auf die Spuren des Verbrechens. Unter anderem müssen sie sich mit Entführungen und Mord herumschlagen.',NULL,'DEU','Blind ermittelt','https://s3.amazonaws.com/schedulesdirect/assets/p17971571_st_h3_aa.jpg',4,NULL),('SH015402360000','Die Reportage- und Dokumentationsreihe zeigt unerforschte Gebiete, reist zu unentdeckten Traumzielen auf der ganzen Welt, und besucht fremde Völker, um über ihre Kultur und ihre Bräuche zu berichten.',NULL,'DEU','Länder - Menschen - Abenteuer','https://s3.amazonaws.com/schedulesdirect/assets/p9125881_i_h3_aa.jpg',4,NULL),('SH003332650000','Das Nachtjournal zeigt zu später Stunde noch umfassende Nachrichten des Tages aus Deutschland und der Welt. Mit den aktuellsten Ereignissen aus der Politik, Wirtschaft und Kultur können sich die Zuschauer nachts noch auf dem Laufenden halten. Das Markenzeichen des Magazins umfasst Fakten, Hintergrundberichterstattungen sowie Meinungen zu den aktuellen globalen sowie regionalen Themen. Mit der Rubrik `100 Tage danach\' greift die Sendung schlagzeilenträchtige Ereignisse aus der Vergangenheit auf, zeigt deren Folgen und Entwicklungen und fragt nach den Konsequenzen.',NULL,'DEU','RTL-Nachtjournal','https://s3.amazonaws.com/schedulesdirect/assets/p472490_b_h3_aa.jpg',4,NULL),('SH013659580000','\"Hoarders\' is an often painful look inside a disease that can bury its sufferer - literally at times - in its symptoms. Each hourlong episode profiles two people on the verge of a personal crisis, all caused by the fact that they are unable to part with even the tiniest possessions, and the cumulative effect becomes a mountain of junk and garbage overtaking their home or apartment. If they don\"t respond to professional help, the consequences sometimes involve eviction, kids being taken away, or even jail time.',NULL,'GBR','Hoarders','https://s3.amazonaws.com/schedulesdirect/assets/p3536666_l_h3_aa.jpg',4,NULL),('SH019461950000','Magazin mit Schlagzeilen aus der Region, interessanten Gästen im Studio und Verbrauchertipps. Die Moderatoren berichten über alles, was in Sachsen, Sachsen-Anhalt und Thüringen für Schlagzeilen sorgt und informieren über Aktuelles.',NULL,'DEU','MDR um 4: Neues von hier','https://s3.amazonaws.com/schedulesdirect/assets/p10869377_i_h3_aa.jpg',4,NULL),('SH017357350000','The breathtaking beauty of Alaska sometimes hides the fact its winters can be incredibly harsh, especially for those who live in the state\'s outlying areas. \"Alaska: The Last Frontier\' perfectly illustrates this reality, as the programme profiles life for the Kilcher family in the isolated community of Homer. For four generations the Kilchers have lived off what their 600-acre homestead has provided, but cultivating that living is never easy. Led by patriarch Atz Kilcher and his brother Otto, the family spends the short summer and fall gardening, hunting and fishing for food, gathering supplies from the land and preparing their animals for the winter. Viewers, who may or may not have a fancy phone by their side while watching on their big-screen high-def TV, also see the Kilchers living off the grid, where running water and electricity aren\"t daily staples, nor is contact with the outside world. Atz, by the way, is the father of music superstar Jewel, who does not appear on the show.',NULL,'GBR','Alaska: The Last Frontier','https://s3.amazonaws.com/schedulesdirect/assets/p8989001_l_h3_aa.jpg',4,NULL),('SH026358110000','Im Jahr 2275 führt Dante Montana ein Team von Kopfgeldjägern an, die im Universum Jagd auf Verbrecher machen. Dazu müssen sie verhindern, dass das `Divinity Cluster\' in falsche Hände gerät. Doch Dante verfolgt noch ein privates Ziel.',NULL,'DEU','Starhunter','https://s3.amazonaws.com/schedulesdirect/assets/p493717_st_h3_aa.jpg',4,NULL),('SH033344700000','Exploring the design, construction, technology and armaments of history\'s great vessels of war and peace, from ancient Viking ships to modern aircraft carriers.',NULL,'GBR','The Great Ships','https://s3.amazonaws.com/schedulesdirect/assets/p299413_i_h3_aa.jpg',4,NULL),('SH034135610000','Übertragungen von aktuellen Wettbewerben aus der Welt des Radsports.',NULL,'DEU','Bahnradsport','https://s3.amazonaws.com/schedulesdirect/assets/p361948_i_h3_ab.jpg',4,NULL),('SH029227230000','Der ehemalige Staatsanwalt Eduardo arbeitet von einem Hotel, in dem er wohnt, als Pflichtverteidiger. Er stellt den gesunden Menschenverstand über das Gesetz. Seine Assistentin Marcia, eine Roma, hat immer wieder mit Diskriminierung zu kämpfen.',NULL,'DEU','Der Lissabon-Krimi','https://s3.amazonaws.com/schedulesdirect/assets/p15282411_st_h3_aa.jpg',4,NULL),('SH028204940000','Musiksendung.',NULL,'DEU','MTV Most Wanted','https://s3.amazonaws.com/schedulesdirect/assets/p14809119_st_h3_aa.jpg',4,NULL),('SH015402790000','Die Sendung informiert über ein breites Themenspektrum, angefangen bei den großen aktuellen Themen bis hin zu alltäglichen wirtschaftlichen Ereignissen. Dabei werden die Vorgänge aus der Perspektive des Normalbürgers und Verbrauchers gezeigt. Zusätzlich liefert die Sendung vertiefende Information über alle wirtschafts- und sozialpolitische Fragen der Zuschauer. Dabei handelt es sich um klassische Magazinbeiträge, investigative Recherchen, Tests, Tipps sowie Hinweise, wie sich aufgezeigte Probleme vermeiden lassen.',NULL,'DEU','Plusminus','https://s3.amazonaws.com/schedulesdirect/assets/p9126080_b_h3_aa.jpg',4,NULL),('SH018147800000','Ree Drummond shares her secrets of home cooking and celebrating.',NULL,'GBR','The Pioneer Woman','https://s3.amazonaws.com/schedulesdirect/assets/p12567627_b_h3_aa.jpg',4,NULL),('SH028810230000','The upbeat adventures of Poppy, Branch and the rest of the residents of Troll Village, as they keep the party going in 