heir families. The all-star edition of the programme pits two celebrities, joined by members of their families, battling head-to-head for a chance to win £30,000 for charity. During the game, the players try to match the most popular answers given by 100 people who were asked the same question. The family with the most money at the end of the game goes on to play the Big Money bonus round, in which they can win £10,000 for their chosen charity by two of the family members getting 200 points in five questions. If they pass the 200-point mark and provide the top answer to all five questions, the charity wins the top prize of £30,000.',NULL,'GBR','All Star Family Fortunes','https://s3.amazonaws.com/schedulesdirect/assets/p8204962_b_h3_aa.jpg',4,NULL),('SH019719720000','Die spannende Jagd der Medizin nach Beweisen für die Ursache von rätselhaften Beschwerden.',NULL,'DEU','Abenteuer Diagnose','https://s3.amazonaws.com/schedulesdirect/assets/p10969205_b_h3_aa.jpg',4,NULL),('SH020815760000','\"Air Ambulance ER\" follows British medical teams as they take to the air in emergency situations. The series goes behind the scenes to show ambulances carrying out their life-saving work from the minute an accident is reported to the moment they reach their patient. The fast-paced action and aerial filming capture the courage of the team members that are on-call throughout the UK.',NULL,'GBR','Air Ambulance ER','https://s3.amazonaws.com/schedulesdirect/assets/p11343891_i_h3_aa.jpg',4,NULL),('SH012907380000','\"Tonight\" offers national and international news, interviews with celebrities and policymakers as well as in-depth reporting on a variety of topics.',NULL,'GBR','Tonight','https://s3.amazonaws.com/schedulesdirect/assets/p8161575_b_h3_ab.jpg',4,NULL),('SH017610890000','Pirate-themed physical gameshow where a team swashbucklers win jewels for their treasure chest.',NULL,'GBR','Swashbuckle','https://s3.amazonaws.com/schedulesdirect/assets/p10062931_i_h3_aa.jpg',4,NULL),('SH020412230000','Father Brown wird leicht unterschätzt. Als Römisch-Katholischer Priester ist er im anglikanischen England eine Seltenheit. Er verrichtet seinen Dienst in der St. Mary\'s Church in Kembleford in den frühen 1950er Jahren.',NULL,'DEU','Father Brown','https://s3.amazonaws.com/schedulesdirect/assets/p12420801_i_h3_aa.jpg',4,NULL),('SH021893680000','Join Vic The Viking and friends on his adventures.',NULL,'GBR','Vic the Viking','https://s3.amazonaws.com/schedulesdirect/assets/p10715007_i_h3_aa.jpg',4,NULL),('SH016300950000','When presumed-dead billionaire playboy Oliver Queen returns home to Starling City after five years stranded on a remote island in the Pacific, he hides the changes the experience had on him, while secretly seeking reconciliation with his ex, Laurel. By day he picks up where he left off, playing the carefree philanderer he used to be, but at night he dons the alter ego of Arrow and works to right the wrongs of his family and restore the city to its former glory. Complicating his mission is Laurel\'s father, Detective Quentin Lance, who is determined to put the vigilante behind bars.',NULL,'GBR','Arrow','https://s3.amazonaws.com/schedulesdirect/assets/p9263605_l_h3_aa.jpg',4,NULL),('SH012588680000','Presented by Dara Ó Briain and Hugh Dennis, \"Mock the Week\' is a comedy programme that combines the best elements of panel show, stand-up and improvised games with two teams of comedians taking a satirical swipe at the news and world events. Regular game rounds include `Wheel of News\', where panellists are tasked with performing a stand-up bit on a randomly generated news segment, and `Picture of the Week\", where panellists are shown an image to discuss and joke about. Ó Briain is joined by permanent and guest panellists, including the likes of Andy Parsons, Frankie Boyle, Ed Byrne, Milton Jones, Josh Widdicombe and many, many more.',NULL,'GBR','Mock the Week','https://s3.amazonaws.com/schedulesdirect/assets/p8096898_l_h3_ab.jpg',4,NULL),('SH0188