st they would be, if Sam could stop being so distracted.',NULL,'GBR','Sam Simmons Is Not a People Person','https://s3.amazonaws.com/schedulesdirect/assets/p13565496_st_h3_aa.jpg',4,NULL),('SH030403860000','Die Sendung berichtet über Themen aus den Bereichen Wissenschaft, Technik und Mensch. Auf unterschiedliche Fragen wird versucht, Antworten zu finden und diese auf unkomplizierte und leicht verständliche Weise zu vermitteln.',NULL,'DEU','Abenteuer Leben','https://s3.amazonaws.com/schedulesdirect/assets/p10903651_st_h3_ae.jpg',4,NULL),('SH016076680000','Highlights of proceedings in Parliament.',NULL,'GBR','Thursday in Parliament','https://s3.amazonaws.com/schedulesdirect/assets/p9433305_b_h3_aa.jpg',4,NULL),('SH028586800000','Immer wenn ihr Besitzer Bob das Haus verlässt, haben die Welpen Bingo und Rolly jede Menge Spaß. Bingo bestimmt dabei immer, wohin es geht. Ihre Katzenschwester Hissy leistet den beiden Gesellschaft auf ihren Abenteuern.',NULL,'DEU','Welpen Freunde','https://s3.amazonaws.com/schedulesdirect/assets/p13949191_i_h3_aa.jpg',4,NULL),('SH026118500000','Professor David Rothkopf charts the rapid and radical transformation of modern international diplomacy.',NULL,'GBR','Friends & Foes: A Narrative History of Diplomacy','https://s3.amazonaws.com/schedulesdirect/assets/p13764050_st_h3_aa.jpg',4,NULL),('SH033109840000','In Anlehnung an den gleichnamigen Küchenblog wird in dieser Sendung alles präsentiert, was die Küchenarbeit erleichtert. Dazu zählen zum Beispiel praktische Aufbewahrungsmöglichkeiten, funktionale Küchenhelfer und erstklassiges Kochgeschirr.',NULL,'DEU','Lieblingsküche','https://s3.amazonaws.com/schedulesdirect/assets/p17360323_st_h3_aa.jpg',4,NULL),('SH027671680000','In the PINY Institute books don\'t exist. You learn through singing, dancing and painting.',NULL,'GBR','PINY Institute of New York','https://s3.amazonaws.com/schedulesdirect/assets/p13266584_i_h3_aa.jpg',4,NULL),('SH021393670000','\"Bumblebee\' is given a mission to Earth by a