ay not stand up against the forensic techniques of today. As they delve into the details of the evidence and trial, a living relative of the convicted person finds out more about their ancestor\'s life and story, discovering who they were and what might have led them to commit their crime. If Sasha and Jeremy believe they have a strong enough case, they present it to a senior Crown Court judge for the final verdict on whether the original conviction should be upheld, or if perhaps there was a miscarriage of justice.',NULL,'GBR','Murder, Mystery and My Family','https://json.schedulesdirect.org/20141201/image/assets/p15177970_i_h3_aa.jpg',4,NULL),('SH016610660000','Following the colourful personalities who make a living buying items at auctions is a favourite subject of TV producers. \"Baggage Battles\', essentially a replica of A&E Network\'s `Storage Wars\' minus the storage units, depicts the process of `auction specialists\' bidding for, buying and reselling property found in unclaimed luggage. It features three teams of bidders: Laurence and Sally Martin, who have appeared on `Storage Wars\' appraising items in their California antiques store; young entrepreneur Mark Meyer, who owns a Long Island, NY, thrift store; and Billy Leroy, the proprietor of Billy\"s Antiques and Props, a famous eclectic prop and antique store in the Bowery neighbourhood of Manhattan.',NULL,'GBR','Baggage Battles','https://s3.amazonaws.com/schedulesdirect/assets/p8967410_i_h3_aa.jpg',4,NULL),('SH016993350000','Exploring five of Britain\'s most extreme winter landscapes.',NULL,'GBR','The Great British Winter','https://s3.amazonaws.com/schedulesdirect/assets/p9788584_st_h3_aa.jpg',4,NULL),('SH027026640000','A brother and sister explore their neighbourhood and stumble into outlandish situations.',NULL,'GBR','The Bagel and Becky Show','https://s3.amazonaws.com/schedulesdirect/assets/p13730042_b_h3_aa.jpg',4,NULL),('SH012740720000','A group locks itself into a haunted location for 24 hours in 