in mit Themen aus den Bereichen Wirtschaft, Soziales und Politik.',NULL,'DEU','Umschau','https://json.schedulesdirect.org/20141201/image/assets/p10944709_i_h3_aa.jpg',4,NULL),('SH022564860000','A series that provides a glimpse into the minds of serial killers and what drove them to commit their crimes.',NULL,'GBR','Inside The Mind Of a Serial Killer','https://json.schedulesdirect.org/20141201/image/assets/p12080851_i_h3_aa.jpg',4,NULL),('SH029081550000','The motherhood of TV personalities Sam and Billie Faiers as they allow cameras into their homes to provide an inside and intimate look at their every day lives. The mums share the challenges they face along with their adorable families.',NULL,'GBR','Sam and Billie Faiers: The Mummy Diaries','https://s3.amazonaws.com/schedulesdirect/assets/p15203552_b_h3_aa.jpg',4,NULL),('SH012615430000','Viewers around the UK send in their home videos of friends, family and pets doing amusing or embarrassing things. Comedian Harry Hill narrates.',NULL,'GBR','You\'ve Been Framed!','https://s3.amazonaws.com/schedulesdirect/assets/p316744_l_h3_aa.jpg',4,NULL),('SH013234960000','Topical mix of entertainment, discussion and showbiz glamour as well as the latest fashion and more.',NULL,'GBR','Lorraine','https://s3.amazonaws.com/schedulesdirect/assets/p432180_b_h3_ac.jpg',4,NULL),('SH014822530000','Justin entertains a live audience of children with singing, dancing and comedy chaos.',NULL,'GBR','Justin\'s House','https://s3.amazonaws.com/schedulesdirect/assets/p8873313_i_h3_aa.jpg',4,NULL),('SH017560170000','The Robinson family was supposed to set off on a five-year mission to explore a distant planet, but an act of sabotage by the scheming Dr Zachary Smith - who managed to get himself trapped aboard the spaceship - leaves them adrift in space for three years. The Robinsons, pilot Don West, Dr Smith and their trusty robot move from planet to planet, always searching for a way to return to Earth.',NULL,'GBR','Lost in Space','https://s3.amazonaws.com/schedulesdirect/assets/p183883_l_h3_aa.jpg',4,NULL),('SH020364790000','Exzentrische Schauspieler, ein selbstverliebter Show-Star und ein neuer Produzent, der überall mitmischt: Diese Dinge gehören zum Arbeitsalltag von Liz Lemon, der Drehbuchautorin der Comedy-Sendung `The Girlie Show\'. Dabei kommt sich die Mitdreißigerin regelmäßig mit ihrem Vorgesetzten Jack Donaghy in die Haare. Donaghy ist sehr daran interessiert, das TV-Format umzustrukturieren. Als er den aufgedrehten Tracy Jordan mit ins Boot holt, wird die Sendung in `TGS with Tracy Jordan\' umbenannt. Wenngleich sich Liz und Jack häufig streiten, entsteht zwischen ihnen eine tiefe Freundschaft.',NULL,'DEU','30 Rock','https://json.schedulesdirect.org/20141201/image/assets/p185203_l_h3_aa.jpg',4,NULL),('SH019973300000','Die interaktive Fernsehsendung, bei der die Zuschauer via Chat während der Live-Sendung Fragen an die Gäste im Studio gestellt werden können.',NULL,'DEU','heute+','https://s3.amazonaws.com/schedulesdirect/assets/p11066742_i_h3_aa.jpg',4,NULL),('SH014905920000','As owner of one of the largest decorative salvage yards in the United Kingdom - Fabulously British Salvage - Drew Pritchard is always looking for new pieces to replenish his shop, and he has no problem scouring the countryside to find them. This series follows Drew all over the country, including some privileged estates, as he hunts for old and forgotten pieces of history. But finding them is only part of the business; Drew must then convince the owner of each item to sell it to him at a fair price, then it\'s off to the salvage yard, where his team restores it to its original shine before it can be sold for profit.',NULL,'GBR','Salvage Hunters','https://s3.amazonaws.com/schedulesdirect/assets/p8907649_b_h3_ab.jpg',4,NULL),('SH030334500000','Judith Rakers stellt verschiedene Inseln vor.',NULL,'DEU','Inselreportagen mit Judith Rakers','https://s3.amazonaws.com/schedulesdirect/assets/p15847553_b_h3_aa.jpg',4,NULL),('SH018456820