rs work together as a team to answer general knowledge questions on this quiz show. Their opponent? The Chaser, a ruthless quiz genius tasked with stopping the contestants from winning money, potentially thousands of pounds. The contestants take turns answering quick-fire questions in a set length of time in order to build up the team\'s pot. Each contestant then goes one-on-one against The Chaser. The Chaser follows the contestant down a game board. If the contestant gets out without being caught, the money he or she earned is added to the team\'s pot. If a contestant is caught (by answering questions incorrectly), the contestant is out of the game and no money is added to the team\'s pot. The final round features the remaining contestants in another quick-fire round in which each correct answer gets them closer to the finish line. If The Chaser catches all the contestants, they leave with nothing. If any contestants remain at the end of the game, they split the team\'s money.',NULL,'GBR','The Chase','https://s3.amazonaws.com/schedulesdirect/assets/p8158525_i_h3_aa.jpg',4,NULL),('SH018417910000','Alaska is a popular destination for reality show producers. The state\'s mostly rugged living conditions combined with residents who embrace a pioneering way of life present ready-made story lines. \"Railroad Alaska\' is a perfect example. It follows, according to Destination America, an `elite crew of workers who battle against ferocious weather and treacherous terrain to keep the state\'s critical 650-mile long railroad rolling to deliver life-sustaining supplies\'. The characters - brakemen, engineers, construction crews, mechanics and train drivers - risk their lives doing such tasks as setting off controlled avalanches to prevent catastrophes, because if one occurs that renders tracks impassable, locals won\"t get food, fuel or even home. Viewers also meet fascinating people who live off-grid, and find out why they chose a fully independent life away from civilization