a\'s longest-running drama series follows the lives of the residents of Ramsay Street, a six-house cul-de-sac in the fictitious Melbourne suburb of Erinsborough.',NULL,'GBR','Neighbours','https://s3.amazonaws.com/schedulesdirect/assets/p450934_b_h3_af.jpg',4,NULL),('SH013207650000','Most quiz shows test contestants\' knowledge of important topics like history, geography and literature with the winning contestant being the one who scores the most points. \"Pointless\' isn\"t most quiz shows. Contestants try to score as few points as possible while racking their brains trying to come up with answers no one else can think of for general-knowledge questions. The contestants are asked the same questions that were previously asked of surveyed individuals with the goal of giving the correct answers that were given least frequently by the people surveyed. If a contestant provides a correct answer that was not said by anyone in the survey, known as a pointless answer, he gets no points and money is added to the jackpot, which is the grand prize a contestant can win for giving a correct pointless answer in the final round. The jackpot starts at £1,000 and keeps growing each episode until someone wins it, at which point it is reset to the original £1,000.',NULL,'GBR','Pointless','https://s3.amazonaws.com/schedulesdirect/assets/p8269893_i_h3_ab.jpg',4,NULL),('SH013342990000','James Walton takes the chair for the game of literary correctness.',NULL,'GBR','The Write Stuff','https://s3.amazonaws.com/schedulesdirect/assets/p304490_st_h3_aa.jpg',4,NULL),('SH025829010000','The NHS is facing its greatest crisis since it began, with more A&E admissions than hospitals can handle. Afforded extensive behind the scenes access, this documentary series goes inside some of the biggest and busiest NHS Trusts around the country, to show the public the true realities of the British healthcare system. Each episode delves into the lives of the patients, and the show also gives viewers a unique look into the complex decisions made by hard-working medical professionals every day.',NULL,'GBR','Hospital','https://s3.amazonaws.com/schedulesdirect/assets/p13618443_b_h3_aa.jpg',4,NULL),('SH030266790000','Nick Groff and Katrina Weidman spend 72 hours confined in the UK\'s most notorious haunted hotspots.',NULL,'GBR','Paranormal Lockdown UK','https://s3.amazonaws.com/schedulesdirect/assets/p15815183_b_h3_aa.jpg',4,NULL),('SH017730140000','\"Dallas Car Sharks\" follows all the drama and action at an auto auction in Texas. Enthusiasts around the country gather to participate in car-flipping and to bid against one another for the chance to score some incredible vehicles. In each episode, tempers and rivalries ignite as the thrill of the bid takes over, fuelling each buyer to outbid and outbuy competitors. The real work begins after they win when they discover what\'s really under the hood and just how good their skills are.',NULL,'GBR','Dallas Car Sharks','https://s3.amazonaws.com/schedulesdirect/assets/p9992277_l_h3_aa.jpg',4,NULL),('SH019570090000','M*A*S*H ist ein Feldlazarett der US Army. Dort leistet ein bunt zusammengewürfelter Haufen seinen Dienst im Korea-Krieg 1950. Unter diesen Umständen erlebt Captain Pierce und sein Team einen wahnsinnigen Alltag.',NULL,'DEU','M*A*S*H','https://s3.amazonaws.com/schedulesdirect/assets/p183880_l_h3_aa.jpg',4,NULL),('SH027581960000','Aus dem Nachrichtenstudio wird über aktuelle Ereignisse aus Deutschland und der Welt informiert.',NULL,'DEU','Nachrichten','https://s3.amazonaws.com/schedulesdirect/assets/p14454310_st_h3_aa.jpg',4,NULL),('SH030682620000','Jeden Nachmittag, wenn der Zoo schließt, machen auch Zacki, das australische Frischwasserkrokodil, und seine Freunde Feierabend. Sie öffnen heimlich ihre Käfige und nehmen das Zoo-Mobil in Richtung Heimat, wo sie viele Abenteuer erleben.',NULL,'DEU','Zacki und die Zoobande','https://s3.amazonaws.com/schedulesdirect/assets/p14471392_i_h3_aa.jpg',4,NULL),('SH018771240000','Follows 