urant Carlas sowie das Mietshaus Rosenhaus. Inmitten des Geschehens steht immer eine Frau mit einer Vision und dem aufrichtigen Wunsch nach einem glücklichen Leben.',NULL,'DEU','Rote Rosen','https://s3.amazonaws.com/schedulesdirect/assets/p8832396_b_h3_ab.jpg',4,NULL),('SH025353820000','In dieser Sendung dreht sich alles ums Essen, um Ernährung und den damit verbundenen Genuss. Jede Folge widmet sich einem anderen Thema, zum Beispiel welche Speisen weltweit am beliebtesten sind oder welche Extreme erreicht werden.',NULL,'DEU','Top Ten! Der Geschmacks-Countdown','https://s3.amazonaws.com/schedulesdirect/assets/p13401823_st_h3_aa.jpg',4,NULL),('SH013028080000','Coverage of select committee proceedings.',NULL,'GBR','Select Committees','https://s3.amazonaws.com/schedulesdirect/assets/p484254_b_h3_aa.jpg',4,NULL),('SH019379490000','Die Familie Griffin lebt in der Kleinstadt Quahog auf Rhode Island. Angeführt wird der ganz normale amerikanische Haushalt von Peter und Lois, den Eltern von drei Kindern: Chris, Meg und Stewie. Außerdem haben sie einen sprechenden Hund, Brian, der in Wahrheit das Oberhaupt der Familie ist. Mit derbem und politisch unkorrektem Humor, Musical-Einlagen und Parodien stolpern die Mitglieder der Familie von einem Missgeschick ins nächste. Louis versucht, ganz im Sinne einer fürsorglichen Mutter, die Fehler ihres Mannes auszubügeln. Meg steckt mitten in der Pubertät und Chris ist eine nicht allzu intelligente künstlerische Seele - ganz im Gegenteil zu Baby Stewie, der hochintelligent und böse zugleich ist. Nur der Hund Brian schafft es tatsächlich, das Chaos zu überblicken und einen kühlen Kopf zu bewahren.',NULL,'DEU','Family Guy','https://s3.amazonaws.com/schedulesdirect/assets/p184483_i_h3_ab.jpg',4,NULL),('SH024029960000','Gark, a nine-year-old alien, believes that Max, a house cat, must train him to save the universe.',NULL,'GBR','Counterfeit Cat','https://s3.amazonaws.com/schedulesdirect/assets/p12752609_i_h3_aa.jpg',4,NULL),('SH019658810000',