.jpg',4,NULL),('SH013321720000','\"Catchphrase\' is the STV Productions reboot of the similarly named show presented by Roy Walker and Nick Weir. In this game show, presented by Stephen Mulhern, contestants try to identify familiar catchphrases based on computer animations - usually featuring the show\"s animated mascot, Mr Chips - shown on an on-stage screen. The animation is initially covered by nine squares, which are taken away one at a time to slowly reveal the cartoon. Several puzzles are played to determine the winner, who advances to the bonus round for a chance to win a cash prize.',NULL,'GBR','Catchphrase','https://s3.amazonaws.com/schedulesdirect/assets/p350044_i_h3_ab.jpg',4,NULL),('SH019962420000','Der New Yorker Polizist Theodoros Kojak erledigt seine Fälle so, wie er es für richtig hält. Mit zynischem Humor spürt der glatzköpfige Grieche die Schlupfwinkel dunkler Elemente selbst auf Partys der High Society auf.',NULL,'DEU','Kojak - Einsatz in Manhattan','https://s3.amazonaws.com/schedulesdirect/assets/p184158_i_h3_aa.jpg',4,NULL),('SH033080130000','Owen Grady and Claire Dearing work together to deal with the running of one of the most incredible theme parks ever made - Jurassic World.',NULL,'GBR','Jurassic World: The Legend of Isla Nublar','https://s3.amazonaws.com/schedulesdirect/assets/p17039832_i_h3_aa.jpg',4,NULL),('SH020063520000','Einmal im Monat präsentiert das Sportmagazin Athleten hautnah - im Training, im Wettkampf, aber auch von ihrer privaten Seite. Die Reporter sind dabei, wenn sich die Athleten auf ihre nächsten Wettkämpfe vorbereiten und den Ausgleich zu Hause suchen.',NULL,'DEU','Vision Gold','https://s3.amazonaws.com/schedulesdirect/assets/p11092345_st_h3_aa.jpg',4,NULL),('SH021903090000','Wer hat die Brille erfunden? Woher kommt die Brez\'n? Oder: Warum heißt die Sternschnuppe Sternschnuppe? Diese oder ähnliche Fragen stellt Willi den zwei Schulklassen aus zwei Städten in seinem unterhaltsamen Quiz-Quark-Club.',NULL,'DEU','Willis Qui