Father, Dear Father','https://s3.amazonaws.com/schedulesdirect/assets/p17196638_st_h3_aa.jpg',4,NULL),('SH030596860000','Stand-up series exploring British Chinese culture, from BBC New Comedy Award finalist Ken Cheng.',NULL,'GBR','Ken Cheng: Chinese Comedian','https://s3.amazonaws.com/schedulesdirect/assets/p15992118_b_h3_aa.jpg',4,NULL),('SH024882830000','Am 11. November 1918 endete der Erste Weltkrieg - ein Krieg, der zehn Millionen Soldaten und neun Millionen Zivilisten das Leben kostete. Die Dokumentation arbeitet die Geschehnisse auf, die ganze Königreiche zerstörten.',NULL,'DEU','Apokalypse - Der Erste Weltkrieg','https://s3.amazonaws.com/schedulesdirect/assets/p11237279_i_h3_aa.jpg',4,NULL),('SH014249520000','Here today, gone tomorrow. Thousands of people go missing in the United States each year, leaving behind only a mystery without any clues. Their stories are told in \"Disappeared\' through the voices of family, friends and investigators trying to solve the case, with each hourlong episode recounting the final stages that led to a person\"s disappearance. Interviews with experts including psychologists and forensic specialists provide new insights into what may have happened - whether foul play was involved or the subject simply ran away.',NULL,'GBR','Disappeared','https://s3.amazonaws.com/schedulesdirect/assets/p7946707_l_h3_aa.jpg',4,NULL),('SH026953270000','Die Serie `Airport Security: Colombia\' begleitet die Sicherheitskräfte bei ihrem Kampf gegen Drogenschmuggel, Menschenhandel und mehr. Der El Dorado-Flughafen in der kolumbianischen Hauptstadt gehört zu den wichtigsten Drehkreuzen Lateinamerikas.',NULL,'DEU','Drehkreuz des Drogenschmuggels - Flughafen Kolumbien','https://s3.amazonaws.com/schedulesdirect/assets/p11930197_i_h3_am.jpg',4,NULL),('SH018895050000','Mehrere Gegenstände. verschwinden im Aushalt. Tom und Jerry versuchen, den Dieb zu schnappen.; Toms verfasster Krimi scheint real zu werden.; Bei Toms Jagd nach Jerry, flüchtet dieser ins Natu