eras have been allowed behind bars to give a rare insight into life behind the bars of Durham Prison and explore the issues that prison staff and prisoners face.',NULL,'GBR','Prison','https://s3.amazonaws.com/schedulesdirect/assets/p15708064_b_h3_aa.jpg',4,NULL),('SH029067060000','Arts documentary.',NULL,'GBR','The Art of Now','https://s3.amazonaws.com/schedulesdirect/assets/p15196090_b_h3_aa.jpg',4,NULL),('SH029168400000','In der Dokumentationsserie werden alte Schrottteile recycelt und in komplett neue Gegenstände umgewandelt.',NULL,'DEU','Die Schrott-Transformer','https://s3.amazonaws.com/schedulesdirect/assets/p12772178_i_h3_aa.jpg',4,NULL),('SH014699490000','Wartime battles produce many heroes, the brilliant generals and brave troops whose selfless acts of courage saved hundreds of thousands of lives. \"Narrow Escapes of World War II\" celebrates and honours the heroes of WWII who stood up and fought when everything else seemed lost. The series re-creates the suicidal raids, rearguard actions, and back-to-the-wall fighting it took to make sure these men made it home safely, highlighting such events as the Battle of the Bulge, Operation Hannibal, Moore\'s March, Operation Pedestal, and Gen. Wilhelm Stemmermann\'s \"Breakout Through Hell\'s Gate\'.',NULL,'GBR','Narrow Escapes of World War II','https://s3.amazonaws.com/schedulesdirect/assets/p8821801_l_h3_aa.jpg',4,NULL),('SH028004160000','Die Sendung begleitet junge Gefängniswärter und -wärterinnen in den ersten Tagen und Wochen ihrer neuen Beschäftigung in einem Staatsgefängnis in New Mexico. Füe sie alle gilt es, sich rechtzeitig zu behaupten und sich Respekt zu verschaffen.',NULL,'DEU','Der härteste Job der Welt - Ausbildung im Knast','https://s3.amazonaws.com/schedulesdirect/assets/p11935460_i_h3_aa.jpg',4,NULL),('SH003331970000','Ein Kiez in Berlin-Mitte ist Schauplatz von zahlreichen spannenden Abenteuern des Alltags. Die Serie begleitet ihre Protagonisten durch die Höhen und Tiefen des Erwachsenwerdens sow