ries of hilarious games and challenges about current events and the latest celebrity gossip. To add even more hilarity to the madness in the studio, celebrity guests join the panel each week.',NULL,'GBR','Celebrity Juice','https://s3.amazonaws.com/schedulesdirect/assets/p8210937_b_h3_ad.jpg',4,NULL),('SH019666900000','In der Quizsendung tritt ein Team von vier Kandidaten gegen ein Superhirn, den `Jäger\', an. Keine leichte Aufgabe, denn die Jäger sind ausgewiesene Quizprofis aus der deutschen Quiznationalmannschaft, darunter sogar der Deutsche Quizmeister. In der ersten Runde bauen die Kandidaten einzeln eine Spielsumme auf, die sie in der zweiten Runde gemeinsam gegen den Jäger verteidigen müssen, um in das Finale einzuziehen. Im Finale treten die verbliebenen Kandidaten im Team gegen den Jäger an und verteidigen das bisher erspielte Geld. Sie müssen innerhalb von zwei Minuten so viele Fragen wie möglich beantworten. Beantworten die Kandidaten mehr Fragen als der Jäger richtig, haben sie gewonnen.',NULL,'DEU','Gefragt - Gejagt','https://s3.amazonaws.com/schedulesdirect/assets/p10948433_b_h3_aa.jpg',4,NULL),('SH013033650000','YouTube is all the rage right now. \"Rude Tube\' finds the best videos available on the site, from rare gems to clips with millions of hits, and presents them to viewers, doing all the hard work in sorting through the bad stuff so viewers don\'t have to. But `Rude Tube\' doesn\'t stop at showcasing some of the Internet\'s best videos. The programme finds people featured in the viral videos and gets the backstories on the clips as well as the impact that Internet famed has had on their lives. Whether you\'re looking for guilty pleasure videos or cute animals, chances are you\'ll see it on `Rude Tube\".',NULL,'GBR','Rude Tube','https://s3.amazonaws.com/schedulesdirect/assets/p8201067_l_h3_aa.jpg',4,NULL),('SH031652180000','Florian aus Leipzig erbt von seinem Großvater einen Bauernhof in Bayern, zu dem auch Racko, der Hund des Großvaters, gehört. 