egret their decision. Outrageous artwork, inappropriate quotes or the name of an ex-partner can be chosen in haste but the results are permanent. The talented inkers meet desperate customers at a pop-up studio for their consultations. After the meeting, the client chooses whose design ideas they like best and the artist gets to work. When the session is over, the new tattoos are revealed.',NULL,'GBR','Tattoo Fixers','https://s3.amazonaws.com/schedulesdirect/assets/p11868492_i_h3_aa.jpg',4,NULL),('SH017603140000','A mysterious man enforces law and order in 1890\'s Wyoming.',NULL,'GBR','The Virginian','https://s3.amazonaws.com/schedulesdirect/assets/p512143_b_h3_ae.jpg',4,NULL),('SH018433120000','Die Sendung vertieft die Informationen über tagesaktuelle Ereignisse und zeigt Zusammenhänge sowie Hintergründe. Häufig gibt es mehrere Beiträge zu einem Thema, in denen unterschiedliche Aspekte beleuchtet werden. Oft ergänzt ein Interview mit einem Experten oder ein Schaltgespräch mit einem Reporter die Filmberichte. In der Regel gibt es zum wichtigsten Thema des Tages einen Kommentar. Das Spektrum der Themen umfasst neben den aktuellen Hintergrundberichten auch längere Reportagen, die nicht an den Tag gebunden sind. Kultur und Kino runden die Sendung ab. Beiträge aus der Politik überwiegen aber in der Berichterstattung, gefolgt vom Themenkomplex Wirtschaft.',NULL,'DEU','Tagesthemen','https://s3.amazonaws.com/schedulesdirect/assets/p10414050_b_h3_aa.jpg',4,NULL),('SH012584290000','Members of the public are invited to try to make money out of their antiques by taking a risk at auction.',NULL,'GBR','Flog It!','https://s3.amazonaws.com/schedulesdirect/assets/p387374_i_h3_aa.jpg',4,NULL),('SH019562270000','Jonathan Smith kehrt als Engel auf die Erde zurück. Er erhält von Gott den Auftrag, den Menschen Liebe, Verständnis, Rücksichtnahme und Achtung beizubringen. Obwohl er überirdische Kräfte besitzt, kommt er meistens ohne sie aus.',NULL,'DEU','Ein Engel auf Erden','https://s3.am