e Judy Sheindlin. Each episode finds Judge Judy presiding over real small-claims cases inside a televised courtroom. Her no-nonsense, wisecracking approach has been unsuccessfully copied by other TV court judges.',NULL,'GBR','Judge Judy','https://s3.amazonaws.com/schedulesdirect/assets/p184382_b_h3_aa.jpg',4,NULL),('SH019561530000','Der Rechtsanwalt Ingo Lenßen untersucht mit seinem Team aus Detektiven fiktive Kriminalfälle. Dabei wird er meist mit dem Aufklären von mittelschweren Straftaten und Verbrechen beauftragt. Und manchmal gerät auch er selbst ins Visier der Verbrecher.',NULL,'DEU','Lenßen & Partner','https://s3.amazonaws.com/schedulesdirect/assets/p9019903_st_h3_aa.jpg',4,NULL),('SH019560640000','Die Serie begleitet Polizisten bei ihren alltäglichen Einsätzen, die auf realen Fällen basieren. Dabei sind sie rund um die Uhr im Einsatz. Gezeigt werden Fälle von gewalttätigen Auseinandersetzungen, häuslicher Gewalt sowie Drogenmissbrauch. Die Bandbreite an Polizeiarbeit ist enorm. Sie beschränkt sich nicht nur auf die Bekämpfung von Verbrechen. Die Beamten auf Streife helfen auch verwirrten Menschen wie etwa Rentnern, die ihre Adresse vergessen haben oder Jugendlichen, die in ihrem pubertären Leichtsinn Vorbilder brauchen.',NULL,'DEU','Auf Streife','https://s3.amazonaws.com/schedulesdirect/assets/p10904248_b_h3_ab.jpg',4,NULL),('SH019836710000','Todd Hoffmann und seine sechs Mann starke Crew wollen in der Wildnis Alaskas, nahe der kanadischen Grenze, nach Gold schürfen. Sie hoffen auf Reichtümer. Der Alltag der Goldsucher in der verlassenen Gegend ist jedoch alles andere als leicht.',NULL,'DEU','Die Schatzsucher - Goldrausch in Alaska','https://s3.amazonaws.com/schedulesdirect/assets/p8825082_i_h3_ab.jpg',4,NULL),('SH013139780000','The adventures of the Little Princess, who lives in a rather strange castle and is always full of energy, charm and questions.',NULL,'GBR','Little Princess','https://s3.amazonaws.com/schedulesdirect/assets/p8240782_i_h3_aa.jpg',4,NUL