 the theatrical film \"Stargate\".',NULL,'GBR','Stargate SG-1','https://s3.amazonaws.com/schedulesdirect/assets/p184337_l_h3_aa.jpg',4,NULL),('SH030382680000','A baby elephant with zebra stripes. A giraffe with peacock feathers and a pink flamingo coloured lion. These are just some of the unique animals found in Zafari, a valley at the foot of Mount Kilimanjaro.',NULL,'GBR','Zafari','https://s3.amazonaws.com/schedulesdirect/assets/p15118255_b_h3_aa.jpg',4,NULL),('SH024296700000','Eddie Huang und seine Familie stammen ursprünglich aus Taiwan und leben den Großteil ihres Lebens in Chinatown in Washington D.C. 1995 zieht Eddie jedoch zusammen mit seinem Vater Louis, seiner Mutter Jessica und seinen zwei Geschwistern Emery und Evan nach Orlando, Florida. Dort will seine Familie ein Restaurant mit Cowboy-Flair eröffnen. Der darauffolgende Kulturschock ist unvermeidbar. Nicht zuletzt ist der chinesische Bevölkerungsanteil Floridas zu dieser Zeit ein äußerst überschaubarer und der Rest der Bevölkerung propagiert in erster Linie westliche Werte - vom amerikanischen Traum ganz zu schweigen. Auch in der Schule und in der Nachbarschaft machen die kulturellen Unterschiede den Anfang nicht gerade leicht.',NULL,'DEU','Fresh Off the Boat','https://s3.amazonaws.com/schedulesdirect/assets/p10777606_l_h3_aa.jpg',4,NULL),('SH031186390000','The Jewellery Channel bring you Sankom, founded in 2003 in Switzerland and specializing in the development of health and weight management programs. Sankom hold a number of patents that are successfully marketed worldwide.',NULL,'GBR','Sankom','https://s3.amazonaws.com/schedulesdirect/assets/p16342109_st_h3_aa.jpg',4,NULL),('SH019842690000','Fox Mulder arbeitet als Special Agent beim FBI, hat dort aber den Ruf als Verschwörungstheoretiker inne. Als kleiner Junge hat er miterlebt, wie seine Schwester von Außerirdischen entführt wurde. Seitdem glaubt er an deren Existenz und beschäftigt sich mit paranormalen Phänomenen. Er arbeitet in der Abteilung für X-Akten, Kriminalfälle, die nicht erklärbar sind. Eines Tages bekommt er Dana Scully als Partnerin gestellt. Sie ist das Gegenteil von Mulder, skeptisch und unterkühlt. Gemeinsam arbeiten die beiden an mysteriösen Fälle, von Killer-Insekten bis hin zu Mutanten. Zeitgleich verfolgen sie die Aufdeckung einer Regierungsverschwörung, die versucht, die Existenz außerirdischen Lebens zu verschleiern.',NULL,'DEU','Akte X - Die unheimlichen Fälle des FBI','https://s3.amazonaws.com/schedulesdirect/assets/p183870_b_h3_aa.jpg',4,NULL),('SH026040630000','The adventures of a group of animated planes and their friends, as they deliver parcels and solve problems using their unique talents.',NULL,'GBR','Super Wings','https://s3.amazonaws.com/schedulesdirect/assets/p11545356_l_h3_aa.jpg',4,NULL),('SH018558610000','Das Magazin zeigt von Montag bis Freitag aktuelle Nachrichten zur Mittagszeit. Die Moderatorin präsentiert Informationen aus aller Welt, mit einem Schwerpunkt auf Deutschland, und spricht außerdem über Servicethemen, Lifestyle sowie das Neueste aus der Welt der Stars und Sternchen. Abgerundet wird das Sendungsprogramm mit spannenden Reportagen, die mitunter eine solche Brisanz haben, dass sie politische und wirtschaftliche Akteure zum Handeln veranlassen, und Mini-Dokumentationen, die verblüffende Einblicke in den Alltag der Deutschen geben.',NULL,'DEU','Punkt 12 - Das RTL-Mittagsjournal','https://s3.amazonaws.com/schedulesdirect/assets/p10458783_st_h3_ab.jpg',4,NULL),('SH018683780000','Nach Scheidung, schwerem Autounfall und langem Aufenthalt in einer Reha-Klinik ist Nadja Paulsen zurück, zurück in Halle, zurück im Leben. Die sympathische und selbstbewusste Frau muss ganz von vorne anfangen, und das gestaltet sich schwierig.',NULL,'DEU','Ein Fall für Nadja','https://s3.amazonaws.com/schedulesdirect/assets/p10510730_b_h3_aa.jpg',4,NULL),('SH019579470000','Verbrauchermagazin, das sich auf Produkttests und die kritische Berichterstattung konzentriert. `Markt\' gibt praktis