n as Jarhead in the Futuristic Zone and by Jessica Hynes as The Knight in the Medieval Zone.',NULL,'GBR','The Crystal Maze','https://s3.amazonaws.com/schedulesdirect/assets/p14250858_b_h3_aa.jpg',4,NULL),('SH012592930000','International political leaders, entertainers, corporate decision-makers and even everyday folks get the spotlight in this hard-hitting news programme.',NULL,'GBR','HARDtalk','https://s3.amazonaws.com/schedulesdirect/assets/p242121_i_h3_ab.jpg',4,NULL),('SH029068690000','Dr. Heinz-Wilhelm Esser und sein Team führen Experimente rund um Gesundheit und Ernährung durch.',NULL,'DEU','Doc Esser - Das Gesundheits-Magazin','https://s3.amazonaws.com/schedulesdirect/assets/p12600783_i_h3_aa.jpg',4,NULL),('SH025542980000','Der riesige Grizzlybär Grizzy wird von einer Horde nervtötender Lemminge geneckt.',NULL,'DEU','Grizzy und die Lemminge','https://s3.amazonaws.com/schedulesdirect/assets/p13330553_i_h3_aa.jpg',4,NULL),('SH029051540000','Tales of the world\'s worst puppy who woofs and wags his way into the lives of a blended family. Waffle is no ordinary pup and he has many a surprising twist in his tail.',NULL,'GBR','Waffle the Wonder Dog','https://s3.amazonaws.com/schedulesdirect/assets/p15187974_st_h3_aa.jpg',4,NULL),('SH019918650000','When bears, wolves and foxes are your only neighbours, life can be pretty lonely. Add minus-60-degree days and a constant battle for the most basic necessities, and you have the daily challenges of people who live in remote corners of Alaska. This series takes viewers deep into an Alaskan winter to meet tough, resilient residents as they try to stay one step ahead of storms and man-eating beasts to survive the season. When the closest neighbour is more than 300 miles away, these Alaskans subsist solely on what is hunted and foraged. They catch fish for currency in bartering for supplies, or use their packs of sled dogs for transportation. Also highlighted is a time of year not always part of what viewers see in Alaska: spring! Ice is breaking, animals are waking, and residents face new tests before deep cold returns.',NULL,'GBR','Life Below Zero','https://s3.amazonaws.com/schedulesdirect/assets/p9895118_i_h3_aa.jpg',4,NULL),('SH012680930000','Educational programme for four to seven-year-old children with learning difficulties.',NULL,'GBR','Something Special','https://s3.amazonaws.com/schedulesdirect/assets/p289357_i_h3_aa.jpg',4,NULL),('SH019671360000','In den USA mieten manche Privatpersonen Lagerräume für ihre Sachen an. Nach drei Monaten unbezahlter Miete kommt der Inhalt des Lagers zur Auktion. Allerdings dürfen die Interessenten den Lagerraum nur kurz von außen sehen, bevor sie bieten.',NULL,'DEU','Storage Wars - Die Geschäftemacher','https://s3.amazonaws.com/schedulesdirect/assets/p8354064_i_h3_ab.jpg',4,NULL),('SH021410940000','Science documentary series tackling everyday issues that affect us all.',NULL,'GBR','The Truth About...','https://s3.amazonaws.com/schedulesdirect/assets/p11571727_b_h3_aa.jpg',4,NULL),('SH018063270000','Visits to a wide variety of beautiful gardens.',NULL,'GBR','Garden Hopping','https://s3.amazonaws.com/schedulesdirect/assets/p391676_st_h3_aa.jpg',4,NULL),('SH013378660000','Based on the accounts of Marines in World War II, this 10-part miniseries follows the intertwined journeys of three US Marines in the Pacific Theatre - Pfcs Robert Leckie and Eugene B Sledge and Sgt John Basilone - from their first battle against Japan on Guadalcanal, across the sands of Iwo Jima and the horror of Okinawa, to their ultimately triumphant return after V-J Day. The producing team behind \"The Pacific\', including Tom Hanks and Steven Spielberg, also was behind HBO\'s award-winning miniseries `Band of Brothers\".',NULL,'GBR','The Pacific','https://json.schedulesdirect.org/20141201/image/assets/p8000042_i_h3_aa.jpg',4,NULL),('SH012593120000','The high commander of an alien expedition lands on Earth - what he considers to be the least-important planet - in human form as Di