ent under the leadership of network president Jeff Zucker to provide more alternative, entertainment-based programming is clearly afoot, and \"Death Row Stories\' is a prime example. The eight-part documentary - the result of a collaboration with Academy Award-winning directors Robert Redford (`Ordinary People\') and Alex Gibney (`Taxi to the Dark Side\') - revisits compelling capital murder cases in the US, detailing the twists and turns involved in each as a thought-provoking exercise on the death penalty and the American justice system. `Dead Man Walking\' Oscar winner Susan Sarandon is the narrator. Redford\'s Sundance Productions also partnered with CNN for the documentary series `Chicagoland\".',NULL,'GBR','Death Row Stories','https://s3.amazonaws.com/schedulesdirect/assets/p10474987_l_h3_aa.jpg',4,NULL),('SH026278450000','Das Reportagemagazin berichtet monothematisch über ein europäisches Thema.',NULL,'DEU','Re:','https://s3.amazonaws.com/schedulesdirect/assets/p13848076_st_h3_aa.jpg',4,NULL),('SH015989410000','Model-turned-cook Lorraine Pascale presents this programme in which she creates amazing food from scratch in a short period of time. Lorraine\'s recipes make it accessible for busy people to be able to cook dinner without resorting to a packet or a jar. Her meals, which are ideal for entertaining, include starters, main dishes, desserts and her signature bakes for all occasions. The easy recipes allow people to spend less time in the kitchen and more time having fun with friends and family.',NULL,'GBR','Lorraine\'s Fast, Fresh and Easy Food','https://json.schedulesdirect.org/20141201/image/assets/p9397375_i_h3_aa.jpg',4,NULL),('SH012735870000','A new group of medical students arrives to learn the ropes at Sacred Heart Hospital, where J.D., Turk, Kelso, and acerbic Dr Cox are their instructors. J.D. continues to romance Elliot as he imparts wisdom to a new class, which includes Lucy, Drew, Cole and Maya.',NULL,'GBR','Scrubs','https://s3.amazonaws.com/sc