ax & Shred','https://s3.amazonaws.com/schedulesdirect/assets/p11060851_b_h3_ab.jpg',4,NULL),('SH021731320000','This four-part miniseries celebrates the lives of the last survivors of the Second World War. Now in their nineties and older, those who fought or lived through the war share experiences of coping in a shattered world. In personal accounts, there are stories of heartbreak, the loss of loved ones, childhood memories and heroic acts of bravery. Interviews with the survivors, along with researched footage, piece together how a nation bonded in difficult times to fight for freedom, endure the Depression years and rebuild society for generations to come.',NULL,'GBR','Britain\'s Greatest Generation','https://s3.amazonaws.com/schedulesdirect/assets/p11724347_b_h3_aa.jpg',4,NULL),('SH019580550000','Die Rundschau informiert täglich über Nachrichten, Wetter, Sport, Verkehr und Regionales für Bayern und Umgebung und fasst die wichtigsten und aktuellsten Nachrichten zusammen.',NULL,'DEU','Rundschau','https://s3.amazonaws.com/schedulesdirect/assets/p10911702_i_h3_aa.jpg',4,NULL),('SH019729600000','In den Reportagen werden Orte in Berlin und Brandenburg erkundet, die spannende, bisher weitgehend unbekannte Zeitgeschichte aufzeigen.',NULL,'DEU','Geheimnisvolle Orte','https://s3.amazonaws.com/schedulesdirect/assets/p10972870_i_h3_aa.jpg',4,NULL),('SH018152240000','John Nettles recording of the ancient Chinese text of the Tao.',NULL,'GBR','Will Smith Presents the Tao of Bergerac','https://s3.amazonaws.com/schedulesdirect/assets/p10295484_st_h3_aa.jpg',4,NULL),('SH019765930000','Der Schüler Yu-Gi erhält von seinem Großvater das magische Spiel der Schatten, das seither ein großes Rätsel umgibt. Yu-Gi und seine Freunde machen sich an die Lösung des Rätsels und ahnen nicht, dass sie das Schicksal der Welt in den Händen halten.',NULL,'DEU','Yu-Gi-Oh!','https://s3.amazonaws.com/schedulesdirect/assets/p534172_b_h3_aa.jpg',4,NULL),('SH019562930000','Um 1870 in Walnut Grove, einem k