ional CIA operative who has been everywhere and seen everything. Cole must adjust to life on the West Coast while navigating his partnership with Murtaugh.',NULL,'GBR','Lethal Weapon','https://s3.amazonaws.com/schedulesdirect/assets/p12900695_i_h3_aa.jpg',4,NULL),('SH013792890000','CBS books a new version of the classic \"Hawaii Five-0\' series, with Alex O\'Loughlin in the lead role as Det Steve McGarrett and Scott Caan portraying Danno. The detectives are part of an elite task force whose mission is to eliminate crime on the beaches of the Aloha State. Assisting McGarrett and Danno is former Honolulu Police detective Chin Ho Kelly, who has been relegated to a federal security patrol after being wrongfully accused of corruption. Chin\'s fresh-out-of-the-academy cousin, Kono, also joins the team as she tries to establish herself among the department\"s elite.',NULL,'GBR','Hawaii Five-0','https://s3.amazonaws.com/schedulesdirect/assets/p8130405_l_h3_aa.jpg',4,NULL),('SH020795450000','TV-Koch Horst Lichter düst in dieser dreiteiligen Reihe durch den Südwesten und sucht nach ungewöhnlichen Geschichten rund um Oldtimer, Menschen und leckerem Essen. Dabei trifft er auf interessante Menschen und erkundet die Schönheit und Besonderheit der Region.',NULL,'DEU','Lichters Originale','https://json.schedulesdirect.org/20141201/image/assets/p11337316_b_h3_aa.jpg',4,NULL),('SH013084810000','Get ready for more animated adventures with Engie Benjy.',NULL,'GBR','Engie Benjy','https://s3.amazonaws.com/schedulesdirect/assets/p378273_b_h3_aa.jpg',4,NULL),('SH012664490000','A stand-up comedy series filmed at West London\'s renowned venue the Hammersmith Apollo. Britain\'s best loved comics and new talent perform on stage for a live audience. A guest performer hosts the evening\'s entertainment, introducing the biggest names in comedy before their sets. Those bringing the laughter and gags with them include Alan Carr, Jon Richardson, Sarah Millican, Jason Manford, Frankie Boyle, Nina Con